INSERT INTO `document` (`id`, `title`, `file`, `full_paper`, `abstract`, `keywords`, `school_year`, `defense_date`, `date_submitted`, `adviser`, `director`, `approval_sheet`, `reason_for_denial`, `research_status`, `privacy`, `copyright`, `course_id`, `category_id`, `document_type_id`, `slugs`, `views`, `downloads`, `created_at`, `updated_at`, `deleted_at`) VALUES
(150, 'Bingsulit: A Feasibility Study on Establishing a Food Stall Business', NULL, '', 'This study intends to determine the feasibility of establishing a Korean-inspired dessert shop using Filipino delicacies. BingSulit aims to serve the youth of Upper Bicutan and to offer a cool and refreshing treat in a chill and relaxing store. Each cup of Bingsu is delectable treat that can satisfy one\'s sweet tooth. This study aims to create a new fusion of Korean and Filipino desserts.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, '1IrtSbfRNz08', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(151, 'CUP D\' UP: A Feasibility Study On Establishing A Food Stall', NULL, '', 'This study intends to determine the feasibility of establishing a food stall business Cup D\' Up that will be serving inside Polytechnic University of the Philippines-Taguig, giving students a better reach to convenient stacks. Cup D\' Up is a heaping stack of snacks that offers small bite- sized food that lets you choose from fruits to finger food to gummy candies to biscuits and gives you a bonus drink at the bottom. This research is made to offer on-the-go snacks for consumers living in today\'s fast-paced lifestyle. It makes sure to give a reasonable price out of the cost of the ingredients and the quality of its services.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'kR82Xva3LpEo', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(152, 'DIC & DIP: A Feasibility Study On Doughnut Ice Cream And Dip', NULL, '', 'DIC & Dip - soft-served ice cream with doughnut on top aims to provide a unique way of enjoying snacks by combining ice cream and doughnut, thus doubling the fun. This research is made so as to provide another variety of snacks that the customers may enjoy here in Sintang Paaralan. The researchers made sure that the prices were strategically set to consider the customers without affecting the desired revenue. Thus, letting the customers enjoy a snack that surely fits their budget. Also, there is no need to choose between a doughnut and an ice cream because DIC & Dip offers both as one.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'GYWmeZAIruan', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(153, 'Eat Chao Time', NULL, '', 'The feasibility study “Eat Chao Time” intends to serve PUP-Taguig community a quality fried rice. The customers are free to choose from a variety of menu, from specific toppings of chao fried rice to ingredients incorporated in the fried rice itself like vegetables (or stalks of vegetables as flavor). “Chaorap na babalik-balikan” is Eat-Chao-Time’s motto. Since the customers have an everchanging taste and preferences with the food they eat, the proponents of this study has come up with the idea of, creating quality and affordable fried rice with exceptionally delicious toppings, come to life', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'VKWHEobjaY4I', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(154, 'SORBAETES: A Feasibility On Fruity Empanada', NULL, '', 'This study intends to determine the feasibility of establishing a dessert business with the name Sorbaetes. Sorbaetes\' main product consists of ice cream, fresh fruits and the empanada dough as the base. The dessert will be served in Mercado Del Lago at Lower Bicutan, Taguig City. The research aims to provide customers a unique taste and variety of ice cream. The research is made to offer people a different alternative to the usual dessert with affordability and quality in mind, making sure that customers will get the best with the price to be paid', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'kmpchynqoZOH', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(155, 'Tahu-Tahuan: A Feasibililty Study on Establishing a Food Stall Business', NULL, '', 'This study intends to determine the feasibility of establishing a new business - TahuTahuan. The prospective business will provide a new taste to the classic taho. The business not just aim to feed the tummy but also feed the mind and soul of the customers through the memories in each cup of taho. Tahu-Tahuan will surely brought the customers back in their childhood days when they play outside games. Also, the proponents strategically choose the flavors that will be served in order to provide a new experience to the prospective customers.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, '0rVUHfxm7pjn', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(156, 'Cafeme Feliz: A Feasibility On A Anime-Themed Cafe', NULL, '', 'Wanna eat your favorite viands but you’re on a diet? Don’t worry because the proponents’ business got it all solved for you! Café me Feliz offers pastries filled with your favorite Filipino dishes such as Adobo, Menudo, Humba, Chicken Curry, Mechado and Caldereta. And not only that, the café will also provide a cool and instagrammable place for both otakus and non- otakus in the urban. The business advocates named this business Café Me Feliz because of quite simple reasons. With the Spanish word Feliz which means “happy”, the business isn’t going to be a typical Café but a place where people can enjoy their “inner kid’ by being able to experience an anime themed cafe with quality services. The business will be providing pastry with a twist, that is, a pastry bread filled with Filipino cuisines inside. This inventive way of serving pastries was influenced by the Chinese Siopao, further developed by adding a Filipino flavor and style on it.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, '1LCjF5ofWtVi', 1, 0, '2021-07-21 12:32:28', '2021-08-02 12:47:39', NULL),
(157, 'Daragang Magayon', NULL, '', 'Daragang Magayon will offer apparels such as clothes, shoes and bags for Filipina women. These apparels are styled with touch of Philippine Ethnic designs that relates traditional prints into modern fashion. This is to promote self-identity by “wearing your culture”. The said business is perfect to show Filipina beauty since it is fashionable and trendy.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'tka2hYC7odyM', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(158, 'Feasibility Study On Sing 2 Nado', NULL, '', 'The proponents of this Feasibility Study came up with the name of the business, “ Sing 2 Nado “. It came from the Filipino word “Sintunado” which refers to an out of tune singing. Since nowadays, Filipinos are more hooked up with crazy trendy stuff, we came up with the idea of rooting the business name from that word. We also want the customers to remember our business in a way that is not usual because we offer a Karaoke room for rent where they can sing as long as they want. The root word does not literally mean that we offer our service for ‘Sintunados”. We know that Filipinos love to sing wherever and whenever they want. We would like to offer them the best quality of Karaoke equipments and convenience while they are inside the rooms. Social Media plays a vital role in establishing business. We want to catch the attention of the mass especially our target market through a unique business name. The proponents believe that our business will bring a smile to people who will visit our business and also to those who will hear our business name. We want to play a big role in the entertainment of our customers. Satisfaction and happiness are what we offer in Sing 2 Nado.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'AYlbCgOaiH1s', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(159, 'Printzone', NULL, '', 'Custom products became popular in recent years. The human innate willingness to personalize the things they use and to customize it as to their preference sparked the personalized product and services in the market today. Over the years, individuals have been seeking products that suit their needs and wants. However, not every need and want of the clients are known to the product makers. As a result, customization is the best alternative for those individuals and organizations that seek specifications. The team decided to choose printing service (mainly t-shirts, mugs and bags) as it has a wide array of opportunities. Occurring events that needed souvenirs has led to large volume of custom products to suit the event. The #Printzone is a service – merchandising business that offers personalized merchandise such as T-Shirts for kids and adults, Polo Shirts, Mugs of different kinds, Tumblers, Drawstring Bags, and Business Cards, to cater the needs and wants of the customers. The company’s mission is to give God the glory through Godcentered services and providing the community quality services in putting their ideas and imaginations into classy artworks. Potential clients can expect timely services and friendly customer service from the crew. The #Printzone assures professional handling by hiring competent employees that will make the clients feel comfortable transacting with the latter. The quality of service is never compromised by the #Printzone. The #Printzone’s target market primarily composed of Parañaque citizens, from 15 to 49 years of age and is willing to purchase personalized products. An online market is also considered composed of similar age bracket and from places in the National capital Region. The #Printzone will be located at 146 Doña Soledad Avenue, Better Living Subdivision, Parañaque and will be servicing the clients in accordance to the proper mechanical procedures to ensure the highest quality of the product is achieved. The #Printzone team applied proper managerial method to determine the investment\'s payback period. The financial aspect explained the major assumptions that is used to produce projected financial statements. The #Printzone will be servicing the demand gap in accordance with the community guidelines and will assume environmental and social responsibilities.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'YUDLj7vI15yF', 0, 0, '2021-07-21 12:32:28', '2021-07-21 12:32:28', NULL),
(160, 'Rainbow Treats', NULL, '', 'Filipinos are well-known to be a big fan of food. They are undeniably fond of eating various kinds of cuisines, breads, desserts, snacks etc. Foods don’t just satisfy your cravings but they also bring happiness. They also strengthen ties between the family and circle of friends. Aside from the three basic meals a day, Filipinos usually have two light meals or also known as “merienda”. The first is a morning snack that may correspond to either brunch or second breakfast and the other one is the equivalent of afternoon snack. Nowadays, establishing and franchising food stalls are very rampant. Many entrepreneurs succeed in this type of venture because they aren’t that difficult and costly. Through these stalls, they can easily reach out their products to the customers of different ages. But today, the common problem is that the emerging businesses offer the same products and the customers are dissatisfied with it. In the field of economics, the Law of Diminishing Marginal Utility states that as a person increases consumption of a product while keeping consumption of other products constant, there is a decline in the marginal utility that person derives from consuming each additional unit of that product. As a solution to the existing problem, the proponents wanted to create and launch a new stall with new products that will surely attract customers. The stall offers new products namely colored mojos, cheese bites, tornadogs, octohotdogs and colored lemonades. 2 | P a g e Mojos literally means a marinade used throughout the Caribbean and South America that uses citrus juices as a base. It is commonly applied to chicken, beef, pork or seafood as a tropical flavoring. It is a marinade that became popular in Cuba and then spread throughout the South American countries.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, '1rjipAmPFNbL', 0, 0, '2021-07-21 12:32:29', '2021-07-21 12:32:29', NULL),
(161, 'SURFRICE: A Feasibility Study on A Fast Food Restaurant', NULL, '', 'The researchers opted to choose SURFRICE as the name of the business for two main reasons. First, because the business is about offering their valuable customers unlimited fried rice for an affordable price. Second, because SURFRICE does not only offer unlimited fried rice but also unlimited surprise for the consumers. The researchers generated the company name as “SURFRICE” as it is a 3 combined English word “surprise” and “fried rice”. Hence, the company name “SURFRICE”. Definitely, the customers will be surprised by the unlimited fried rice we serve, the variety of Filipino dishes/viands and how affordable our meals we offer.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'uxyeBXc1nNOr', 0, 0, '2021-07-21 12:32:29', '2021-07-21 12:32:29', NULL),
(162, 'Sweet Paradise', NULL, '', 'Per Jeff Fromm, the president of FutureCast- a marketing consultancy, “In the past, crafting and ‘doing it yourself’ seemed to be reserved for grandmas and middle aged women book club activities,” a self-proclaimed DIY-addict. “Now, young adults under the age of 35 dominate the 29-billion-dollar crafting industry. Millennials are bringing together technology, creativity and entrepreneurism as they take on more DIY projects…”. Millennials have been conditioned to engage with content. The whole premise of social media is that you post content, share content and provide feedback on other users’ content. These people want to be involved in something bigger than themselves. Research shows that four out of ten millennials are interested in co- creating products with other brands. Many brands are now taking advantage of this by giving users the chance to customize product and service offerings to suit their own taste and needs. Even in the social media Facebook nowadays, so many DIY videos have become a trend to them. DIY millennials crave experiences over tangible items. The accomplishment of creating their very own product inspired by their own idea is a satisfying achievement for them. Considering all these facts, it should become clear that this segment of the millennial demographic wants to play an active role. They don’t simply want to sit on the sidelines and watch everything unfold, they want in on the action. Page | 2 The Magnum Pleasure Store or The Magnum Bar is a global concept, where pleasure seekers can enjoy the ultimate Belgian Chocolate experience of making your own Magnum for a limited amount of time only. Previously located in SM Aura, the DIY Magnum is now available for all pleasure seekers in one of the biggest premium shopping malls of the Philippines: Mall of Asia. This ice cream bar, allows customers to get inspired by an array of exciting Belgian chocolate flavors, and combine these to create truly unique Magnum desserts, that satisfy every specific craving. This store has been proven to be successful in its industry not only because of the goodwill that the product has already acquired but also the rising DIY mentality of contemporary consumers.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 5, NULL, 5, 'YFnfOvBdyqut', 0, 0, '2021-07-21 12:32:29', '2021-07-21 12:32:29', NULL),
(186, 'Memorniture', NULL, '', 'Memorniture is a furniture-production company that was established by Karen Mae Lavado, a student of Bachelor of Science in Business Administration Major in Marketing Management of the Polytechnic University of the Philippines. Furniture is part of our everyday lives. There are seats to sit and rest, beds to recharge at the end of the day, cabinets and drawers to store the private, personal and important things; and tables for working, eating or on which to place things. Every day, most people might not pay much attention but furniture help a lot to support many human activities. Furniture witnessed every people’s joy, frustrations, sorrow, sadness; and challenges and success in life. Furniture are part of every person’s memory that’s why in Memorniture, furniture will be full of memories. Furniture are not new to people. Since the late Paleolithic or early Neolithic period, from around 30,000 years ago, people began constructing and carving their own furniture, using wood, stone and animal bones. And because of that, the researcher thought, “How can I stand out from so many furniture makers? I need to think of something new, something unique and something that will make the customers distinguish me from my competitors.” And that’s where Memorniture came. Memorniture is equals to innovated and multi-functional furniture and will be equal to number one furniture-making company not just in Luzon, but also in Visayas and Mindanao. Keywords: furniture, innovated, multi-functional', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 7, 'eak5VuYi62LZ', 0, 0, '2021-07-21 12:45:53', '2021-07-21 12:45:53', NULL),
(187, 'Analysis Of The Social Media Influencer’s Effect In Building Brand Image And Consumer’s Purchase Int', NULL, '', 'The purpose of the research was to analyze how social media influencers effect in building brand image and consumer’s purchase intention with the selected working individual in Lower Bicutan, Taguig, Philippines. The social media influencers, as part of a marketing tool to help provide information about products and services to the social media audience. Through the social media influencer‟s profile such as attractiveness, visibility, credibility, and power companies were able to build strong brand image: service, product, and company. The research would implement the cross sectional design, with the data gathered through online questionnaires shared in social media accounts. The samples would be gathered using the convenience sampling technique, with respondents up to 398 people. The research implemented the purchase intention as the endogenous variable and social media influencers as the exogenous variable, as well as brand image as the intervening variable. Spearman rank order correlation (Spearman‟s rho) was conducted to determine the significant relationship between the social media influencers‟ profile and the purchase decision of working class in Taguig City. The research resulted in a moderate correlation of significance in the influence of both social media influencer and brand image towards the purchase intention.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, '9gYebJZPpSRO', 3, 0, '2021-07-22 09:31:53', '2021-08-02 12:47:23', NULL),
(188, 'A Study On The Impact Of E-Service Towards Customer’s Satisfaction And Loyalty On Generation Z’s Onl', NULL, '', 'E-service is known as a critical factor for successful implementation and decent performance of any business in electronic environment. The growing usage of internet and online shopping in Philippines presents a huge prospect in e-commerce market. As a result, E-service quality, E-service satisfaction and E-service loyalty become vital for online retailers to attract and retain online shoppers in this virtual environment. The purpose of this study is to propose and assess the level of E-service in terms of E-service satisfaction and E-service loyalty. In order to fully determine the impact of E-services, a total of 400 respondents in P.U.P campuses of Taguig and Parañaque were surveyed. The results indicate that all the dimensions of E-service quality were found to have positive and significant effect on E-service satisfaction and E-service loyalty of online shoppers. The assessment revealed that females are more willing to tell their satisfaction and loyalty level concerning to E-service. In addition, age groups of 18-20 use E-services more frequently rather that the other age groups mostly in Generation Z. With these findings, researchers made recommendations. The online shoppers Esatisfaction was positively and significantly affected their E-loyalty towards continuous usage of online retailer’s website. And we recommend for future researchers to conduct a multivariate analysis on what makes consumers dissatisfied in using E-service in order to balance with E-service satisfaction', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, 'c5A8zZQmUMPb', 19, 0, '2021-07-22 09:31:53', '2021-10-11 04:22:49', NULL),
(189, 'The Level Of Effectiveness Of Online Advertisements In Student’s Buying Decisions At Taguig City Uni', NULL, '', 'With the rapid advancement in the industry advertisers are expected to shift and spend millions in internet advertising in the coming years than TV, print ads and other traditional advertising media. The internet is becoming an important one stop point for consumers in finding most of their needs. Be it communication, entertainment, shopping, information search, internet serves as a panacea for all their requirements. The Internet has become a popular advertising platform because marketers found that the Internet possess greater flexibility and control over the advertising materials. Many consumers are online every day for their personal work, but do they notice threads, banners displayed on that webpage, and most important their recall value. The current study investigated the effectiveness of online advertisement on consumer behavior of students by conducting a case study in the Taguig University. The study sought to determine the effectiveness of online advertising on credibility, informativeness, irritation and entertainment; and to determine the level of effectiveness when grouped according to profile. The study used a case study research design.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, 'ySzZ6YEUPLbR', 0, 0, '2021-07-22 09:31:53', '2021-07-22 09:31:53', NULL),
(190, 'Impact Of Celebrity Endorsements Towards Selected Fast Food Chains On The Purchase Attitude Of Consu', NULL, '', 'The study titled “Impact of Celebrity Endorsements towards Selected Fast Food Chains on the Purchase Attitude of Consumers in Barangay Tuktukan, Taguig City” sought to determine the impact of celebrity endorsements in consumer buying behaviour towards selected fast food chains in Barangay Tuktukan, Taguig City. Overall, its objective is to know the opinion and understanding of the respondents about the impact of celebrity endorsements and how does it affect their purchasing and consumption behavior to products being offered by fast food chains. The researchers identified four celebrity endorsement determinants or factors to consider in determining the best celebrity to endorse the brand which are (1) Attractiveness, (2) Credibility, (3) Expertise and (4) Celebrity Match or Good Product-Celebrity Fit. This endeavor also focused on the significant impact of celebrity endorsements to purchasing behavior of the respondents. The survey was executed at the target locations which include fastfood chains such as Jollibee, Mang Inasal and McDonalds in Puregold and Vista Mall which are all located within the vicinity of Barangay Tuktukan, Taguig City on times which the survey team is available.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, 'J7yElqMQzbx5', 0, 0, '2021-07-22 09:31:53', '2021-07-22 09:31:53', NULL),
