(229, 'Evenour', NULL, '', 'Evenour helps clients look for the best and suitable suppliers of event paraphernalia. Through the application, searching for potential suppliers will be easier for it provides a vast amount of different event suppliers. Planning, organizing, and reaching event suppliers on your own will be easier with the use of Evenour application at a fraction of a cost lower than hiring personal event organizer. Keywords: Event planner, events, planner, organizer', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, 'rueMKtAODxHE', 0, 0, '2021-07-22 09:35:18', '2021-07-22 09:35:18', NULL),
(230, 'Expectation Vs. Reality: The Effects Of Displayed Photos On The Menu In Contrast To Its Actual Appea', NULL, '', 'The customer’s perception regarding business’ goods or services has a great impact on their buying decision. This leads companies to spend much money on marketing their brands and to influence the perception of the customers. People are more likely driven to select their choice of product through the quality of its image on the menu. One of the reasons why consumers buy a product is because of its advertisement, especially on how wonderful and creative it was presented. Customers rely on what they see on the displayed photos on the menu, and it encourages them to acquire the products. This only shows the behavior of the consumers with regards on how they patronize the food based on its image. Customers tend to direct their attention to the product images that will later on stimulate their appetite. Some companies grab the opportunity to make the images appear more attractive and appealing to the point that the images become unrealistic. These images are known to be overly presented far from its actual appearance. This research would enhance the customers’ awareness on how food advertisements can affect their buying decision. This would also allow the customers to discover what qualities food menu and the food’s actual appearance should possess that would encourage them to purchase a product. Moreover, this study will also be useful to businesses, particularly fast food restaurants. It may give the companies a good basis on studying the pattern of the buying behavior of their customers. This study determined the most preferred quality found on both the food menu and its actual appearance that customers used as a basis on their buying decision. This study identified the effect of these qualities on customer\'s perception. Keywords: Food, Customer Perception, Expectation vs. Reality, Picture, Difference, Appearance', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, '9lBxSrabQCvt', 0, 0, '2021-07-22 09:35:18', '2021-07-22 09:35:18', NULL),
(231, 'FUSION CINEMA', NULL, '', 'The Fusion Cinema is a special cinema that will showcase different type of films such as Indie Films, Filipino, American, Thai and Japanese Movies. This is a cinema theatre which has several rooms where different type of movies will be aired, and customers may choose among various movie collections. Aside from providing movie services, this business will also market concession products that cinemas usually sell. The growing popularity of different type of films in the Philippines has created the opportunity for the proponents to establish this business. Keywords: Cinema, Movies, Films, Movie House, Feasibility, Marketing, Business', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 6, NULL, 4, 'FIyb7NkCMVg1', 0, 0, '2021-07-22 09:35:18', '2021-07-22 09:35:18', NULL),
