(235, 'Medicare: Arduino Based Automatic Medication Cabinet Reminder', NULL, '', 'A large number of patients fail to comply with their prescribed medication schedules. This can cause disease complications, lower quality of life, and even mortality. To overcome these issues the automatic medicine reminder is used. This system is very simple to operate and update therefore a person of any age group can use it. This system can also be useful in hospital where number of patients is present and sometimes it is difficult to remember the medicine and dosage by the staff. This system, when introduced with some updates, can also be used in hospitals.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'cHmhaoGnBIWU', 0, 0, '2021-07-22 09:55:15', '2021-07-22 09:55:15', NULL),
(236, 'Development Of Earthquake Early Warning Using Piezoelectric Material', NULL, '', 'The main purpose of this paper is to propose the basic idea of automatic medicine reminder based on ARDUINO which will help the patients to take their prescribed medicine at appropriate time. Automatic medicine reminder is novel idea to help the patient to take their medicine on time and hence may reduce the time to recover from their disease. Sometimes, the aged patient takes the wrong medicine and their wrong dosage incorrectly causing the severe problem. This system is not just helpful for an individual but can also have major contribution in hospitals. In today’s busy, stressed and scheduled life, people are suffering from lots of disease but are not able to remember their medicine and timing of it and here this system can be of real use. This system uses LCD (liquid crystal display), Keypad, ARDUINO module, Servo Motor, and RTC Clock Module.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'BpT920Ac1VXv', 0, 0, '2021-07-22 09:55:15', '2021-07-22 09:55:15', NULL),
(237, 'Ease: Electro Acupressure Slippers For Elderly', NULL, '', 'This research introduces a functional use of medicine reminder inside an institution. Hoping to contribute for the betterment of the existing system and lessen the unfortunate events happening inside the institution.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, '037mJ9nOqFoL', 0, 0, '2021-07-22 09:55:15', '2021-07-22 09:55:15', NULL),
(238, 'Sustaining Electricity Conservation Through Renewable Resources', NULL, '', 'Renewable Energy is a natural source which replenishes, aiming to overcome energy supply depletion caused by the usage and consumption, either through biological or other natural recurring processes in a finite amount of time in human time scale.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'Wekjgar3VoRG', 0, 0, '2021-07-22 09:55:18', '2021-07-22 09:55:18', NULL),
(239, 'WLAN Based Flashflood Monitoring And Alerting System For Dalitiwan River System', NULL, '', 'Floods are natural disaster that accounts for more than half of natural disaster worldwide. A study between 1991 to 2005 shows 120,000 casualties results from flash flood occurrence around the world. Flash flood is the sudden occurrence of flood running down the stream at fast rate due to heavy rainfall. This causes devastating impact on the surrounding community that can lead to loss of lives and properties. These impact commonly occur on rural areas because of its topography and due to lack of alert system, casualties and fatalities occur. Various way such as Wireless Sensor Networks are commonly used for the monitoring and control of environmental surveillance, in this case, the flash flood detection. As result, this helps prevent the casualties brought by these such events, saving lives and properties. A recent occurrence of flashflood happened last October 15 to 18 in Zamboanga, Philippines due to heavy rains and storm surge brought by the Inter-Tropical Convergence Zone (ITCZ). This flooding affected over 12,000 individuals covering at least 2,448 families from 12 barangays. The heavy rain also increased the river level which causes further flooding. This disaster brought damages to infrastructures such as farmlands, fisheries, rice fields, and buildings. Local report said that over 200 homes were destroyed and 478 houses were damaged due to this disaster which also causes fatalities of 1 person reported to be dead. In connection, this study aims to provide support to the community of Majayjay, Laguna which suffers from the damage caused by flashflood. The concept of this study is to have an early prediction of when flashflood will occur through the use of sensors as its hardware platform, a gateway node that will act as the bridge between the network and sensors which uses amateur radio frequency of 2.4Ghz.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'pBAxgXkJUi2I', 0, 0, '2021-07-22 09:55:18', '2021-07-22 09:55:18', NULL),
(240, 'Control System Of A 3D Pen Filament Maker', NULL, '', 'Plastic is considered as major problem in our environment. It is undeniably that the growth of plastic wastes is uncontrollable. Some ways to recycle plastics is by using it on making new products like chairs, tables and materials for building houses. There are many ways on how to recycle plastic but we think of other that is relevant to us. So, we came up with the idea of using plastic bottles as a filament in 3D pen. Helping the environment by maximizing ways on how to reduce numbers of garbage is one of the needed actions of people. Construction of things out of curiosity and also with the use of technology, people can eventually reduce struggles faced by the nature. The reason why we eventually have a country continuing in progression is because of minds of people having that thinking of creating innovative things out of curiosity. Upon checking the status of the country, it is not deniable that garbage is the main problem of the Philippines and a lot of people are inventing different things to make things out of scratch. This project thesis presents production of 3D Filament using controlled system filament maker. It is intended to take control of making filament out of plastic by mainly adjusting the parameters including the speed of the motor, the temperature needed and the amount of torque required to align the structure in accordance to the pressure inside the pipe because of the diameter of the nozzle. It aids in the increasing problem of people when it comes to their garbage. By simply having an input of plastic, people will be able to build the desired output they want. Due to increasing demand in the market, 3D materials are indeed surrounding the human needs and wants. Supplying more demand while decreasing the problem in environment and making profit out of affordable materials is really the dream of every people. Giving a feedback on the different prices of materials in market, the researchers can say that the existing filament that producers uses now is really expensive and in return, the price of supplies is really where in when people will be able to build a cheap raw materials , it is an assurance that price will go down. Aside from aiding the price of materials in market, this project will also help in reduce, recycle and reuse of materials. The researchers were able to know the growing problem in the society and the main purpose of the project is to sustain the required and the needed solution for the problem.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'kTLisbUvpzO4', 0, 0, '2021-07-22 09:55:18', '2021-07-22 09:55:18', NULL),
(241, 'Papaya Disinfecting And Ripeness Delaying By Germicidal Uv-Light And Soundwave Exposure', NULL, '', 'A system for detecting and delaying the ripeness of papaya for prolongation of shelf life using UV-light and soundwave exposure.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'cR7VIkyXNn3j', 0, 0, '2021-07-22 09:55:20', '2021-07-22 09:55:20', NULL),
(242, 'Plant Incubator For Mentha X Piperita', NULL, '', 'This project thesis presents an enhanced shelter for a plant in which temperature and humidity is controlled by means of sensors and components. It generally forwards the values sensed in the enclosed environment to the microcontroller for comparison, then performs tasks such as powering up a relay to open the humidifier and such. Some parameter, such as moisture level is also monitored but not limited to ensure the positive progressive growth of a plant. In addition, by constantly adjusting temperature and humidity parameters it can progressively make the plant adapt to certain level of parameters that will make it acquainted to that environment thus, making the plant suitable to an offset environment.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'K4jxpeFi5SXt', 0, 0, '2021-07-22 09:55:20', '2021-07-22 09:55:20', NULL),
(243, 'RFID Based Assistive System For The Students Of Philippine National School For The Blind', NULL, '', 'Vision plays an important part on each individual. As vision permits individuals to gather the data required for perceiving the surrounding. According to the website, www.blind.org.ph/blind- phil.html, a large portion of a million people in the Philippines is blind. Blind individuals face numerous challenges in day to day life. Like everyone else, blind can work in one place and live in another place. A standout amongst the most difficult undertakings for them is traveling securely, independently or without being accompanied. As for the blind individuals, they are experiencing considerable difficulties in outdoor conditions alone. For them to travel, some use assistive technologies, some have human accompanying them and some just uses their senses alone. With respect to the senses, blind individuals utilize touching and hearing as their fundamental approach to determine the surrounding objects. They are restricted in recognizing, finding and distinguishing obstacles. These barriers make blind individuals not able to travel securely and independently alone. As part of the daily lives, mobility is involved.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'ouiaxby1sXgW', 0, 0, '2021-07-22 09:55:20', '2021-07-22 09:55:20', NULL),
(244, 'Solar-Powered Reverse Vending Machine With USB Charging In PUP - Taguig', NULL, '', 'This research aims to develop a solar reverse vending machine that will provide charging of smartphones in return of inserting plastic bottles, tin cans and papers. Heaps of solid wastes are produced per day and only a few percent of these are reprocessed and reapplied. One of the solid wastes produced per day is plastic bottle. A regular vending machine uses money as mode of payment, however, in this developed product of a customized vending machine, plastic bottles, tin cans and papers are the modes of payment in exchange for smartphones for a certain amount of time. This accord to the advancement of technology related in reducing the deterioration of environment caused by these wastes.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'a793XruwkvSA', 0, 0, '2021-07-22 09:55:20', '2021-07-22 09:55:20', NULL),
(245, 'Automated Greenhouse Monitoring And Controlling System With Gsm Integration For Rosemary', NULL, '', 'Greenhouse is a structure built up mostly with glass or clear plastic roof and walls, where plants such as flower and vegetables are grown. But its structure cannot block the heat coming from the sun. In line with this, the sun warms plants, soil, and other things inside the building which causes draught to plants when neglected, especially during the summer months in the Philippines. High temperature is a common factor affecting the plant development process and growth. Therefore, the temperature should be maintained at the required temperature level whenever possible. The easiest way to get started in greenhouse vegetable production is to use the existing soil on site, but soils must be well drained. Soil water serves as a solvent and carrier of food nutrients for plant growth but overwatering the plant could cause drowning and rotting of the roots. This could happen with gardeners who manually water their plant in traditional greenhouse. To avoid excessive moisture, it is therefore important to monitor the moisture levels of the soil to make sure that there is enough water in the plant depending on its requirements. Another factor affecting plant growths is high humidity which causes fungal diseases most likely to spread and develop. It is therefore important to make sure that air is circulating through the greenhouse to reduce the water vapor around the plants. Insects can become pests in the garden when they cause damage to garden plants. The signs of damage vary, typically depending on the way that the insect feeds on the plant. They can gain entrance into the greenhouse through vents, doorways, openings in the greenhouse, and even on clothing and equipment. When not properly controlled, it could cause ragged chewed leaf edges or holes in leaves, defoliation, or stem and fruit tunneling. In line with this, the repeated use of pesticides in plants can cause pest resistance over time. Also, it may cause adverse effects of these chemicals on the environment and people. In order to maintain the healthy condition of plants and overcome these problems, the researchers have proposed a framework that can monitor and gather the data identified with greenhouse environment and yield status and control the parameters affecting the plant growth and health in a greenhouse consequently in view of the gathered data to foresee and follow up on circumstances automatically for splendidly controlled climatic conditions.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 7, NULL, 6, 'EZJWawTSRgMD', 4, 0, '2021-07-22 09:55:20', '2021-07-27 20:20:44', NULL),
(246, 'Coconut Grater With Coconut Milk Extractor', NULL, '', 'This project study focused on the design and development of Coconut grater with milk extractor for commercial use. The buildout of this project is a product of research, design and development. Prototyping technique was employed to prove the different theories and ideas underlying the conceptualized design of the project. The machine primarily used to shred coconut meat and continuously feed the shredded meat into the screw press to extract the milk. The machine measures 36 inches high, 15 inches wide and 22 inches long. The machine uses 0.5 HP motor that has rated speed of 1720 rpm. The grater used is 4 inches in diameter. Testing the developed prototype shows an average volume of 293.8 ml of coconut milk in 176.9 minutes of operation.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'GNq5tJ8UvZTW', 0, 0, '2021-07-22 09:59:54', '2021-07-22 09:59:54', NULL),
(247, 'Development Of Mechanical Wheel Spray Pump', NULL, '', 'This project study Mechanical wheel-spray pump was developed to provide solution in watering farmlands that has either an uneven terrain or plain pavement. 12.79 cm high, 3.175 cm wide, and 15 cm long. The machine uses a pump with a pressure 18.26 Psi, with the volume 20 L (0.7063ft3) and height 1.42ft. It is powered by a mechanical energy where the operator/driver will have to pedal to work the pump. The study employed prototyping technique, an approach that attempts to verify the performance or suitability of a specific design. Several test trials were conducted to determine the operational limits of the developed prototype. These were done by recording the quality of the operation in experiments proposed in this project. Based on the results and output of the said experiments done, attest to the functionality of the prototype and is acceptable to be used in the designated field.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'UxLMAVFQTZoJ', 0, 0, '2021-07-22 09:59:54', '2021-07-22 09:59:54', NULL),
(248, 'Motorized Sand Sieve', NULL, '', 'This project study aims to design and fabricate a motor-operated sand sieve machine that is efficient than the conventional one (manual sieving). The researchers made the machine motor operated to promote less effort for workers that will be using it. The geared motor which has a speed of 340 rpm is connected to a chain drive and bar linkages which transmit rotational motion into reciprocating motion. This machine also features a non-fixed mesh frame that allows the replacement of sieves and an opening at the end of the frame to discard unwanted particles without stopping the machine. To effectively sieve better, the base frame of the sieve is inclined to 8.05° which is between the acceptable inclination angle for sieving for dry sand that is 1° to 12 °. (Atienza, Candor, Inoncillo, Pelayo, & Fortaleza, 2017)', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, '46kNlmKFx3VA', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL);
