(249, 'Industrial Vacuum', NULL, '', 'This project study Industrial Vacuum Cleaner was developed in order to provide solution in eliminating common industrial waste by siphoning dust and chips produced by operating mechanical tools and machines. It consists of the following parts: motor, hose, pneumatic-rocker vacuum cleaner switch, receiving bin, wheels, and filter. The project measures 52 cm high, 38 cm wide, and 35 cm long it uses 1300 watts DC Motor that has a rated speed of 3000 revolution per minute and powered by a 230V with a current rating of 55 Amperes. The mass air flow used is 3 m3 / min. The project development covers a range of activities including researching and planning of the project design; fabrication and testing of the training unit; assessment and evaluation of the said unit. The study employed prototyping technique, an approach that attempts to verify the performance or suitability of a specific design. It is often used as part of the design process to allow engineers/designers to explore the alternatives. Several test trials were conducted to determine the operational limits of the developed prototype. These were done by recording the quality of the operation in experiments proposed in this project. Based on the results and output of the said experiments done, attest to the functionality of the training unit and is acceptable to be used in the designated field.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, 'Business', 6, 'wPFtvoIDb2Gk', 0, 0, '2021-07-22 09:59:55', '2021-08-07 11:44:06', NULL),
(250, 'Motorized Hydraulic Jack', NULL, '', 'This study focuses on the development of a Motorized Hydraulic Jack that operates using a 12V DC wiper motor. Specifically, to provide a greater efficiency compared to the manually operated hydraulic jacks. It is intended for the use as another equipment for small and medium automotive industries and vehicle owners to provide an easier way of lifting a vehicle and have a portable lifter. This project is also intended to help Mechanical Engineering students on their Machine Shop Theory and Practices subjects. The study utilizes the research based on the experimental method covering the fundamental concept of efficiency over the quality of time. Tests were conducted to evaluate and attain the expected performance of a Motorized Hydraulic Jack in terms of lifting 4-wheel vehicles. All materials used in the fabrication of the project conformed to the desired performance of the equipment.', NULL, '2019-2020', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'GStDyqfO354e', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(251, 'Electrically powered Grass cutter for rough terrain with rocker bogie mechanism', NULL, '', 'This project study aims to know if the effect of combining grass cutter into a rocker boogie mechanism will help the machine adapt on uneven terrain or rough surfaces. The researchers made the machine with battery powered motor to lessen the noise and labor cost and to attain continuous work time. Through this study, they found out that the selection of blade is a big factor in the efficiency of the machine. The razor type of cutter is more efficient than the rotary and string strimmer type of blade. And in terms of cost effectiveness, this machine can save thousands of pesos annually than the typical grass lawn mower. As a summary, the machine created in this study is effective to use but there are still ways to make it efficient. It can be enhanced through further studies and help other researchers to think and create their own by using this as their reference. We recommend using the first proposed design cutter of the lawn mower to have a more efficient result and more even cut. Keywords: Lawn Mower, Rocker-Boogie, Electrically Powered, Rough Terrain, Cutte', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'VPXvOu1wya40', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(252, 'Solar Powered Flood Lights', NULL, '', 'The researchers’ aim is to be able to utilize solar energy as a source of power in lighting up the flood lights installed in the gymnasium of the university. The group decided to install two flood lights with 100 Watts each that could be used for 5 to 6 hours during the night time. The panels were installed on the roof of the gymnasium while the battery and inverter are inside the gymnasium. The researchers based their needs on the numerical data that they have computed. After series of testing and consultations from different sources, the researchers were successful on the project. The methods were properly documented. This project may be a reference for others who will conduct the similar project and recommendations are encouraged by the researchers', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'X6jIWuL9347N', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(253, 'Semi-automatic waterway trash accumulator with featured float water intake regulating', NULL, '', 'The motive of the project is to design and fabricate a working “Semi-automatic waterway trash accumulator and receptacle with featured float water intake regulating mechanism” with intent primarily to retain a river’s (with minimum current flow pressure) cleanliness at a certain degree and to introduce a float mechanism that would aid in waste collection.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'B5GqcboCIvDe', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(254, 'Fabricating Of Briquette Charcoal Making Machine ', NULL, '', 'Employing prototyping technique to prove the workability of the desired output of the study, this developmental research study includes testing the system ensuring proper intake water flow regulation, trash collection capacity and other measurable concerning factors set in the design.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'DCJyFX9Pdr2x', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(255, 'Solar Powered Lcd Television', NULL, '', 'The system developed make used of alternating current one horsepower designed well water pump with suction maximum lift of twenty six feet and pressure maximum of fifty pounds per inch square. Given the specifications, approximately sixteen gallons of water per minute is handled by the capacity of the system.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'AI6Kao5hEXMu', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(256, 'The Use Of Inscription In Improving Turbulence In Hemispherical Internal Combustion Engine’S Cylinde', NULL, '', 'The main emphasis of the project is focused on the receptacle’s ability to regulate water flow mproving waste collection and not to compare the efficiency and fabrication cost of the system with other existing solid waste collectors.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, '', 8, NULL, 6, 'Gf3aNyKm6w94', 0, 0, '2021-07-22 09:59:55', '2021-07-22 09:59:55', NULL),
(489, 'Risk Assessment Models of the Four Major Non-Communicable Diseases for the Citizens of Taguig', NULL, NULL, 'Risk Assessment Models of the Four Major Non-Communicable Diseases for the Citizens of Taguig', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'QX64pOFhU5JS', 0, 0, '2021-08-12 13:17:56', '2021-08-13 16:30:10', NULL),
(490, 'A Survival Analysis of Tuberculosis Patients Under the Directly Observed Treatment Short-Course (DOT', NULL, NULL, 'Tuberculosis (TB) is still a major public health concern in the Philippines,\r\nranking as the sixth leading cause of mortality and morbidity based on recent local data.\r\nTB is a chronic infectious disease caused by bacteria generally referred as Mycobacterium\r\ntuberculosis which is transmitted through coughing, sneezing and spitting. TB is curable\r\nand preventable. However, incomplete or irregular treatment may lead to drug-resistant\r\nTB or even death. This has captivated the researchers to undergo study relating to the\r\nsurvival analysis of the patients over an observatory time. The researchers went to every\r\nbarangay in Taguig City to gather the necessary health records of TB the patients. The\r\nresearchers chose this topic for the reason that TB has become one of the epidemically\r\ndiseases in the Philippines that kills many Filipinos every year.\r\nThis study is intended to know the significance and effectiveness of the DOTS\r\nprogram through survival analysis of the patients. It will also help spread awareness for\r\nall Filipinos especially to those who are at risk of the TB disease. The findings of this\r\nstudy are expected to benefit the Tuberculosis Patients. In this study, the researchers\r\nwant to show that the DOTS program has a positive survival outcome. The researchers\r\ncomputed and interpreted the data using the Kaplan-Meier Estimator to estimate the\r\nsurvival function for the factors from the data set.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'gAnCxRd8Bc32', 1, 0, '2021-08-12 13:17:56', '2021-09-08 09:03:00', NULL),
(491, 'Modeling The Volume of Fisheries Production in the Philippines', NULL, NULL, 'The main purpose of this dissertation is to study and analyze the countrys fisheries\r\nproduction. The researchers formulated an appropriate mathematical model that can\r\nforecast the future production of fisheries in the Philippines.Researchers used a a linear\r\nregression model to predict the volume of fisheries production per region in the whole\r\ncountry.\r\nThe data were gathered from CountryStat, a web- based system that integrates national\r\nfood and agricultural statistical information to ensure harmonization of national\r\ndata. Using Statistical tool for Social Sciences (SPSS) the assumptions for Linear Regression\r\nwas tested. The data passed all the four assumptions namely: Linear Relationship,\r\nNormality, No-Autocorrelation and Homoscedasticity. To know whether the model was\r\ncorrect, the researchers used Paired T-Test to determine the significant difference between\r\nthe actual and predicted data. The researchers discovered that the supply of the\r\nfisheries products may not be sustainable for the succeeding years to come based on the\r\nfact that population is rapidly growing so the growth in demand is also expected. The\r\nresult also showed that there is no significant difference between the actual and the predicted\r\nvalues.\r\nThe study recommends, the Government, in focusing on the problems that might be\r\naffecting the production and its solution to protect the resources. It will give information\r\nto which region they must give attention to in building if not enhancing their fisheries\r\nrelated programs.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'hp8SotULXQFs', 0, 0, '2021-08-12 13:17:56', '2021-09-08 09:03:53', NULL),
(492, 'A Rgeression Mdel on the the Rate and Factors Affecting Rice Production in the Philippines', NULL, NULL, 'In the Philippines, rice has been considered as a staple food. It is the most\r\nimportant cereal directly feeding the Filipino families among any other crops. Indeed,\r\nfor about two decades now, the Philippines has been a net importer of agricultural\r\nproducts, including rice. As per the World Trade Organization, imports of Philippine\r\nagricultural products consistently outnumbered exports from 1994 to 2014 by an average\r\nvalue of 1.38 billion US dollars. Particular to rice, according to Food and Agriculture\r\nOrganization reports, imports have also exceeded exports at an average of over half a\r\nbillion US dollars from 1998 to 2013. With this, the researchers conducted this study\r\nwhich aims to construct regression models that will predict the rice production rate of\r\neach region and to determine the necessary amount of factors to be used to produce the\r\ndesired volume of production. Descriptive method and inferential statistics were used\r\nin conducting this study\r\narrived with the regression models needed to resolve the problem. With these results,\r\nthe researchers concluded that this study can help in quality control. The amount of\r\ngain or loss in the annual production of rice can be monitored using the linear regression\r\nmodels constructed for each of the 16 regions. With this, the respective authorities can\r\ndetermine and control the deciency in the production of rice for those years which have\r\na large amount of loss.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'fyPAwYVsIlp0', 0, 0, '2021-08-12 13:17:56', '2021-09-08 09:04:38', NULL),
(493, 'Modeling Volume Production of Coffee Dried Berries in the Philippines ', NULL, NULL, 'Philippines is a net importer of coffee with local consumption twice as its local\r\nproduction, due to this increasing import of coffee dried berries the production of coffee\r\nin the country is excessively declining. This paper primarily aimed to model the volume\r\nproduction of coffee in the Philippines against its factors namely; (1)number of bearing\r\ntrees and (2) fertilizer cost per hectare from year 1997 until 2016. The researchers used\r\na multiple linear regression analysis in constructing a model and forecasting the future\r\nvalues of the volume production of coffee in the Philippines. Subsequently, researchers\r\nhave obtained significant results. It was found out that the number of bearing trees and\r\nfertilizer cost per hectare were significant. The number of bearing trees greatly affect\r\nthe volume production than the fertilizer cost per hectare. The researchers were able to\r\ncreate a model for the future values of the volume production of coffee 20 years from now\r\nand it was observed that the total volume of production continued to decrease.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'WnQCXNieEJ19', 0, 0, '2021-08-12 13:17:56', '2021-09-08 09:05:07', NULL),
(494, 'Forecasting and Analyzing the Supply of Chicken in the Philippines ', NULL, NULL, 'Originally chicken is just a common good but as time goes by, chicken becomes\r\na necessity. So the researchers would like to find out if the increasing production\r\nof chicken will continue in the near future and can support the increasing demand for\r\nchicken. The purpose of this study is to forecast and analyze the supply of chicken in the\r\nPhilippines and to know if it can sustain and satisfy the growing demand for chicken in\r\nthe Philippines. The data have been gathered from Philippines Statistic Authority and\r\nits official website (psa.gov.ph). Based on the data gathered, the researchers used different\r\nstatistical methods such as Multiple Linear Trend Regression and Auto Regressive\r\nIntegrated Moving Average or also known as ARIMA in order to formulate a forecasting\r\nmodel. With the help of Statistical Package for the Social Sciences (SPSS), Eviews and\r\nNCSS, formulating a forecasting model and computing for statistical values were made\r\neasy and have higher accuracy. Based on the results there is significant relationship between\r\nthe supply, demand and price of the chicken in the Philippines. Also there will be\r\na significant increase in the supply of chicken, economically speaking, the law of supply\r\nand demand states that â€œa high\r\npredicted that there will be no occurrence of scarcity of chicken in the Philippines in the\r\nnext 20 quarters.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, '6vueLqsxmD7b', 0, 0, '2021-08-12 13:17:57', '2021-09-08 09:05:48', NULL),
(495, 'Forecasting the Electric Consumption of Polytechnic University of the Philippines-Taguig ', NULL, NULL, 'Forecasting Electric Consumption of PUP Taguig\r\nBenagua, Sheryl Shane J. Adviser:\r\nBritanico, Cecile B. Mr. Willy S. Gayo\r\nMarcaida, Sarah Bebe M.\r\nZabala, Geochabelle A.\r\nPolytechnic University of the Philippines - Taguig, 2018\r\nForecasting electricity can help the management in its attempts to cope up\r\nwith the uncertainty of the future, relying mainly on data from the past and present and\r\nanalysis of trends. The research aims to forecast the electricity cost of the Polytechnic\r\nUniversity of the Philippines Taguig to predict future increase or decrease of electricity\r\ncost. Data were gathered from the Accounting and Registrars Office of PUP Taguig.\r\nDifferent statistical methods are applied to make this study possible. Based on the\r\nelectricity consumption and cost, the researchers are able to formulate the forecasting\r\nmodel. They have used SPSS 20, EVIEWS 9 and NCSS 11 for better way of computation\r\nand more accurate results. The study gives us a result that in the later years there will\r\nbe a gradual increase in electricity cost.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'dpS7iwVJNMRW', 0, 0, '2021-08-12 13:17:57', '2021-09-08 09:06:27', NULL),
(496, 'A Multiple Regression Model for Unemployment Rate in the Philippines ', NULL, NULL, 'The unemployment rate is probably the best-known labour market measure and certainly\r\none of the most widely quoted by media in many countries as it is believed to\r\nreflect the lack of employment at national levels to the greatest and most meaningful\r\nextent. The research aims to formulate a mathematical model that can predict the unemployment\r\nrate in the Philippines. Also to know how among the variables namely,\r\nGross Domestic Product, Exchange Rate, Imports and Exports can affect the Philippines\r\nUnemployment Rate. Different statistical methods were used and applied to make\r\nthis study possible. We used SPSS 20 for better way of computation and more accurate\r\nresults. The researchers came up with the results that any movements in Gross Domesti\r\nProduct, Exchange Rate, Imports and Exports can affect the value of unemployment rate\r\nin the Philippines.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'pFBdyY0HGVq2', 10, 0, '2021-08-12 13:17:57', '2021-10-14 04:36:23', NULL),
(497, 'A Risk Assessment of Colorectal Cancer Patients in the Philippines ', NULL, NULL, 'Nowadays, colorectal cancer is the number one gastrointestinal cancer in\r\nthe Philippines, overtaking liver cancer. It is alarming that from 3,000 cases of colorectal\r\ncancer 2,000 of them dies due to various factors and causes. This situation\r\npushed the researchers to come up with this study and start the awareness regarding\r\nthis deadly disease. This study is intended to know the significance of the risk\r\nfactors that affect the survival of colorectal cancer patients through risk analysis.\r\nThe researchers gathered the data from Philippine Cancer Society, they used binary\r\nlogistic regression to obtain the significant factors and logistic equation that can be\r\nused to determine the probability of survival of the patients and to determine if the\r\nconstructed model fits the data. Upon few testings and analyzations, the researchers\r\nconcluded that most of the victims of this disease has cancer stage 3 and undergone\r\nthe colostomy surgery. It is hoped that this study shall be a great contribution to\r\nthe knowledge about colorectal cancer.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'yFcnIKO6DlXZ', 1, 0, '2021-08-12 13:17:57', '2021-09-08 09:08:29', NULL),
(498, 'Modeling the Probablity of being Hospitalized Among Taguig City Hall Employees ', NULL, NULL, 'Doubt of insecurity, lack of awareness and lack of preparedness about the risk\r\nthat they can get in their lifestyle and work are the problems of this study thatâ€™s why\r\nthe researchers came up a study which the main objective is to formulate a model, a\r\nmodel to answer those problems and give the reader/s, specifically to those who work\r\non government offices an appropriate and sufficient information. This has captivated the\r\nresearchers attention to undergo study relating to the risk assessment of Taguig City\r\nHall employees in calculating monthly premium for a short-term health insurance. The\r\nresearchers went to Taguig City Hall to gather the necessary data of their government\r\nemployees.\r\nThis study is intended to know the probability of hospitalization prior to the\r\nrisk assessment that will be interpreted by the researchers based on the probabilistic\r\nmodel formulated. It will also help spread awareness for all employees, especially who\r\nare at risk. The findings of this study are expected to benefit by government employees\r\nof Taguig City Hall. The researchers computed and interpreted the data using Binary\r\nLogistic Regression to calculate the probability of respondents hospitalization. Also, with the use of SPSS, the researchers apply different statistical methods for the assessment of\r\nthe model. The study gives us a result where all of the risk factors of Taguig City Hall\r\nemployees are the contributors for them to be hospitalized based on the assessment of\r\nthe researcher. The researchers conclude that they must aware enough to their work and\r\nlifestyle and suggest they should avail a propose insurance policy.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'yBhQR8UzNkTM', 0, 0, '2021-08-12 13:17:57', '2021-09-08 09:09:17', NULL),
(499, 'Forecating the Monthly Price of Diesel in the Philippines Using Time Series Analysis in the Year 201', NULL, NULL, 'THE DEPARTMENT OF ENERGY STATES THAT THERE HAD BEEN AN INCREASE TO THE PRICE OFF OIL. IT IS A PROBLEM OF MANY PEOPLE SPECIALLY TO THE PEOPLE WHO USED DIESEL WHEN THERE WAS A RISE IN GLOBAL OIL PRICES. EVERY YEAR IT WAS RECORDED HOW PRICE OF DIESEL CHANGES EVERY YEAR. THIS STUDY WANTED TO KNOW WHAT WILL BE THE FORECASTED PRICE OF DIESEL IN THE YEAR 2018. THE RESEARCHERS GATHERED DATA FROM THE DEPARTMENT OF ENERGY (DOE). THE DATA WAS TESTED AND BASED ON THE RESULT, THERE IS A CHANCE THAT THERE WOULD BE AN INCREASE IN THE PRICE OF DIESEL.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'TxL5jKvNErGP', 0, 0, '2021-08-12 13:17:57', '2021-08-13 16:30:10', NULL),
(500, 'Risk Assessment of End-Stage Renal Disease Patients in the Philippines ', NULL, NULL, 'The National Kidney and Transplant Institute cited that kidney failure was the 7th leading cause of death among the Filipinos. It is the last stage of Chronic Kidney Disease (CKD) and is also called as End-Stage Renal Disease (ESRD). It is alarming that one person dies every hour from kidney failure. Every year, more than 7,000 cases of kidney failure in the country are recorded. This Study intended to know the estimated survival rate of ESRD patients and to formulate an equation that could explain the probability of survival of ESRD patients. The researchers gathered data from National Kidney and Transplant Institute (NKTI). Upon few testing and analyzation, the researchers found out that female ESRD patients have higher risk than Male ESRD patients. In Age groups, child has the highest survival rate while adults had the lowest survival rate.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'Purj5cboOYMV', 0, 0, '2021-08-12 13:17:57', '2021-08-13 16:30:10', NULL),
(501, 'Time Series of Human Immunodefiency Virus Cases in the Philippines ', NULL, NULL, '                     A UNAIDS Report on the global HIV epidemic states that the number of new infections in the Philippines has more than doubled in the past six years. The Philippines has become the country with the fastest growing HIV epidemic in Asia and the Pacific, and has become one of eight countries that accounted for more than 85% of new HIV infections in the region. This study determined to predict new HIV cases in the Philippines using Autoregressive Integrated Moving Average (ARIMA) model of time series analysis. The researchers assessed if the increasing trend of HIV cases will continue to occur in the future. \n                    The data was gathered from Department of Health (DOH) and HIV/AIDS Art Registry of the Philippines (HARP), the official record of the total number of laboratory - continued HIV positive individuals. Based on the data, the researchers applied Autorregressive Integrated Moving Average (ARIMA) as their statistical method, in order to come up with a forecasting model. They also used analytical software, Eviews 9.0. It is innovative specially when it comes to dynamic data and graph creation, frequency conversion, and match merging, which help keep analyses up-to-date as underlying data change.\n                     Based on the results, there will be an increase trend on HIV cases in the Philippines for the next 10 years on monthly basis. The government should implement more programs that will aid in raising awareness of the HIV epidemic. Setting up more testing centers will be helpful to those individuals who are in doubt of acquiring the infections. Early diagnosis is relevant in treating the disease.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'fw57TEFpvU3r', 0, 0, '2021-08-12 13:17:57', '2021-08-13 16:30:10', NULL),
(502, 'Employability of the Graduates of Bachelor of Science in Applied Mathematics Major in Applied Mathem', NULL, NULL, 'This study focused on eliciting information on the employment status of the Bachelor of Science in Applied Mathematics major in Actuarial Mathematics graduates from batch 2012-2018 of Polytechnic University of the Philippines Taguig Branch. This study is mainly a descriptive study with inferential statistics approach to test the relationships of specific variables. The questionnaire that was created was validated by the Research Management Office of Polytechnic University of the Philippines â€“ Sta. Mesa. Through this, the researchers were able to gather the needed information from respondents like demographic profile, employment profile and assessment of different competencies learned from the chosen program. Through this information, researchers were able to identify the implications on the findings of the study that can be used to consider in enhancing the program. Results showed that the majority of the respondents have job that is related to the course they took, salary ranging from 30,000-40,000 per month, have regular job and working in a private company. From the results and findings of this study, the researchers recommend the University to monitor the graduatesâ€™ employability status by conducting a tracer study on a regular basis. ', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, '2ARPflq3MzIJ', 0, 0, '2021-08-12 13:17:57', '2021-08-13 16:30:10', NULL),
(503, 'A Time Series Analysis on the Electric Power Peak Demand in the Philippines', NULL, NULL, '     Electric Power is one of the greatest inventions of science. It has become a need for a community to run smoothly and it makes our works faster and easier to do. For this reason, the aim of this study is to forecast the 2018 - 2019 monthly system peak demand of Luzon, Visayas, and Mindanao Grids and the whole Philippines to know how much more electric power that each grid needs to supply as time passes by.\n     The data used were gathered in the official website of the Department of Enegry. The researchers used the statistical model of Seasonal, Autoregressive, Integrated Moving Average (SARIMA) to formulate a time series model with the help of statistical software called EViews. According to the results, the movement of the predicted peak demands are having increasing trend and seasonality. The researchers also concluded that the models were strong since the root mean square error is lower and the value of theil inequality coefficient is closer to 0. They are recommending to have a continuity of this research to expand its future forecasts by incorporating new accumulated data.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'COx9nce36Vlf', 3, 0, '2021-08-12 13:17:57', '2021-10-10 05:58:16', NULL),
(504, 'A Prediction Interval and Distribution Model for Log Phase of Escherichia Colil Growth', NULL, NULL, 'E.coli is one of the most common bacteria causing disease in the world. It can reproduce itself at an instant at any place it locates. It grows at different rates depending on the environment it inhibits. Many techniques nowadays used to measure the growth of a certain bacteria. One of these is the Spectrophotometry. Spectrophotometry uses wavelength, a beam of light that passes through the well to measure the absorbance of the medium containing bacteria. As the absorbance increases, the bacteria goes larger in population. It is significant to measure the rate of these bacteria due it is very useful especially to the medical related fields. They use this in order to generalize the behaviour of a single bacteria.\nThis study is intended to produce a prediction interval and a model to predict the future outcome of bacterial population. Several Statistical methods were being used to create this model. The model is dependent on the time where different media are used to culture the sample E.coli. The researchers used R-studio, a machine learning software significant for statistical computations. Through this software, a logistic non-linear model was produced to approximate the population growth of E.coli.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'UYNoIJPVcswd', 1, 0, '2021-08-12 13:17:57', '2021-08-13 16:31:02', NULL),
(505, 'A Regression Model for the Factors Affecting Inflation Rate in the Philippines ', NULL, NULL, 'Philippines inflation rate has been a big part of Philippines \' economy. It affects by the prices of all goods. This may depreciate because of the changes in the prices of goods and services. The implementation of the Republic Act 10963 or the Tax Reform for the Acceleration and Inclusion(TRAIN) law have a great impact in inflation rate. With this, the researchers conducted the study which aims to contruct regression model that will predict  the inflation rate inflation rate in the Philippines to determine the necessary amount of factors to be used to forecast the inflation rate.  Descriptive method and inferential statistics were used in conducting this study. Using different statistical of data , the researchers arrived with the regression model needed to resolve the problem. With these result, the researchers concluded that this study can help in quality control. The amount of gain or loss in the inflation rate using the linear regression models constructed for the country. With this, the respective authorities can determine and control  the deficiency in the economy.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'ugMOsGU7r6HQ', 3, 0, '2021-08-12 13:17:57', '2021-09-06 10:02:08', NULL),
(506, 'Forecasting the Production and Withdrawals of Raw and Refined Sugar in the Philippines ', NULL, NULL, 'Sugar is important in processing many food products. Philippines is one of the top producers of sugar in the world. Before, Philippines is used to export sugar but in recent times, Philippines are importing sugar. The research aims to forecast the future production and withdrawals of sugar and to determine if there will be overproduction of sugar in the next 10 years. Raw and Refined Sugar Production and Withdrawals are secondary data from year 2011 to 2017 that were gathered from Sugar Regulatory Administration (SRA). The researchers used EViews 10, Minitab 16 and NCSS 12 for better way of computation and more accurate results. The data were first tested if it is stationary or not with the use of Augmented Dickey-Fuller Test.  Raw and Refined Sugar Production and Raw Sugar Withdrawals show stationarity. However, Refined Sugar Withdrawals is stationary by taking the first difference. Using Time Series Analysis and Autoregressive Integrated Moving Average (ARIMA), the production and withdrawal of both raw and refined sugar were developed. The specific models are ARMA (3,2)(1,1), ARMA (2,2)(0,0), ARMA (4,4)(0,0) and ARMA (4,3)(0,0) for Raw Sugar Production, Raw Sugar Withdrawals, Refined Sugar Production and Refined Sugar Withdrawals, respectively. These models were validated as the models have the lowest AIC Value and by the use of 4-Plot of Residuals. This revealed that there were months where production of both sugar are higher than withdrawals but there were more months where withdrawals of sugar are higher than production.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'Ena163CrhGBU', 0, 0, '2021-08-12 13:17:57', '2021-08-13 16:30:10', NULL),
(507, 'Forecasting and Survivla Analysis of Tuberculosis Patients in Taguig City', NULL, NULL, 'Tuberculosis remains a global public health problem of enormous dimension. Tuberculosis remains the major global health problem and ranks second in being the cause of death from an infectious disease worldwide following human immuno defiency virus. Tuberculosis is an infectious disease cause by micro bacterium tuberculosis, which is transmitted through the air or by ingesting infected milk or meat and it is both preventable and curable. However, after adopting DOTS program in all public facilities in 2003, the country has made significant progress in the battle against TB. This has captivated the researchers to undergo study relating to the Survival Analysis of the patients over an observatory time. The reseachers went to every barangay in taguig City to gather the necessary health records of TB patients. The researchers chose this topic for the reason that TB is still a major public health concern in th Philippines, ranking as the sixth leading cause of mortality and morbidity based on recent local data.\n\nThis study is intended to know the prediction and survival rate of the TB in Taguig City. The researchers aim to prescribe for a precautionary healt behavior not only the increasing number of Filipino people who survived Tuberculosis but also those who has been living with pain by bearing this disease and impower them to enjoy life and live fully. The findings of this study are expected to benefit the TB patients. In this study, the researchers want to show that the DOTS program has a positive survival outcome. The researchers computed and interpreted the data using the Kaplan Meier estimator to estimate the survival function for the factors from the data set.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'G8ugjtCBZzkb', 0, 0, '2021-08-12 13:17:57', '2021-08-13 16:30:10', NULL),
(508, 'A Mathematical Forecasting Model for Future Stock Price of BDO Unibank Inc.', NULL, NULL, 'Banco De Oro Unibank, Inc. is a full-service universal bank. When it comes to the total assets, BDO is the largest bank in the Philippines. BDO engages in the provision of commercial banking services. It operates through the following business segments: Commercial Banking; Investment Banking; Private Banking; Leasing and Financing; Insurance; and Others. The researchers aims to determine a forecasting model that can be used to predict the future closing price of stocks in BDO and to determine a daily prediction of adjusted closing price from 2019-2020. The data were gathered in Yahoo Finance which is the adjusted closing price of the stocks of BDO from 2015-2018 daily. The researchers used forecasting method which is the Exponential Smoothing to compute the forecast values of price stocks.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 11, NULL, 6, 'albxuH6MDKP9', 19, 0, '2021-08-12 13:17:57', '2022-05-18 17:32:42', NULL),
(510, 'Plastik Co\'s Recyclable Plastic Arm-Chair ', NULL, NULL, 'Nowadays, people have been experiencing huge changes in environment and\r\none of the biggest contributor of these changes are plastic; Over 50 billion of\r\nplastic beverage bottles are consumed in a year and the Philippines has been\r\nthe highest trash collection rate in southeast Asia yet itâ€™s the worldâ€™s 3rd biggest\r\nsource plastic leakage in the ocean.\r\nThe study found that 74% of the plastics leaking into the ocean from the Philippines\r\ncome from garbage that has already been collected by haulers and garbage\r\ntrucks.\r\nThis amounts to 386,000 tons of plastic trash. plastic pollution can unfavourably\r\naffect lands, waterways and oceans. Living organisms, particularly marine\r\nanimals, can also be affected through entanglement, direct ingestion of plastic\r\nwaste, or through exposure to chemicals within plastics that causeInterruptions in\r\nbiological functions. Humans are also affected by plastic pollution, such as\r\nthrough the disruption of the thyroid hormone axis or hormone levels. In the UK\r\nalone, more than 5 million tons of plastic are consumed each year, of which an\r\nestimated mere 24% makes it into recycling systems.\r\nThat leaves a remaining 3.8 million tons of waste, destined for landfills the growing\r\nwaste from plastic water bottle is now a problem around the world; plastic and\r\nnon-biodegradable had been always huge environmental headache, people\r\nhave always been trying to find ways to solve this problem.\r\nWe have researched and conducted where we can lessen the numbers that are\r\nconsumed and disposed in the ocean. The solution is all those processed bottles\r\nand plastic will make into a new product.\r\nThis give us an idea to make that product into an armchair, where as it is\r\ncompletely made of recycled product. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 13, NULL, 6, '58px4UKchqlP', 0, 0, '2021-08-12 13:30:12', '2021-09-08 09:24:50', NULL),
(511, 'Feasibility Study of Fix-Seat ', NULL, NULL, 'Fix-Seat (Portable Chair-Table) \r\n\r\nIn todays era, all of us wish and want to have a large sized home filled with a different types of dining room things and materials. The market offers some latest designed furniture which is not only convenient but also available in good sizes and ranges. They usually manage to occupy a normal number of members of a family.\r\n\r\n This furniture is very useful when unexpected guests arrive and we are bound to manage their comfort in such a case. In the context of folding furniture, the furniture pieces that are fabricated or made of wooden or similar materials are much more preferred as compared to plastic as they are more durable and consequently sturdier. Some folding dining tables as well as chairs have also been available that is fabricated or made of aluminum. They are comparatively lightweight and much easier to handle or to be moved around in the house.\r\nThere are certainly 3 key properties which make a Fix-Seat far more practical compared to usual chairs. These characteristics usually are simple transportability, longevity as well as ease of storage.\r\nThey are generally employed for many out-of-doors along with indoor events. They are simply lighter and much more convenient to transport when compared with normal chairs. You possibly can carry many folding chairs to any open-air event, such as sporting games, competitions, college graduations or even religious services.\r\n\r\nSo We, the UNICORPORATION developed a product that is suitable and can easily it in our customers desires.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 13, NULL, 6, 'TUsPj16HSncb', 0, 0, '2021-08-12 13:30:13', '2021-09-08 09:22:06', NULL),
(512, 'Feasibility Study of Plastic Chess Piece ', NULL, NULL, 'Plastic is any synthetic or semi-synthetic organic polymer. While plastics may be made from just about any organic polymer, most industrial plastic is made from petrochemicals. Thermoplastics and thermosetting polymers are the two types of plastic.\r\nThe Titan Plastic Corporation proposing for a re-engineered plastic product. With a better quality at lower price. Plastic Chess Piece is the first product we process wherein we use a better resin to produce a best product.\r\nThe paper gives information on how we produce these plastic chess pieces, from the plastic resins we used, the designing of the chess pieces, the process of injection molding and the cost of the mold and each of the pieces that will be on market. The use of Polyvinyl Chloride resin on the chess pieces that we will produce; is it inexpensive than other plastic resins on the industry? Does this resin will be much smarter to use than other resins? The advantages of plastic chess pieces over other types of  chess pieces and adding recycled PVC on the product. This study also aims to answer the question, does injection molding process is the best option for mass production of these chess pieces?\r\nThe use of Polyvinyl Chloride in the product will determine the flexibility of this resin in any kind of application.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 13, NULL, 6, 'eZXH7U2Lp8nf', 2, 0, '2021-08-12 13:30:13', '2021-09-08 09:22:18', NULL),
(513, 'Toilet Organizer', NULL, NULL, 'The research discuss the impact of the improved design for the hygiene basket to its potential manufacturing with the studyâ€™s principal problem statement â€œHow will the newly launch design principal problem statement in manufacturing?â€. The researchers have drawn the following objectives: to draw the profile of the respondents, to identify the market value and launch it with the potential suppliers of the design.\r\n	To know the positive and negative reviews in the newly improved product design in the potential manufacturing. As respond to the objective given, the researchers have conducted surveys. Using this method, the researchers have obtained qualitative data that supports the study. The researchers employed the qualitative approach, case study as a tool of inquiry and judgement sample method for the selection of participants in terms of the research design.\r\n	As a result of this study, the researchers came to answer the problem with the impact of an improved design hygiene basket in manufacturing.\r\n	Although this research is far from being perfect still error may exist. The readers opinion, suggestions, and comments are welcome.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 13, NULL, 6, 'dZItBeNAE3VQ', 0, 0, '2021-08-12 13:30:13', '2021-09-08 09:22:28', NULL),
(514, 'The_Feasibility_Study:_Adjustable_Reversible_Wrench', NULL, NULL, 'A feasibility study has been conducted which dispense enough data and an improvement to the existing adjustable reversible wrench. In extent, the study also include the forging, heat treatment process for the manufacturing of adjustable reversible wrench and  the machine involved in the process of manufacturing of adjustable reversible wrench. The study employs existing facts and data from the previous and related researches to establish comprehensive analysis to the adjustable wrench as well as for its improvement. The study aims to formulate an organized enhancement of the adjustable reversible wrench for its betterment and efficiency. It will exhibit how profitable and marketable it is for the company as demand will arise upon the various application of adjustable reversible wrench. The study subsume the software used in manipulating the design to simulate the desired appearance of the new and innovated adjustable wrench.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 13, NULL, 6, '7ZRtwMnFESgO', 0, 0, '2021-08-12 13:30:13', '2021-08-13 16:30:10', NULL),
(515, 'Web-Based Vehicle and Fleet Renting for Budget Car and Truck Rental', NULL, NULL, 'Web-based vehicle and fleet renting is a web-based system intended for \r\nrenting vehicles operation of the CSR Department and Fleet Department. It will be \r\nimplemented in Budget Car and Truck Rental Philippines, two (2) Department to \r\neliminate their staffs manual operational works. This system aims to provide an \r\nautomated method of renting vehicles and systematize method of manual inputs. The \r\nsystem automatically changes the time of the consumption of managing written \r\nrecords into an efficient manner. The Vehicle Fleet Management System has four \r\n(4) major modules: The first module allows the CSR to add customers rental.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'VSB6nLGbHira', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:46:50', NULL),
(516, 'Drake Hris the New Way of Managing People from Recruitment to Employment ', NULL, NULL, 'DRAKE HRIS is a web-based system intended for managing people inside\r\nand outside of the organization. It will be implemented in DRAKE International.\r\nThis system aims to provide an automated method of managing people through\r\nmanual inputs. The system automatically changes the time wasted of managing\r\nwritten records into an efficient manner. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'yN09WaBbkzqO', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:31:06', NULL),
(517, 'Liquidation System Documentation', NULL, NULL, 'Assistco Energy and Industrial Corporation entrusted us to create their Liquidation\r\nModule, which contains the reports of the expenses of their projects. The module will\r\ncreate weekly reports for each project for easier monitoring and printing of records for their\r\nexpenses. The Auditing Departmentâ€™s work will be lessened because instead of encoding\r\nevery details per receipt, ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'onz574ExwytA', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:31:27', NULL),
(518, 'Guru App Documentation', NULL, NULL, 'The Guru Application helps the user to communicate with field professionals (dentists,\r\nautomotive engineers, lawyers and photography) to give consultations to their concerns with no need\r\nto go to the place where you can consult and pay for the consultation fee. The advantage of having\r\nthis application is; you can save time, effort, and money.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'ORFz8E4t32YQ', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:32:12', NULL),
(519, 'Match Deals', NULL, NULL, 'Nowadays technology has a big advantage into our society, it makes things easier and better.  Technology could help us especially in our school activities and projects; we are just going to browse/search using our phone or laptop. Of course it is not only beneficial for our school activities, we can use technology nowadays for different types of communication and transaction, like on shopping online, checking bank accounts through  online/internet so quickly and easy, also if we have a family away from us we can still communicate with them during our leisure time without hassle and delay.\r\n\r\n	This mobile and web application is for the benefits of all people around the world, for those people who does not have much time to do their shopping or whatsoever they want to do.  Using this app, you can save more of your time no more problem about transportation, crowds, and pollution just use this app and take it easy. Shop anytime, anywhere you want via internet. And being part of this business we assured you the quality of our product, we guaranteed that it is new, without defects, damaged and the most important is it is safe. \r\n\r\nAbout our application is to make our customer can easily purchase an item without hassle. It is surely a time saving application do whatever you want, make things easy in life just click our apps then explore.  You only need to have is a mobile data or a Wi-Fi to access our mobile application, Just Keep on browsing.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'rTfDEn7UzL9k', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:34:23', NULL);
