(520, 'Measuring Instruments Calibration Monitoring System: A Tool for Issuance of Quality Assurance Certif', NULL, NULL, 'Applied Calibration and Instrumentation System Inc. Monitoring system is a web\r\nbased system that is built to help every departments and employees of the Applied\r\nCalibration and Instrumentation System Inc. to improve the way they handle and process\r\nCalibration Jobs by lessening the manual steps and by transforming it into an automatic\r\nand convenient manner. The system offers automated method of monitoring the\r\ncalibration jobs and systematize method of inputting dataâ€™s.\r\n The said system has four major modules, The first module is for the\r\nReceiving/Releasing Area Personnel where they can easily input the dataâ€™s needed for a\r\nJob Request from the Client, such as the Company name and Company Address for the\r\ninformation of the Client company, while Manufacturer, Model No. Range, Accessories,\r\nOther Remarks, Serial No and Charges are given for every Measuring Instrument to be\r\ncalibrated. Calibration Interval and Estimated Date of Completion is also given for the Job\r\nRequest. These informationâ€™s are inputted into the Job Request Form where they can print\r\nthe PDF file for the Client and Companyâ€™s copy of the JRF. Which are then forwarded to the E-Log Book which is their main Calibration Job data repository. This module also\r\nallows the Receiving/Releasing Personnel to do modifications for a specific Calibration\r\nJob such as editing or removing a specific data and also to input the Date Released for\r\nthe Calibration Certificate and the Instrument for every Calibration Job into the E-Log\r\nBook. These steps are done manually before.\r\nThe second module is for the use of the Calibration Officers where they can receive\r\nnotification containing the remaining number of days to work with a specific calibration job\r\nit also enables the user to view the E-Log Book, overdue jobs page and update the status\r\nof a specific Job.\r\nThe third module is for the Accounting Department where the accountants have\r\nthe privilege to view the E-Log Book and also to get the Total number of Cancelled,\r\nOngoing, Completed and Overdue Calibration Jobs and Total of collectible calibration\r\ncharge for a specific criterion, which is the Year, Start and End Month.\r\nThe fourth module is for the President or any Deputy/Authorized Personnel that allow\r\nthem to filtering the appropriate users of the system by accepting of rejecting the request\r\nof registration of a specific registrant of the system. It also gives privilege to view the ELog\r\nBook and overdue job page.\r\nThe system was designed using the tools Brackets and XAMPP in languages:\r\nPHP, JavaScript, HTML, and CSS while they used CodeIgniter for the web framework.\r\nFor the testing of the system, the researchers used the Likert Scale for the basis of grading\r\nthe Functionality, Usability, Reliability, Performance and Security (FURPS) Questionnaire to evaluate the system. The results show that the system is 3.4%, Very\r\nSatisfactory and it will be a great help to the ACAISI to enhance their operational processes\r\nand their Calibration Services. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'JVwbX3xzi9sZ', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:36:29', NULL),
(521, 'iFixIT: Issue Support Management', NULL, NULL, 'The IFixit is custom made for SHFC employees. The IFixit accentuate on managing and monitoring IT related issues. The system will simplify the manual process of monitoring and requesting a ticket on their computer issues. The reports will be based on the requested ticket, whereas the information needed is inputted. The IT employees can monitor the ticket, as well as the non-IT employees.\r\nThe IFixit is only for authorized users such as the IT employees and all non IT employees that uses a computer. But it is only for IT Helpdesk purposes and nothing more.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'C6gn7ZuMbSWi', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:37:00', NULL),
(522, 'MapIT Delivery App', NULL, NULL, 'In terms of technology development, it is undeniable that there are many\r\nsolutions to different types of problems using technology arising.\r\nAs of today, many food companies offer deliveries to increase their\r\nbusiness competitiveness. But delivering products in a manual process is not a\r\nsimple thing to do.Imagine the process if you have more than 20 deliveries in one\r\nday and located in different locations. Plotting addresses in a spread sheet to\r\ncompute their distances from each other is time consuming. Estimating where will be\r\nyour first, second, next or so on location to be delivered is impossible to make in a\r\nshort period of time.\r\nMs. Mayghie Galarce introduced us a project called Map It Delivery which is a\r\nmobile application for routing deliveries. She had an idea that come up with an\r\napplication as a solution to other businesses specially restaurants that offering\r\ndeliveries.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'qXtV8xpvjcnA', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:37:39', NULL),
(523, 'LaRal: The Sentient Way of Teaching the Toddlers', NULL, NULL, ' Holy Infant Children Center of Taguig is an e-Learning system intended for for teaching the students of HICC. It will be implemented to be use by the students and teacher. It also aims to make the learning of children be fun. The HICC e-Learning system has six module: The first is to upload the lesson by the teacher, the second module is to view the said uploaded lesson by the teacher and student, the third module is to upload the activities it can be done by the teacher, the fourth module is the teacher can view the student activities, the fifth module is the student can take the activities, the sixth moduole is the teacher can view the student name, list and their scores.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'OR4VhANutBy6', 0, 0, '2021-08-12 13:32:10', '2021-08-13 16:30:10', NULL),
(524, 'Web-based Significant Notes Management System for Guidance Office Student Record Management', NULL, NULL, 'A system for Guidance Office that will help the guidance administrator in faster transaction', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'thA8NRiKwUnF', 0, 0, '2021-08-12 13:32:10', '2021-08-13 16:30:10', NULL),
(525, 'Hello Doc Inventory Ssytem', NULL, NULL, 'Hello Doc Inventory System was designed to help the assigned personnel of Hellodoc Inc.,\r\nCanadian Kitchen to lessen his/her work such as encoding the records of their consumable\r\nmaterials (e.g. screws, plywoods, etc.).\r\nThe admin is the only user of the system. He/she has only authority to manage the records of the\r\nsupplier and the supplies of the materials. And the system will automatically compute the\r\nexpenses of the materials for every input of the admin.\r\nHello Doc Inventory System is an offline system. It required username and password to login to\r\nsecure records from unauthorized user. And the only person that can access the system is the\r\nadministrator.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'TZUaFfWqje3C', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:38:21', NULL),
(526, 'EblotterIS: Replacement to the Manual Managing of Blotter in Barangay South Signal Hall', NULL, NULL, 'EBLOTTERIS: Replacement to the manual management of blotter in the \r\nbarangay South Signal Hall intended to alter the tedious process of the manual \r\nmanagement in the Blotter department of Barangay South Signal Hall. EBLOTTERIS: \r\nReplacement to the manual management of blotter in the Barangay South Signal Village \r\nhas three (3) major modules. The first module allows the personnel to easily tag the \r\ncomplainant and respondent into the complaints that they are facing. The second \r\nmodule also allows the personnel to easily record the complaints into the information system. By this way, the Blotter department would save time, space on their workstation \r\nand do more things that they should organize on their department. Lastly, the third \r\nmodule, would help the Blotter department and personnel to assure that the \r\nEBLOTTERIS: Replacement to the manual management of blotter in the Barangay \r\nSouth Signal Hall would help them a more secure file records of information. The system \r\ncan also generate reports for the summarize count of every blotter category. It gives the \r\nease to record the complaints narrative report within the institution. The system was \r\nmade on one platform, a web application, for the compatibility of the system in Barangay \r\nSouth Signal Hall. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'zO1HdsZh6XSk', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:38:56', NULL),
(527, 'Development of Payroll Management System for Drake International Philippines', NULL, NULL, NULL, NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'thyNRupJUqfP', 0, 0, '2021-08-12 13:32:10', '2021-08-13 16:30:10', NULL),
(528, 'PMC CIS: A Web-based System for Managing Patient Medical Laboratory Record', NULL, NULL, 'This study aimed to be an alternative process of manual management of patient information of PMC Medical Clinic.  The system will help the clinic processes to be more productive and convenient. The PMC Clinical Information System can be accessed through a laptop or a desktop that have a web browser and Xampp. The web-based system was developed using Codeigniter PHP Framework, CSS, HTML, Bootstrap, JQuery, and phpMyAdmin. The system was evaluated by 6 respondents for FURPS that is composed of clinic staffs and doctors in PMC Medical Clinic. \r\nThe overall performance of PMC CIS is 3.93 which is described as â€œVery Satisfactoryâ€. Based on our conclusions, the system is a big help in the clinic.  The system helped the respondents in managing patient information, medical records and history, laboratory reports, and appointment schedules. \r\n\r\n The system has helped prevent loss of information, avoid misspelled and wrong information in the laboratory results, and to the clinicâ€™s storage.  Also, it has helped them with the generation of their laboratory reports. The researchers assure that the system of their client can help them make their work easier with less errors to encounter.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'DgLpZ4qtkVvx', 0, 0, '2021-08-12 13:32:10', '2021-09-08 07:30:08', NULL),
(529, 'WiClass: Information Management System', NULL, NULL, 'Student Management System becomes the most significant part of the modern education field. Its\r\nmain purpose is to help the institution to modernize the administrative task and to provide realtime\r\naccess to the data. This chapter will provide a brief knowledge about the company where\r\nthe project will be executed and the difficulties they encounter in managing their student\r\ninformation.\r\nIn 2011, the Department of Education initiated the Learners Information System (LIS), an online\r\nfacility that provides for the registration of learners enrolled in public schools. Since its\r\ninstallation, the LIS has allowed the Department to generate the total public school enrolment\r\nbased on the actual registration of learners.\r\nThe LIS is an innovative tool that the Department uses to manage information with the aim \r\npromoting transparency, informed decision making, and empowerment at different levels of the\r\norganization. While being a tech-based solution, the LIS involves an inclusive, community-driven\r\nprocess that thrives because of the active engagement and participation of all teachers, principals,\r\nplanning officers and other DepEd personnel all throughout the Philippines.\r\nAccording to Secretary Br. Armin A. Luistro, FSC, â€œConsidering the size of the Department and\r\nthe number schools under it, it is very critical for the Agency to be equipped with the right\r\ninformation at the right time to be able to make better decisions. This is essentially an online\r\nregistry of learners that is important for any educational system or institution. We need to\r\ncontinually get to know our learners better so that we can respond better.\r\nOut of the 46,648 public schools in the country, only 140 (0.3%) schools have failed to submit\r\ndata for SY 2014-2015, which demonstrates a very high participation and submission rate by the\r\nschools. The concerned divisions have already been instructed to complete the remaining school\r\ninformation immediately.\r\nThis system is envisioned to allow the Department to better track its learners in both formal and\r\nnon-formal instruction so that more appropriate interventions can be formulated in the provision of quality education for all Filipino learners. As an example, students who transfer from one school\r\nto another can be monitored and better assisted by using data from the LIS.\r\nThe use of automation and technology has helped the Department update information on\r\nenrollment for planning, budgeting and resource allocation among others. Luistro added that,\r\nâ€œWhat used to take ten months to collect, consolidate and validate has now been reduced to three\r\nmonths. This is a result of the use of technology and the power of our people.\r\nAs of June 6, 2014, the Department is looking at a total of more than 20 million student enrollees\r\nfor public schools.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'xLkd3AM2POcC', 0, 0, '2021-08-12 13:32:10', '2021-09-08 08:47:49', NULL),
(530, 'Client Management System', NULL, NULL, 'Client Management System is a web-based system that is intended to help the ASC department in Drake International. With the help of the said system, the admin and the user can easily manage and organize all the important record of their clients and fast generating of reports. For the candidate they can edit and view their account easily. The system also some features that will help the ASC department in managing the records of their client which will make it more useful; generate pdf for the reports, notifications, inquiry modules. The web application of the system was designed using the tools Sublime Text and XAMPP in languages: PHP, JavaScript, HTML, and CSS while they used CodeIgniter for the web framework.\r\nFor the testing of the system, the researchers used the Likert Scale for the basis of grading the Functionality, Usability, Reliability, Performance and Security (FURPS) Questionnaire to evaluate the system. It is conducted with ten (10) respondents who participated on the surveys that focused on the effectiveness of the system in five aspects such as functionality, usability, reliability, performance and security. The results show that the system is 4.24%, Very Satisfactory and it will be a great help in the company and staff of ASC department. \r\n\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'eyzaXIqOUAEL', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:41:07', NULL),
(532, 'Document Archiving System: Aide to the Management of Document coming from Government Agencies', NULL, NULL, 'This study aspires to be an alternative process of manual document filling, searching and retrieving of received document coming from different Government Agencies of DOST-SEI. The system will help the company\'s processes, such as managing the searching and retrieving documents to be more efficient and less time consuming. Document Archiving System can be accessed with any device through a browser that has Internet access. It will reduce the time which will be consumed when the process takes place and will help them manage their documents and to assign task. Researchers used the RAD methodology to know the process and development of the system. The web application was developed using a server-side scripting language which are HTML 5, CSS, MySQL and PHP. Test results shows that the software has delivered its functionality as expected of its outcome. The system was evaluated by 5 respondents for FURPS and 2 respondents for User Acceptance testing composed of IT students, Admin of the DOST-SEI using the criteria functionality, usability, reliability, performance, and security. The overall web applicationâ€™s performance gained a mean average of 4.36 which described as \"Very Satisfactory\". It indicates that the system lessens the paperwork of the admin because of the automated way of managing the government document and it improves storing and searching document in a way that is less hassle and less time-consuming for the Admin of DOST-SEI. Based on the conclusions, the system could still be improved to provide the users plenty of ease while using the system.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'RFWbvHoLUyCO', 0, 0, '2021-08-12 13:32:11', '2021-08-13 16:30:10', NULL),
(533, 'Stock Inventory Management System', NULL, NULL, 'The Stock Inventory Management System (SIMS) is a web-based application which is intended to help mostly customers for them to rate the certain office services within an institution and also for the administrative officer to view the survey results and the analytics in a lesser time process. Doing such can eliminate mostly of the manual process in computing the satisfaction result going in and out in the Administrative Offices, also from the customer perspective. With the help of the said system, the customer can easily and comfortably rate the officer performance anytime and anywhere in just a few clicks away.\r\n\r\n	The development team has adopted the Agile Method of Software Development Life Cycle as their model on developing the system. The web application of the system was designed using the tools XAMPP, PHP, CodeIgniter JavaScript, HTML, and CSS. Based on the conclusion of our research, on the defined percentage of 85% of lever of acceptance of our study, it\'s feasible to be implemented and use by the clients based on their answered questionnaires.\r\nUpon concluding the final graph of our Results and Discussions, the lowest Grade among the FURPS in the Supportability state. It is then recommended for the researchers to ensure and enhance that the system itself would be compatible to any device or unit support available among clients and users.\r\n	Keywords Stock Inventory Management System web-based average of 4.23 and 3.21 for the mobile application which described as â€œVery Satisfactoryâ€ and â€œSatisfactoryâ€ it indicates that the system lessens the paperwork of the admin because of the automated way of managing their clientâ€™s orders and it improves the way of ordering and purchasing a product in a way that is less hassle and less time-consuming for the client. Based on the conclusions, the system could still be improved to provide the users plenty of ease while using the system.\r\n	Key words HTML, CSS, JavaScript, MySQL, PHP, CodeIgniter, PHP. Stock Inventory Management System, Polytechnic University of the Philippines.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'RclWvK5J63sY', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:41:42', NULL),
(534, 'Web-based Hardware Inventory System for Workstation Peripherals Management', NULL, NULL, 'This study aspires to be an alternative process of manual tracking and monitoring of the equipmentâ€™s and employeeâ€™s information. The system will help the company\'s processes, such as managing the reports needed by the employee and clients, to be more efficient and less time consuming. Web-based Hardware Inventory System for Workstation Peripherals Management can be accessed with any device through a browser that has Internet access. It will reduce the time which will be consumed when the process takes place and will help them track their schedule and be able to assign tasks. Researchers used the Rapid methodology to know the process and development of the system. The web application was developed using a server-side scripting language which are MySQL and PHP and HTML, CSS and JavaScript for the design. Test results shows that the software has delivered its functionality as expected of its outcome.\r\nThe system was evaluated by 2 respondents composed of IT employees and Interns of the company using the criteria functionality, usability, reliability, performance, and security. The overall web applicationâ€™s performance gained a mean average of 3.92 which described as â€œVery Satisfactoryâ€. It indicates that the system lessens the paperwork of the admin because of the automated way of managing their equipmentâ€™s and employeeâ€™s information and it improves the way of monitoring the inventory in a way that is less hassle and less time-consuming for the client. Based on the conclusions, the system could still be improved to provide the users plenty of ease while using the system. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'Mgqbzdu5tQaK', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:42:07', NULL),
(535, 'Online Membership Management for Person with Disabilities Office of Taguig', NULL, NULL, 'Online Membership Management for Person with Disabilities Office of Taguig is a web-based system that helps Person with Disabilities Affairs Office(PDAO) to manage the online registration for PWD in Taguig. As a community, online registration is more efficient compared to the manual registration. The aims of PDAO is to have an automated registration to help the PWDâ€™s. \r\nTherefore, this system was developed to help the PDAO in their registration process. It provides a user-friendly web pages and effective registration to the PWDâ€™s. \r\nThe system consists of five modules which is the Log-in Module, Admin Module, Staff Module, User Module and Registration Module. The implementation of the system has been done. The testing shows that the objectives of this system has been achieved.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, '2h3oe679yFzx', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:48:33', NULL),
(536, 'Auto-Mobile Inventory System', NULL, NULL, 'To provide a more systematic method of recording information of vehicle, from the manual\r\nsystem that the Auto-Mobile Inventory System used before.\r\nThis system is transforms and time consuming management of written and visual materials\r\ninto more accurate and efficient recording of information .To accomplish this, Auto-Mobile\r\nInventory System (AMIS) of GSO Department were developed.\r\nThe system Auto-Mobile Inventory System (AMIS) of GSO Department to address the\r\nfollowing problem (1) the lack of computerized system, (2) manual recording of Auto-Mobile\r\nInventory system (AMIS) of GSO Department information. (3) The need to store the records\r\nmanually. Based on the given problems, Auto-Mobile Inventory System (AMIS) of GSO\r\nDepartment to provide a system in according to the specification of the client, provide information\r\nreports needed, and to monitor all narrative reports of every complainants .All of these are done\r\nusing XAMPP, PHP, and HTML, CSS with the technology of Notepad++ and Database server\r\nusing MySQL server to comply the requirements set for the system. The system is limited and\r\nbounded only to auto-mobile the written information reports, for the benefit of the GSO\r\nDepartment office and other people concerned. It is designed to make the job of the GSO\r\nDepartment encoder a lot easier when it comes to recording information reports. It will enable\r\nthe â€GSO Department encoder to add and view the information reports as well as add category\r\ntype of information reports in cases needed. The system can also generate reports for the\r\nsummarize count of every information category. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'g7KkPEq3eMS9', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:48:59', NULL),
(537, 'Community Property Leasing Management System: Aide for Property Taxation of the Barangay Government ', NULL, NULL, 'This study aspires to be an alternative process of manual monitoring tax of the lessor of the Barangay North Daang Hari. The system will help the barangay\'s processes, such as managing the tax transactions, to be more efficient and less time consuming in requesting documents. Community Property Leasing Management System: Aide for Property Taxation of the Barangay Government can be accessed through a browser with or without Internet access. It will reduce the time which will be consumed when the process takes place and will help them track the resident tax payments. Researchers used the Rapid Application Development methodology to know the process and development of the system. The web application was developed using a server-side scripting language which are AdminLTE, MySQL and PHP framework called as CodeIgniter. Test results shows that the software has delivered its functionality as expected of its outcome. The system was evaluated by 4 respondents for FURPS and 1 respondent for User Acceptance testing composed of  Administration And Treasury Department using the using the criteria functionality, usability, reliability, performance, and security. The overall web application performance gained an average of 3.0 for the web application which described as Satisfactory. It indicates that the system lessens the paperwork of the admin because of the automated way of monitoring tax payments and printing documents and it improves the way of service for the residents that is less hassle and less time-consuming. Based on the conclusions, the system could still be improved to provide the users plenty of ease while using the system.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'IMdcJhpnD8ZO', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:49:23', NULL),
(538, 'Medicard Inventory system ', NULL, NULL, 'Computer technology is generally associated with increases in workplace productivity, computers allow each employee, using quick technologies such as email and Internet fact-checking, to accomplish more with every hour of work. As an industry in itself, computer technology also creates jobs in new fields like programming, computer-aided design and animation, Internet marketing and online publishing. Technology saves times by speeding up the work flow process. Digital filing systems save space, paper and printing costs. The researchers are developing a kind of System that can handle inventory supplies.\r\nMediCard Inventory System is an offline system, it doesn\'t require any internet connection to access. This system can manipulate the stock of inventory supplies like cleaning and office supplies. This system allows the users to request supply. The requested supplies by the registered user are automatically deducted in the supply quantity. This system notifies the user if it is running out of stock.  The requested supplies by the registered admin to the warehouse are automatically delivered. Giving an access to the admin, it can easily add if there were delivered supplies; edit on the item name; delete the cancel request; search and print in the system. However the registered user employee can also edit, delete, search and print in the system. Another feature of this system, it can record the requested supplies and converts into PDF, excel and CSV file in just clicking the button and giving an access to print. This system is user-friendly it is very easy to understand and use. This system MediCard Inventory System is very simple but reliable. \r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'LCr4oyGX3n5w', 1, 0, '2021-08-12 13:32:11', '2021-10-04 15:37:31', NULL),
(539, 'Nicole and Cheryl Genuine Speed Sales and Inventory System (NCGSSIS)', NULL, NULL, 'In this world that nothing is permanent but change, we need to accept the change in order to survive. Our country is one of the fastest growing in terms of economy. The development of our technology is growing rapidly. Computers, can resolve our problem. This machine called â€œcomputersâ€ can make our work easy. We know that after the Industrial Revolution we accept and absorb the use of machineries, even though many people can lose jobs. But, in order to make it a lot easier, the computer needs the assistance of the human, because human is the one who ordered the machine what to do, the machine only help human to do a better job. Nowadays, the computers can serve as storage and management of data. As the computer plays a big role in our life day-by-day, the computers easily gained our importance from us. Their changed a big role in business. Like in motor parts institution they transformed the paper-based system to the automated one.\r\nAs we switch the paper-based to automated system, it means that we can find the data easily. It has a greater chance that can give us ready and available information that we need as based on repair decisions. By this, we can assume that it will help the repair institutions on making important decisions and improving their services. In this world full of different peoples, we need a system that will arrange and organize the records of repair history and customer orders.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'JK0Q7YGR4g3n', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:43:45', NULL),
(540, 'The Development of Student Information System for Providence Advent Academy', NULL, NULL, 'Student Information System can be used by education institutes to maintain the\r\nrecords of students easily. Achieving this objective is difficult using a manual system as\r\nthe information is scattered, can be redundant, and collecting relevant information may\r\nbe very time consuming. All these problems are solved using this system.\r\nMost schools in our country rely on manual processing of data, which means\r\nstoring information about students manually through file folders, and filling it with\r\nhandwritten information. But this processing consumes too much time and effort for the\r\nschool faculty or staff. Along with the modernization and upgrading of today\r\neducational system, comes the innovation and integration for the school faculty and\r\nadministration.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 1, NULL, 1, 'P1SyBYOdhnse', 0, 0, '2021-08-12 13:32:11', '2021-09-08 08:44:26', NULL),
(542, 'Implementation of Client Satisfactory Assessment System', NULL, NULL, 'Title		: Client Satisfactory Assessment System\r\nResearchers	: Jay Philip T. Bruno\r\n		  Jazzie B. Ng\r\n		  Jerome A. Peralta\r\n		  Elijah R. PiÃ±on\r\n		  Robert M. Sarza\r\nInstitution	: PUP Taguig Branch\r\nDegree	: Bachelor of Science in Information Technology\r\nYear		: 2018\r\nAdviser	: Prof. Gecilie C. AlmiraÃ±ez \r\n\r\n	This study focuses on determining whether the Client Satisfactory Assessment System can eliminate the problems encountered from evaluating each office in the Polytechnic University of the Philippines Sta. Mesa, Manila and Taguig Branch such as measuring client satisfaction and the quality and timeliness of staff services.\r\n	The system evaluates each office and their respective staff and the results will be sent to the Institute for Data and Statistical Analysis for interpretation and then will generate reports. The researchers used the Agile Methodology for the development of the system. The software tools that were used in developing the system are Sublime Text and XAMPP. PHP, HTML and CSS were the programming languages and CodeIgniter was used as the web framework. \r\n	For the testing of the system, selected IDSA staff and several students participated on the survey focusing on the usefulness and effectiveness of the system. The standard of the system was based on its functionality, usability, reliability, performance and security. The results show that the system got an overall rating of 4.37% that lies under the very satisfactory on the likert scale. Also, the result of the mobile application got an overall rating of 3.28% that lies under the satisfactory on the likert scale.\r\n	After the system testing, the researchers gained positive comments and concluded that the system has surpassed the use of manual process. Thus, with minor revisions, the system can now be implemented. Furthermore, the system also needs improvement in terms of usability and additional test to ensure its reliability.\r\n	Based from the conclusion the IDSA administrator seeks a solution to develop a feature in which the evaluation of service in each office can work even with or without an internet access.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'Q8uaWre2FLYp', 0, 0, '2021-08-12 13:34:24', '2021-09-08 07:36:06', NULL),
(543, 'The Impact of Approaches During Recruitment Process in the Acceptance of Job Offer in BPO Industries', NULL, NULL, 'Name of Institution	: Polytechnic University of the Philippines - Taguig Branch\r\nAddress		: Lower Bicutan, Taguig City\r\nTitle	: The Impact of Proper Approaches during     Recruitment Process inthe Selection of Job Offer in BPO Industries ofTaguig\r\n\r\nAuthor			: Cansino, Angelica\r\n Delfin, Christine Joy			\r\n Gloria, Shane Danielle\r\n Lumanta, Mary Dianne\r\n Nasayao, Julie Ann\r\n Nocheseda, Camille\r\nDegree		: Bachelor of Science in Business Administration\r\nMajor			: Human Resources Development Management\r\nDate Started		: August 2016\r\nDate Completed	: March 2017\r\n\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'TiQMvDtwBrNG', 0, 0, '2021-08-12 13:34:24', '2021-09-08 07:39:29', NULL),
(544, 'GoodBuy Boutique Inventory System with Point of Sales', NULL, NULL, 'This paper discusses the GoodBuy Boutique Inventory\r\nSystem with Point of Sales, a web-based inventory\r\nmanagement system specifically developed for\r\nGoodBuy Boutique. It aims to eliminate inefficiency and\r\nineffectiveness resulting from a mismanaged inventory,\r\na problem that is common to retail businesses. The\r\nsystem allows the automated maintenance of inventory\r\nitems, using quick response (QR) codes for item\r\ntracking, and having a point of sales (POS) integration\r\nfor handling retail transactions that can improve\r\nGoodBuy Boutiqueâ€™s business operations.\r\nFor the administrator, several modules are accessible for\r\ninventory maintenance, as well as recording of sales,\r\nexpenses, and transferred items and printing of price\r\ntags. The systemâ€™s POS module can record sales and\r\nretail transactions. A mobile application for physical\r\ninventory is also developed. The researchers used the\r\nAgile Model for the software methodology and the\r\nsystem was developed using PHP, JavaScript, HTML5\r\nand CSS3. MySQL was used for database management.\r\nThe system had undergone alpha testing and a user\r\nacceptance testing using FURPS as a software testing_\r\nmodel. The alpha testing resulted to a â€œVery\r\nSatisfactoryâ€ assessment from a total of ten respondents,\r\nwith security receiving the lowest rating while the user\r\nacceptance testing resulted with the graphical user\r\ninterface having the lowest rating, interpreted as\r\nâ€œAverageâ€. Based on these results, it is recommended to\r\nimprove the security and to design a better user interface.\r\nThe system is currently being maintained at GoodBuy\r\nBoutique and further enhancements can still be made.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'K0yNWECgJkjA', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:41:01', NULL),
(545, 'S. Tabios Software Solutions Order Management System', NULL, NULL, 'This study aspires to be an alternative process of manual\r\nordering and purchasing of the products and services offered by the\r\ncompany. The system will help the company\'s processes, such as\r\nmanaging the clientsâ€™ orders and sales, to be more efficient and less\r\ntime consuming. S. Tabios Software Solutions Order Management\r\nSystem can be accessed with any device through a browser that has\r\nInternet access. It will reduce the time which will be consumed when\r\nthe process takes place and will help them track their schedule and be\r\nable to assign tasks. Researchers used the Agile software\r\nmethodology to know the process and development of the system.\r\nThe project was developed using a server-side scripting language\r\nwhich are HTML 5, CSS, and JavaScript as the front end. As for the\r\nback end, the researchers preferred using MySQL and PHP. Test\r\nresults shows that the software has delivered its functionality as\r\nexpected of its outcome. The system was evaluated by 12 respondents\r\ncomposed of IT students, Founder, and Finance Director of the\r\ncompany using the FURPS and User Acceptance testing using the\r\ncriteria functionality, usability, reliability, performance, and security.\r\nThe overall systemâ€™s performance gained a mean average of 4.23\r\nwhich is described as â€œVery Satisfactoryâ€. It indicates that the system\r\nlessens the paperwork of the admin because of the automated way of_x000D_\r\nmanaging their clientsâ€™ orders. The system is also significant for the\r\nclients because it improves the way of ordering and purchasing a\r\nproduct in a way that is less hassle and less time-consuming. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, '6wZ2rFTLhMxa', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:45:32', NULL),
(546, 'The Implementation of Barangay New Lower Bicutan\'s Online Residents Information System', NULL, NULL, 'Online Residents Information System is an information system that serves as an online document request for the residents of Barangay New Lower Bicutan in Taguig City. It aims to lessen the time spent in the transactions within the barangay and also utilize the process of requesting documents through the use of the online system. \r\nThe system is divided into three modules: Administrator, Cashier, and Residents. The administrator module permits the secretary to approve requests, print reports, add cases, and update news, announcements, projects, and also the residentâ€™s information. The cashier module which allows the cashier to print the approved documents. Lastly, the resident module which enables the residents to request barangay documents they needed. The researchers used the Agile Software Development for the software methodology. Code Igniter, MySQL, CSS 3, Javascript, HTML5, and phpMyAdmin were the tools used to develop the system.\r\n	A total of 100 respondents from Brgy. New Lower Bicutan tested the system. FURPS was used to identify the software attributes of the system; in which the web application resulted to 4.2 with a verbal equivalent of Very Satisfactory while the mobile application resulted to 3.2 with a verbal equivalent of Satisfactory. ORIS is now currently being maintained at the Barangay New Lower Bicutan and still open to further changes and improvements.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'QtompzJYUGqS', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:46:01', NULL),
(547, 'Polytechnic University of the Philippines - Taguig E-Journals System', NULL, NULL, 'Journals have been known to serve as permanent and transparent forums for researches. Its purpose, according to Henry Oldenburg, is to give researchers a venue to â€œimpart their knowledge to one another, and contribute what they can to the Grand design of improving natural knowledge, and perfecting all Philosophical Arts, and Science. This profound purpose of journal publication is being delayed because of its manual process. \r\nIn avoidance to the delays of journal publication, Polytechnic University of the Philippines-Taguig E-Journals System (PUPT E-Journals) is made. It aims to create an E-Journals system that can submit, review, sell, and publish journals online and to create an android application that can carry out notifications for the users. It is a paperless way of submitting journals for the authors. The reviewers are able to reanalyze journals without holding bulks of paper to check. The publisher and the author can also interact without personal contact with the committee or the reviewers. It also aims to make the method of promoting journals easier and more efficient through online approach to readers.\r\nThis system is created using PHP with CodeIgniter, Materialized HTML, and MySQL. The android application is made using Android Studio and Java language with Pushy.\r\nThe developers used the Agile System Development Life Cycle as their system methodology. \r\nThe developers used the FURPS Questionnaires for testing. FURPS stands for Functionality, Usability, Reliability, Performance, and Security.\r\nAn admin, five reviewers, four readers, and eight authors did the system testing. The overall result is: Functionality-4.86; Usability-4.78; Reliability-4.87; Performance-4.85; Security-4.42. The grand total is 4.87, whichfalls under Excellent criteria in the Likert Scale.\r\nFour users tested the mobile application. The result for mobile application testing is: Functionality-4.4.3; Usability-4.37; Reliability-4.42; Performance-4.56; Security-4.4. The grand total is 4.42, whichfalls under Very Satisfactory criteria of Likert Scale.\r\nTesting results show that both Web and Mobile Application of PUPT E-Journals satisfy the needs of the client and its users.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'gnY6GwMKyLsl', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:46:50', NULL),
(548, 'South Daang Hari Automated Blotter System', NULL, NULL, 'This capstone project focuses on the development of an automated blotter system to aid the barangay officials of South Daang Hari in keeping incident data from not being secured, from loss of data, from the inconsistency of data, and from a time-consuming process \r\nof processing incident reports.  This automated blotter system can generate individual narrative reports and categorized reports. \r\nThe primary objectives of this project are to present the system to the city officials of Taguig and to conduct a pilot testing and a user acceptance testing for its modules. \r\nAgile Methodology was used throughout the development process of the system for it to be more client-oriented. The web application was designed using HyperText Markup \r\nLanguage, Cascading Style Sheets for front-end, and Laravel for the back-end. Its mobile application was developed with Android Studio and Java. \r\nFURPS model was used to evaluate software quality of the SDHABS. Five (5) \r\nrespondents participated in the alpha testing of the system in which it resulted in a mean of 4.3. Ten (10) respondents, which included the barangay staff, participated in the beta and user acceptance testing conducted in which it resulted in a mean of 4.75. Based on the results, it was concluded that the system generally provides functions that are capable of managing incident records in a more organized and secure method. \r\nBased on the conclusion presented, the researchers recommend the use of a \r\ncomputer unit with high Specifications such as higher RAM of 4GB as the base option and minimum of Quad-core processor. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'xCbg6pIOdMZJ', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:47:22', NULL),
(549, 'Nichiyu Asialift Inventory System', NULL, NULL, 'This Capstone Project focuses on the development and implementation of Nichiyu\r\nAsialift Inventory System (NAIS) in Nichiyu Asialift Philippines, Inc. that can eliminate the\r\nuse of stock cards. Instead of manually writing on the stock cards, an employee encodes\r\nthe item details directly on their computer. This lessens the time consumed in writing on\r\nthe stock cards. It also minimizes the work stress of employees and maximizes the\r\nmanpower of the company. NAIS was made based on clientâ€™s specification that can\r\nmonitor items in the inventory and generate reports. The web application was designed\r\nusing different programming languages. For the front-end development, the researchers\r\nused HTML, CSS and Javascript while PHP and MySQL Database for the back end\r\ndevelopment. Agile Development was used as the software methodology in the\r\ndevelopment of Nichiyu Asialift Inventory System and Mobile App. The researchers\r\nconducted a system testing using FURPS Questionnaire (Functionality, Usability,\r\nReliability, Performance, and Security) and Likert Scale was used to interpret the results.\r\nThe total number of respondents were five composed of employees from different departments. The overall-result for the system was 4.63 and 4.40 for the mobile app. In\r\naccordance to the Likertâ€™s Scale, the system was interpreted as â€œExcellent while the\r\nmobile app was â€œVery Satisfactory. Security has the lowest rating based on the results.\r\nThe researchers concluded that the functionalities can still be improved and optimized to\r\nwhich will suit the needs of the different departments. The researchers suggest \r\nsecurity of accounts and information would be improved.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'iwe6vcPCp3xs', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:48:54', NULL),
(550, 'Zinah Christian Academy - Student Enrollment and Management System', NULL, NULL, 'This study determined the overall effectiveness of using the Zinah Christian Academy Student Enrollment and Management System (ZCASEMS) on the daily transactions of the institution such as managing admission, enrollment, and financial transactions of the students.  \r\nGenerating accurate financial reports, managing student information, and sorting applicants records are few of these main transactions that are being conducted by the Zinah Christian Academy. However, performing this transactions are difficult especially when all of this are being done by only one person. This makes the process time-consuming and labor-intensive which affects the service of the institution to their clients. Through the help of this research, the Parse Development Team proposed the Zinah Christian Academy Student Enrollment and Management System. It is a system used to handle studentsâ€™ and applicantsâ€™ information, financial transaction records and also to generate accurate reports to help the institution. \r\nAgile Methodology was used in the development of the system to be able to make it flexible to the sudden changes during the development process. The programming languages that were used are PHP 5 and JavaScript for the back-end. HTML5, CSS3 and Bootstrap framework for the front-end. Code Igniter as \r\nthe framework for PHP and MySQL server as the systemâ€™s database. \r\nThe system undergoes many processes of testing for the assurance of client satisfaction. There are surveys conducted which shows if the system are accurate and functioning well. The system classifies through the analysis of answered questionnaire wherein the functionality, usability, reliability, performance and supportability of the system are being evaluated. The researchers use a Likert Scale to represent and examine the rating of evaluation results. An overall average of 4.46 for the web application and 4.50 for the mobile application was derived from the test conducted to the system. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'DNPyzjl6Thd8', 2, 0, '2021-08-12 13:34:25', '2021-10-03 16:08:48', NULL);
