(551, 'STUDENT SERVICES MANAGEMENT SYSTEM (SSMS)', NULL, NULL, 'Nowadays, technology gives human a big help to hasten up worls or jobs. In Information Technology, every technology present in the market is utilized up to its maximum usage. RFID (Radio Frequency Identyification) Technology is created to produce an automatic data capture that is relying on the unique data stored in every RFID chip. Recently, the RFID technology had ben used to provide basic identity of a person, commonly used in some bussiness as gate pass or badge access to a certain facility or location. This study aims to enhance security of the university. With RFID attached to the student\'s basic information, every entrance and exit of people will be properly monitored exactly. This includes the time and date of the person\'s arrival and departure  from the university\'s premises. In this study, students and members of Computer Society and Mentors Society of the Polytechnic University of the Philippines - Taguig Branch actively participated to the testing, up to its implementation phase. These students and members served as respondents to make tha success of the study possible. Polytechnic University of the Philipines - Taguig Branch\'s Students Services Office, laso participated in the testing system. The Students Services Office gathered much benefit from the system\'s collected data such as, records about student\' entry and departure of the university premises. With an amazing result gathered during test, the study shows posssibility for final deployment as long as maintenance will be provided and bugs will be properly solved, ocassionally. The researchers concluded the RFID can boost or fasten up a certain process or work flow as long as it fits the bussiness rules. In line with that, since there aremany types of RFID existing in the field as of today, the researchers recommends that the flow would a lot faster if the RFID readers used in the university entrance and exit will be upgraded to a higher proximity frequency to have a longer range of ability in capturing individual RFID tags. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'uXok6BL0KSth', 0, 0, '2021-08-12 13:34:25', '2021-08-13 16:30:10', NULL),
(552, 'Marchina Mart Inventory \\System', NULL, NULL, 'The system that we are developing for Marchina Mart is named Marchina Mart Inventory System (MMIS), basically it will store all their database items and will give them the ability to manage their products by setting the retail, wholesale and discount prices. In addition to these basic features, they can also check and generate reports pertaining to their income and product stocks, we have also suggested to them that we are also developing a point-of-sales system to complement the inventory system we are currently developing.\r\nThe Methodology used for the development of the website application is the Waterfall SDLC. MySQL, CodeIgniter, CSS3, Javascript, HTML5, and phpMyAdmin were also used to develop the system. \r\nThe 10 respondents from this research are all employees of Marchina Mart. FURPS was used to identify the software attributes of the system which resulted to 4 with a verbal equivalent of Very Satisfactory. MMIS is currently being used by Marchina Mart to handle their inventory and is actively being updated by the researchers.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'YovRZHTUSIDM', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:49:40', NULL),
(553, 'Homeowners Association Management System', NULL, NULL, 'Homeowners Association Management System is a web-based system with mobile application that is intended to help the officers and homeowners of the Annex 17-27-36 Better Living Subdivision Homeowners Association to improve their manual-file systems. With the help of the said system, the admin and the treasurer can easily organize records of homeownersâ€™ information and keep track of their monthly dues payments and faster generation of accurate reports. For the homeowners, they can easily be updated and view their statement of accounts and announcements on the website. The system also added some features which will make it more useful; past and upcoming news and events, downloadable forms, an inquiry module and information about the facilities inside the village and the like.\r\n\r\nThe development team has adopted the Agile Software Development Life Cycle as their model on the development of the system. The web application of the system was designed using the tools Sublime Text and XAMPP in languages: PHP, JavaScript, HTML, and CSS while they used CodeIgniter for the web framework. For the mobile application, the researchers used Android Studio and Java for the language._x000D_\r\n\r\nFor the testing of the system, the researchers used the Likert Scale for the basis of grading the Functionality, Usability, Reliability, Performance and Security (FURPS) Questionnaire to evaluate the system. It is conducted with fifteen (15) respondents who participated on the surveys that focused on the effectiveness of the system in five aspects such as functionality, usability, reliability, performance and security. The results show that the system is 4.24%, Very Satisfactory and it will be a great help in the association and for the homeowners. For the mobile application, the partial result is 4.14%, Very Satisfactory. The project team is set to conduct more system tests.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'FiIDU87gESNO', 0, 0, '2021-08-12 13:34:25', '2021-09-08 07:50:06', NULL),
(554, 'National Shrine of Mary Help of Christians Website and Information System', NULL, NULL, 'The National Shrine of Mary Help of Christians Website and Information System (NSMHCWIS) is an information system which intends to connect the parish administrators to its parishioners and guests with the utilization of modern technology.  From the large sum and variety of parishioners, the parish offers sacramental services and document requests.  The manual process happens to operate on the traditional paper transactions for applications and requests.  Announcements circulate through SMS blasting and a few are reached.  To cope up, NSMHCWIS is composed of three main modules and a mobile application, MHC Portal.  Online sacramental service application and online document requests lets the management of applications and document requests be submitted online. Content management for ease of information delivery.  The capstone project was developed under the Agile Software Development Cycle Model. Researchers used the CodeIgniter Framework, Ionic, and MySQL as the main technologies. Thirty-seven (37) respondents tested and verified its capabilities.  The capstone was tested with the ISO IEC 25010 Software Quality Model and had the results of 5.206/6 and interprets as \"Strongly Agree\".  The User Acceptance Testing for the web application had the rating of 4.355/5 and reads as \"Very Satisfactory\"; and the mobile application had also the rating of 4.56/5 and reads as \"Excellent\".  The researchers conclude that NSMHCWIS achieved its purpose to associate itself to the community of the National Shrine of Mary Help of Christians Parish.  Users recommended that the system needs improvement on its functional suitability, security, & interfaces.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'AqYa8hVzr1B0', 0, 0, '2021-08-12 13:34:25', '2021-08-13 16:30:10', NULL),
(555, 'Couture: Online Catalog and Renting', NULL, NULL, 'This capstone project aims to provide an online catalog and renting system for Joan Samar Collection.  A Web and mobile application was developed to cure the ineffieciencies of the manual process by provideing online inventory, online transaction processing for online selling and renting, and a catalog system.  The system may boost the business sales and revenues, while promoting the product and services to the general public hrough the online community.  It can also do online generation of accurate reports.  The Web App was developed using PHP and CodeIgniter as its framework for the back-end development, Materialized HTML, CSS, and Foundtaion Framework for the user Interface design and MySQL for the database with Apache for web hosting while the Mobile app was developed using Ionic Framework.  The developers used Scrum as their software methodology which emphasizes decision-making from real-world results rather than mere speculations.  The adopted research design for this project was quantitative design.  With the help of forty-three (43) various respondents consisting of the administrators, employeees and customers, the ISO 25010 testing of the web and mobile app went smoothly and a result of 5.16 and 5.21 was gathered respectively.  The remarks for the overall results for both web and movile were very good.  The user Acceptance Testing for both Web and Mobile App resulted to 4.53 and 4.61 respectively.  Therefor, te system has met all the requirements and can be deployed and ready to be used.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'fnSLRIVwEq1P', 0, 0, '2021-08-12 13:34:25', '2021-08-13 16:30:10', NULL),
(556, 'PUPT - Massive Open Online Course', NULL, NULL, 'PUPT - Massive Open Online Course (PUPT - MOOC) is a system that aims to provide an easy way for instructors to create and control a web classroom network as well as enable college students to connect and work with their classmates and instructors anywhere and anytime. The objective of this study is to determine the preferences of college students towards the usage of communication and information technology in the form of the PUPT - MOOC system. The research aims to know whether PUPT - MOOC will be a good teaching strategy that should be used by instructors to form a technology based learning environment. With the help of all the gathered data and references, the researchers will aim to provide a detailed introduction on the PUP Taguig - MOOC system.\nThe Software methodology used is Agile Software Development because it can ensure good software throughout the development process. The researchers primarily used XAMPP, Laravel, Bootstrap V3 (Admin LTE), Json, Jquery, and Ajax to develop the system.\nWith the help of the respondents, the BSED and BSIT students, the researchers were able to conduct their ISO 25010 and User Acceptance Testing. The results were 3.9 and 3.8 respectively, thus gaining a \"Very Satisfactory\" grade. For the Mobile Application, a total score of 4.6 thus earning a grade of \"Excellent\" in the User Acceptance Testing.\nThe researchers concluded that the system is great for learning through an online process because of the availability and efficiency of the system.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'vSZfXCBdFQLa', 0, 0, '2021-08-12 13:34:25', '2021-08-13 16:30:10', NULL),
(557, 'GoodBuy Enterprises Management Information System with Online Shopping', NULL, NULL, 'Goodbuy Enterprises Management Information System with Online Shopping (GEMISOS) is a web-based system with mobile application inteded for GoodBuy Enterprises.  The capstone project is focused on the development and implementation of GEMISOS to solve the problems met in its previous system and improve the processes for its stakeholders.  To cater the needs of the enterprise, three main modules were made by the researchers, an online shopping which provides an online presence for the store, an administrator module that manage users, inventory, sales, expenses, orders, and item transfer; and a cashier module to encode daily sales using quick response (QR) code.  It also includes a mobile application for physical inventory and point of sales for faster business processes and transactions.\n\nThe researchers used the Agile Software Development Life Cycle which delivers early partial working solutions that are suitable for developing the system.  GEMISOS was developed using CodeIgniter Framework, MySQL, and JQuery and Android Studio for the mobile application.\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'I1korvWQFn9e', 0, 0, '2021-08-12 13:34:25', '2021-08-13 16:30:10', NULL),
(558, 'GAME DEV: FILIPINYA', NULL, NULL, 'The Filipinya game is a game developed by SMYL that is both entertaining and educational to all of its players for it will give them a specific background on our nation\'s cultural folklores while promoting Philippines unique local products. This game aims to reminisce people\'s minds or introduce them to Philippine cultural folklores and local products which was mainly based on the Filipinya Book published by Sir Richard Thomas, our respective client.\r\n	Agile Methodology was used in the development of the game to be able to make it flexible to all sudden changes that might happen during the development period.\r\n	The game underwent many development stages for the assurance and satisfaction of the client. The final test was conducted by five system developers as respondents as they evaluated the gameâ€™s functional stability, performance efficiency, compatibility, usability, reliability, security, maintainability, and portability.\r\nThe game was able to receive ratings of 3.72 (Agree) in final testing phase its development and 4.44 (Good) during its User Acceptance Testing indicating that it is well-received by its players.\r\nIt was concluded that the objective of this study was met by the researchers as they outlined and recognized the requirements of the client. With the conclusions, the following recommendations were drawn; the game should be a lot longer with more challenges for the players, there should be more game mechanics like skill upgrading by game points and should also have more folklore creatures and additional Philippine products for promotion.\r\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, '0h4EOnBDZ8bR', 0, 0, '2021-08-12 13:34:25', '2021-09-08 08:20:17', NULL),
(559, 'PUPT Online Repository Thesis and Capstone Projects (PUPT-ORTAC)', NULL, NULL, 'The project focused on the development and implementation of the PUPT Online Repository of Theses and Capstone Projects. It is a web and mobile application that stores the soft copies of the research papers such as the e-journal, monograph, and posters. The project aimed to resolve the problem regarding the submission of the researches and the generation of reports needed for accreditation. The tools used for the web application development were the MySQL database server, PHP, Ajax, and CodeIgniter framework, meanwhile the mobile application was developed using Ionic framework with AngularJS. The system was tested using ISO 25010 and the User Acceptance Testing questionnaires as testing tools.\r\nThe rating of the system is 4.16 (\"Slightly Agree\") and 4.73 (\"Very Good\") respectively. Therefore, based on the data gathered, the system provided a solution for the mentioned problems, thus making transactions efficient and effective.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'roQyCMUWvBsb', 0, 0, '2021-08-12 13:34:25', '2021-09-08 08:20:41', NULL),
(560, 'ESC Veterinary Clinic Management System (ESCVCMS)', NULL, NULL, 'This capstone project is named, ESC Veterinary Clinic Management System. This project is proposed by the ConCat Development Team and is backed by the ESC Veterinary Clinic, a clinic that specializes in the grooming an treatment of pet animals. This capstone project aims to transform and immensely improve upon the current manual process, which is the pen-and-paper method of recording transactions, into an easier, more responsive, and more importantly, a mostly hassle-free process. The capstone project will provide three (3) modules, the Appointment Module, Consultation Module, and Inventory Module. The system will also make use of user authentication methods such as creating a username and password which will serve as security. As for the system methodology, this project will make use of the Agile Development Methodology. The test results of this research have already been determined to be successful. The research as a whole is considered a success and recommendations only include minor revisions on the design and the system.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'hARCp0sQHN5n', 0, 0, '2021-08-12 13:34:26', '2021-08-13 16:30:10', NULL),
(561, 'Online Research Management Information System', NULL, NULL, 'This capstone project focuses on the development and implementation of web-based and mobile application called Online Research Management Information System to facilitate processing of the institutional and externally funded research and international research presentation application, monitoring, archiving of researches and providing periodical reports. It will also serve as a repository of all researches of the PUP. There are different types of funding opprotunities in the system namely: Research Grants, Paper Presentation Financial Assistance, Publication and Citation Incentives, Merit Promotion through Publication and Citation, Invention Disclosure Incentives, Thesis and Dissertation Grants. \n\nThe current system requires a lot of paperwork, efforts, and time. The researchers needs to submit the research personally and will be assigned to a reviewer. If rejected, he/she will be given a span of time for revision. However, the process will continue if approved. The second step is the evaluation of REMC. If rejected, the researcher will be notified to revise his/her work, and if approved, the researcher will be notified to submit additional three (3) copies of his/her work for final approval. Because of the probles, ORMIS is created to help the PUP Research Management Office.\n\nUpon the alpha testing of the system with the use of ISO25010 Standards, the system gained the rating of 4.93 for Functional Sustainability, 5.8  for Performance Efficiency, 5.7 for Compatability, 5.23 for Usability, 5.4 for Reliability, 5.68 for Security, 5.2 for Maintainability, 5.06 for Portability, 5.2 for Satisfaction, 5.1 for Freedom from Risk and 4.9 for Context Coverage. ORMIS passed the criteria of the testing.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'OvVwC5YiKdTj', 0, 0, '2021-08-12 13:34:26', '2021-08-13 16:30:10', NULL),
(562, 'Polytechnic University of the Philippines - Taguig Online Accreditation Document Management System', NULL, NULL, 'The PUP Taguig Online Accreditation Document Management System (PUPT-OADMS) is an online, web-based and mobile application designed as a central repository of documents for accreditation. This system upgrades the physical filing of documents into an electronic document management system that supports its users to easily store and retrieve files, eliminate document loss and duplication, assign documents to other faculty, and fasten the uploading of documents through mobile app scanner. It aims to lessen the burden of finding documents from different sources and provide a convenient platform for document management. The researchers used Agile as software methodology, PHP with Codeigniter framework, and MySQL for the database. Android Studio, Java, and MySQL were used for the mobile application. A total of four (4) respondents from the combined population of faculty members, area coordinators, and administrator, participated in the UAT testing of web application, while 20 respondents for web application and 44 respondents for mobile application from IT students in PUP Taguig participated in Alpha and UAT testing respectively. In the UAT testing, the web, and mobile application got scores 4.625 and 4.488 with a descriptive rating of Excellent and Very Good respectively. For the Alpha testing, the web application was rated 5.309 with a descriptive rating of Strongly Agree. The developers conclude that PUPT-OADMS, as a web and mobile application, can provide a better way of document management and a user-friendly environment to its users. It was recommended to add print all option for documents, disable button upon submission, and leave a message upon document approval. ', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, '2te0PjoW7OgI', 0, 0, '2021-08-12 13:34:26', '2021-08-13 16:30:10', NULL),
(563, 'Southbay Dental Care Management System', NULL, NULL, 'This capstone project aims to provide solutions to help the Southbay Dental Care meets its needs in producing an accurate and responsive information in mananging their patient, transaction and inventory records. File managing were basically used by the clinic. Workforce and energy are too much needed every time when the patients entered and processes must  be organized to maintain the productivity.\r\nThe Southbay Dental Care Management System offers a function that will help the administrators fulfill the works efficiently in appointing patient, schedule its transactions, managing inventory, giving reports and storing information. Providing the five modules, Admin, Dentist, Secretary, Cashier, and Patient. Each were differing in functionalities and processes.\r\nUsing the Agile Model as the software methodology, secures the accuracy of the system and product design. The application is built on laravel Framework, MySQL was used for the database and a combination of HTML and PHP for the coding of the composition.\r\nRespondents from both the administrators and patients took place in answering the User Acceptance Testing. The Web Application evaluated with an average of 4.42 and rated as Very Satisfactory and its Mobile Application ranked as Excellent with a computed mean of 4.75. Alpha testers used ISO/IEC 25010 Model to evaluate the software. Received a rating of 3.90 which viewed as Agree. The results came to conclude that the objectives and schemes of the application were completely performed. Thus, functionalities and enhancements on the system can be further be made.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 2, NULL, 1, 'wM0QnEbfirHc', 0, 0, '2021-08-12 13:34:26', '2021-09-08 08:21:39', NULL),
(564, 'Factors Affecting in Studying Stenography of Office Management Technology Students in Polytechnic Un', NULL, NULL, 'As Office Management Technlogy student, one must acquire the skill in writing stenography. Speed and Accuracy, Practice, and Transcription are factors in studying stenography of students. Most student find stenography a difficult thing to understand because of lots of barriers in understanding it.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'JeoBS3dgLFUK', 0, 0, '2021-08-13 00:55:50', '2021-08-13 16:30:10', NULL),
