(566, 'Level of Job Satisfaction of Non-Teaching Staff in Polytechnic University of the Philippines Branche', NULL, NULL, 'After identifying and understanding the factors affecting the job satisfaction of an employee, it is important to know how these factors affect his job satisfaction.  Identifying and understanding these will be of no use if evaluation will not be conducted since satisfaction changes as the years pass by with the trends and demands that life gives.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'mb48YlVMwCLR', 0, 0, '2021-08-13 00:55:50', '2021-08-13 16:30:10', NULL),
