(570, 'The Relationship of Study Habits and Environment to Academic Achievements of the Graduating Students', NULL, NULL, 'Knowledge of the phenomena and principles of learning is critical to our understanding of the behavior of people and animals. As they learn more about the processes of learning we can devise better education systems, deal more effectively with many forms of mental illness, train parents in child-rearing practices, and help people learn how to better control their own behavior.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'OEhHZKrieLpI', 0, 0, '2021-08-13 00:55:50', '2021-08-13 16:30:10', NULL),
(571, 'Homophobic Bullying and it\'s Effects on the Academic Performance of Selected Students in President D', NULL, NULL, 'The school is the second home of every students.  It promotes quality education and provides appropriate learning experience for each student.  The lesbian, gay, bisexual and transgender are also a part of the society.  The effects of bullying on the childâ€™s academic performance can be devastating long after the bullying stops.  Understanding how homophobic bullying effects a child academic performance can help alleviate some of the long-term damages.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'iMAmX9zGSFrp', 0, 0, '2021-08-13 00:55:50', '2021-08-13 16:30:10', NULL),
