(573, 'Assesment in Stenographic and Typing Skills of Graduating DOMT with Specialization in Legal Office M', NULL, NULL, 'The Polytechnic University of the Philippines (PUP) emerged as the top school of choice among local employers scouting for fresh graduates, according to the latest report by Jobstreet.com Philippines.\r\nCiting the results of the companyâ€™s Fresh Graduate Survey, Jobstreet.com Philippines country manager Philip Gioca said the state-run PUP raised five notches to top last year 2016 survey, edging out the University of the Philippines (UP), which landed in the third spot.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'GAWt2SYqFhE1', 1, 0, '2021-08-13 00:55:50', '2021-10-11 05:54:37', NULL),
(574, 'Levels of Commitment and Practice of Student Leaders at Polytechnic University of the Philippines- T', NULL, NULL, 'Leadership is the act of influencing and directing people to achieve common goal.  Leadership has been characterized as activity aimed at bringing about change in organization and social system to improve peopleâ€™s lives.  Such responsibilities suggest that leaders are charge with enormous burden to effect organizational and social change. Leaders set the direction, build an inspiring vision, and create something new. They help themselves and others to do things that will help their organization/institution to grow. They also play an important role in school organization.\r\n	One of the example are the student leaders who are given an honor and a responsibility. Through an all-school ballot, students recognize a studentâ€™s abilities and talents in community and interpersonal relationships. Student leaders who are mostly juniors and seniors who usually possesses traits like dependability, fairness, initiative, and trustworthiness. They show and manifest respect, good judgment and compassion, setting a good example for the rest of the student community.  \r\n	Given that students must possess the capability of handling responsibilities of different tasks in different situations, it is proven that leadership ability brings major impact and co-relation in Colleges and Universities. Many students who wishes to enter a University may have excellent grades and test scores, but what often sets an applicant apart that led him to secure an acceptance letter; was his or her outstanding involvement in school clubs, athletics, or community organizations earning the experience and respect that will guarantee them a leadership role in their junior or senior year.  \r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'MJ17C0cGIBwa', 0, 0, '2021-08-13 00:55:50', '2021-09-08 09:13:50', NULL),
(575, 'The Impact of Family Communication Process on Millenial\'s Self-Esteem ', NULL, NULL, 'The word family always brings a feeling of mixed emotions. It could be happy,\r\nsad and could be nostalgic at times. It brings happy memories, sounds of laughter,\r\nfamily gatherings, and sometimes, even petty quarrels. These images of family are\r\nbased on,formed,and maintained through communication and their environment. As\r\nsupported by(Flitzpatrick,1998),families are constituted through social\r\ncommunication.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'FUafvSXw12Lt', 0, 0, '2021-08-13 00:55:50', '2021-09-08 09:14:07', NULL),
