(579, 'Assessment of Learning Styles of Diploma Students at Polytechnic University of the Philippines Tagui', NULL, NULL, 'Education is not limited to anyone. It prepares individuals to become successful, interactive and enable them to talk in different languages. In many years, educators have notice that some students must prefer certain methods of learning than others. These traits referred as learning styles. It molds student\'s unique learning preference and aid teachers for individualizing the instruction.Educators admired them hence of emergent and incessant study of their learning strengths and needs. In the other hand, before we understand their strengths and needs we should assess their learning styles. \r\nLearning Style was defined by Grasha (1990) that it may be function as cognitive, effective, and psychological behavior that relatively function to the environment. Additionally, it serves as preference that student thinking relating to the different various lecture of classroom environment and stories. This became fostered to the concept of each student in possessing their traits alternatively that this personal development which decides the tactics they adopt in studying.\r\nAssessment is utilized in regular lifestyles to consult various things, depending at the context, and the philosophy underlying the system in which it is used. It is a manner that takes vicinity in each formal and informal ways each day. At the same time as within the school room, college informally gauge whether college students apprehend material by means of gazing frame language, paying close interest to scholar questions, and asking college students to answer questions that suggest whether they have a fundamental draw close of the material in query. Studying takes location in studentsâ€™ heads in which it is invisible to others. This means that learning should be check via performance: what college students can do with their studying. Assessing studentsâ€™ overall performance can involve tests that are formal or informal, excessive- or low-stakes, anonymous or public, man or woman or collective._x000D_\r\nThis motion is in massive element fueled by using outside pressures to show that students are graduating with both the considered necessary expertise of their selected fields of take a look at as well as the writing, speaking, and crucial questioning abilities essential to be successful individuals to the companies and agencies that employed them. Universities that effectively prove their well worth in producing nicely-prepared graduates have a better risk of convincing taxpayers, legislators, and governors. _x000D_\r\nSome students prefer to learn by means of themselves of their personal tempo and to their familiar surrounding as opposed to corporations. Students generally tend to understand statistics differently, inclusive of by way of viewing and listening, mirrored image and motion, to reasoning logically and intuitively and also scrutinizing and visualizing. The motive of this advent is to make clear a number of the important thing terminology that we use, to speak about a few earlier reviews which outline the baseline from which our study set out, to speak about some elements of the methods utilize in work, and subsequently to introduce the shape and rationale for the subsequent sections. This is important to apprehend the nature of learner and at once keep in mind that there are interactive people.\r\nThe researchers decided to choose Dunn and Dunnview of learning style than other views because it gives emphasis to the matter of measuring and correlating individual differences. This is necessary to understand the nature of learner and directly understand that there are interactive individuals. In this study, the Diploma Students of Polytechnic University of the Philippines Taguig Branch are chosen as the subjects.\r\nThe University aims to produce graduates who are not only knowledgeable but also interactive. Also, there is a need to understand learning styles because they will serve as the basis for appropriate learning strategies in order to achieve expected learning styles. \r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'z7MBxalF0twJ', 0, 0, '2021-08-13 00:55:50', '2021-09-08 09:14:27', NULL),
(580, 'The Impact of Teaching Competencies on the Academic Performance of the Students of Polytechnic Unive', NULL, NULL, '	In todayâ€™s era, there are teachers who tend to just teach, introduce new topics and concepts without even knowing if the students can follow and understand what the the topic is all about.  Aside from this, there are still teachers who explain & elaborate  the topic and they make sure that the students can really follow what they taught.  In this type of teaching style, sooner or later, if the students finally enter the competitive world, the students will apply all those skills they have acquired from their teachers and from  university.  In this matter, the teacherâ€™s competencies will be measured up, because it greatly affects the students to become properly molded and wrought in order to survive & compete in the real world.\r\n	The teacherâ€™s competency has something to do in enhancing their abilities on how to create an environment that is fair, understanding, and acceptance of diverse course of students because of their differences.  Teaching competencies are the ability of a teacher or a professor that contributes to the studentâ€™s departure process.  This skill includes knowledge, skills, attitudes, experiences, which is to be the target category of the profession of educator.  Teachers have been formed to be the single most important factor influencing student achievement (Cochran-Smith, 2002; Kaplan-Owings, 2002; and Lasley, Siedentop, and Yinger, 2006).\r\n	In line with the 21st Century Skills, these are the set of abilities that students need to develop in order to succeed in the information age.\r\n	According to Kamehameha Schools Research and Evaluation Division (2010), they defined 21st Century Skills as the ability to: a) collect and/or retrieve information, b) organize and manage information, c) evaluate the quality, relevance, and usefulness of information, and d) generate accurate information through the use of existing resources.	\r\n	According to North Central Regional Educational Laboratory (NCREL) (2003), identifies broader 21st Century Skills as achieving 21st Century learning through digital age literacy, inventive thinking, effective communication, and high productivity.\r\n	The teachers or professors must be equipped with proper skills and trainings in order to execute the right steps in teaching students.  Additionally, they should have the best possible enthusiasm with regards to educating.  If this alleged excitement is absent, the students will have a hard time in coping up and there is a big possibility that they will not have the motivation to endeavor harder inside the school..  \r\n	Teachers must also know that, in every school, there are different students that they will encounter.  Some of these students are inattentive, in a way that, they donâ€™t even focus to give more time in studying, these people are also called easy-go-lucky person.  Some of these, are the grade conscious student, these people tend to give more time or attention in studying because they donâ€™t want the word failure intervene. So, the teachers or the professors must be ready when dealing with these type of students because they are too shallow, even when they are told to do a thing in a right way, they will get hurt, because they think that they made a mistake, but if the professor has the proper skills in dealing with this type of students, they will tend to be more positive and be focused on every task theyâ€™re assigned to do._x000D_\r\n	For the student who tends to be easy go lucky, the professors or teachers must have the eagerness to divert the minds of this type of people to give more attention in studying, that being an easy go lucky person will not lead them to success but will lead them to failures.  The eagerness of the professor on how to show to these type of person that the lesson has something to do with their lives, it can help them to relate on the lesson.   And when the professor will introduce the lessons, in a creative way, they can easily follow what the topic is all about.  It is very necessary for the professor or teachers to have a burning fire of desire to teach their students and show to them that theyâ€™re only doing those things, because they want them to become successful in life someday, and also to make right and precise decisions when theyâ€™re finally out in the competitive world.  Also, the students must also show to their professors or teachers their burning fire of desire to learn and to participate in indoor and outdoor activities that is necessary for them to improve their critical thinking and problem solving skills, creative and innovative skills, communication and collaboration skills, and lastly their life and career skills for them to be properly equipped when they get out from the university, because there are no more teachers or professors that will guide them on their way to success, itâ€™s only them who will discover new dimensions of learning by applying and executing the acquired skills from the university, and the', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'Y0sndN6AMciZ', 0, 0, '2021-08-13 00:55:51', '2021-09-08 07:31:50', NULL),
(581, 'Factors Affecting the Job Preferences of Bachelor of Science in Office Administration Graduating Stu', NULL, NULL, 'â€œNo man can succeed in a line of endeavor which he does not like. â€“Napoleon\r\nHillâ€. Everyone has the ultimate dreams of finding the perfect vocation that gives\r\nsecurity, the chance to grow as a professional and as a human being with a reasonable\r\nassurance of self-fulfillment. Choosing a perfect job once youâ€™ve graduated is one of the\r\nproblems being faced by graduating students today. The biggest decision of a\r\ngraduating student would make is choosing which path of work industry they will go. It\r\nmay be hard for the graduating students because choosing a job will determine their\r\nfuture career. The choices they have is working in the field that is related to what they\r\nstudied for years or to where they are interested or choosing jobs that is available. Of\r\ncourse, itâ€™s not really easy to get a job that you want since thereâ€™s a lot of a qualification\r\nto pass. And with that reason, most of the graduates bust their buns getting an\r\neducation, but end up with positions that donâ€™t require a degree or challenge them.\r\nBachelor of Science in Office Administration (BSOA) is a course designed to\r\nprovide student with knowledge and skills in different workplaces such as general\r\nbusiness and legal offices. Students with this course were trained to develop their skills\r\nin keyboarding, filling, shorthand or stenography, secretarial duties, and management.\r\nBSOA is course that has many opportunities that is why students who graduated with\r\nthese courses often found in different fields. Their job can be secretary, court\r\nstenographer, or anything in the corporate field. Preference is very important because it\r\ndetermines how students would react toward that something which he/she perceives to\r\nbe important or less important.\r\n\r\nStudents graduated in the BSOA course that specialized legal procedure has an\r\nadequate knowledge of procedures followed in court and legal offices. Most of\r\nthem graduated, but some are not credible in the field because they didnâ€™t pass the\r\nexamination like Civil Service Examination, tests that specialized and designed to\r\naddress qualifications of a candidate that needs to perform his duties in a particular field\r\nthat is required to be qualified (Tucker, Job that Require the Civil Service Exam).\r\nAlthough it took years for them to study this course, they still find it hard to pass the\r\ndifferent examinations to be qualified in this forte. Another reason is the confusion arise\r\nto the mind of all graduating students in terms of what field they are belong and capable\r\nto. One part tends to choose the job that is appropriate and relevant to the course he\r\ngraduated even it requires skills and effort and other part choose what he think is easier\r\nthat does not required a greater knowledge and skills to implied. Practicality is one of\r\nthe reasons also. Some of the fresh graduated students tend to engage in fields that\r\noffer a quick and high pay job. They wanted to get a job as soon as possible once they\r\ngraduated and can\'t wait for other opportunities that are really for them. As we all know,\r\nBPO companies, offer a flexible and high pay jobs rather than government and private\r\ncorporations that takes time before get hired and need a lot of requirements to comply.\r\nAnd because of this, itâ€™s not really necessary that the job youâ€™ll get is the forte of what\r\ncourse youâ€™ve taken during college.\r\nTruth to be told, a person decided what course he/she will take because he/she\r\nwanted the job that is related and offered by the course. But because of the different\r\nfactor arising through their way, their preferences in job changes. However, is it really\r\nnecessary to take the job that is related to the course that you\'ve studied for years?\r\nDoes having many choices of work field help the student to find the perfect job they\r\nreally wanted?\r\nThe researchers aimed to find out the factors affecting the job preferences of\r\nBSOA students in Polytechnic University of the Philippines (PUP) Sta. Mesa.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'YV7kSDsbg1nc', 0, 0, '2021-08-13 00:55:51', '2021-09-08 09:16:46', NULL),
(582, 'Student\'s Motivation and Its Relationship to Academic Performance of Diploma Students in Office Mana', NULL, NULL, 'Motivation plays a significant role in every human life. It is a psychological process\r\nwhich leads anyone to act in a way that helps him/her to fulfil unsatisfied needs.\r\nA person needs specific reason for specific action, which reason is his/her\r\nmotivation to do that action. It is also the same with studentsâ€™ academic performance;_x000D_\r\nstudentsâ€™ need a reason or motivation to perform well academically. Student motivation_x000D_\r\nis the element that leads studentsâ€™ attitude towards learning process. This research study\r\nis focused on identifying the level of motivation among Diploma in Office Management\r\nTechnology (DOMT) in PUPT Branch in terms of intrinsic and extrinsic motivation as well\r\nas knowing if there is a significant relationship on the assessment of the respondents\r\nbetween studentsâ€™ motivation and academic performance. ', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'fByg4hzCj6mZ', 0, 0, '2021-08-13 00:55:51', '2021-09-08 09:18:20', NULL),
(583, 'Extent of Adequacy of Instructional and Non-Instructional Materials: Its Relationship on the Student', NULL, NULL, 'Education, according to Coombs (1970), consists of two components, inputs and outputs. Inputs consist of human and material resources and outputs are the goals and outcomes of the educational process. Both the input and output form a dynamic organic whole and if one wants to investigate and assess the educational system in order to improve its performance, effects of one component on the other must be examined.\r\nEducation is the basic foundation to achieve growth in society and this is the best weapon to survive in our daily lives. Changes our lifestyle can have a great impact to what we can be in the future.\r\n', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'XZl61bLOzNBu', 0, 0, '2021-08-13 00:55:51', '2021-09-08 09:17:59', NULL),
(584, 'Factors Affecting the Acquisition of Stenographic Skills of Skills of Diploma in Office Management T', NULL, NULL, 'Writing is an unbelievably useful tool to record and communicate ideas.  Since writing was first invented, people have attempted to develop writing system of taking down the words of other as rapidly as they were spoken.  According to Bledsoe (2011) the average speed of copying is 68 letters per minute (approximately 13wpm), with the range from a minimum of 26 to a maximum of 113 letters per minute (approximately 5 to 20 wpm).  People, however, speak at about 150 - 180 wpm, so the scribes who needed to record important speeches were faced with a physical problem of keeping up with what was said.   As a result they developed alternative, quicker forms of writing, parallel to the usual full-blown form of writing (which is sometimes called longhand).  Another example is Stenography, there are different authors who came up with the different 7 principles and a rule when it comes to stenography, but still stenography is one of the products of intensive research and experimentation.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, '8QlXCJi2ryzD', 0, 0, '2021-08-13 00:55:51', '2021-08-13 16:30:10', NULL);
