(585, 'The Effects of Broken Family to the Behavior of Selected University in Taguig City ', NULL, NULL, 'The family is the primary components of our society, and our parents are the source of behavior, which affect to our outlook in life. The home is where family lives, but when we say ?house? it is referring to a material structure, while ?home? refers to things that family member bind together. Family is none of the essential factor for the humanâ€™s whole-being, behavior are relying on the structure of the family. Unity is the so desire of every family in the society today; but the issue of broken home is on the high side in most of our societies today. There are so many factors responsible for the rate of broken homes in our society today; the major concern of this research work is to examine how this affects the behavior of children. The ongoing pressure on the children can equally affect them negatively; because these children are lacking proper parental guides from both parents. Morally and emotionally the children are affected.  Another point to note here is the death of one of the parents; especially if the surviving parent is the mother; mothers are mostly know for giving care to the children; at times financial assistance as well but this is not always coming through;  because mothers can actually assist to some extent financially. \r\n \r\nThe children began to learn how to survive on their own; some end up meeting the wrong people; at the end of the day they might become cultist, thieves etc. all these are social vices in the community. At a point in time you can easily identify such children by the way they behave, interact and relate with others in the society. Parents have a major role to play on the behavioral pattern of children in the society, because the first education starts from home. The effort of parents in the upbringing of their children is the reflection of what people see in their children outside their various homes. Child development/ behavior can be affected by a number of things, but a big factor may be the parents. Depending on the severity of a broken home, the parentâ€™s relationship with each other, as well as their children, can affect how their children behave and may even develop. \r\nThis doesnâ€™t mean that a parentâ€™s divorce can make it so a child can never climb steps or hop on one foot, but it can make it harder for children to develop social skills and may even set back their achievements. Depending on a childâ€™s age, the separation of their parents may cause extreme stress and, in the worst case, even depression. However, keeping the parentâ€™s married might not be in the best interest either, depending on the familyâ€™s situation. In my experience of coming from a broken home, I have never suffered from developmental or behavioral problems. Parents have an impact on their children, married or not. However, on average, broken homes have a significant impact on children and may even continue throughout their life. (Amato, 2005) \r\nLastly, there are three types of behavior that parents should understand when it comes to their children. First, there is a behavior that is approved. This includes behavior such as being kind to other people, being understanding, and listening to others. The second type of behavior is one that is not necessarily wanted at all times but is tolerated. This behavior can be caused by the child being stressed or sick and is understood in context, and, depending on the family, different types of behavior are tolerated. The last type of behavior is one that should not be tolerated. This type can be troublesome for a childâ€™s intellectual development and may even cause harm to the ?physical, emotional, or social well-being of the child? (Normal Child Behavior, 2015). This type of behavior can also be caused by the parent, depending on how they act emotionally. Children may start to copy their parentâ€™s behavior because of how closely they follow them for the normal emotional reactions of society. This may get troublesome, depending if the parent is aggressive and acting upon anger. In this case, when a child starts to mimic their parent, they develop the third type of behavior. The children that have an experienced in having a broken family are more likely to have in early sexual activities, aggressiveness, anxiety, developmental disorder, absences from school, bad habits, attention-seeking behavior, social difficulties, and had great difficulties in school. Broken family can negatively affect the childâ€™s development', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'surTmFRDitHb', 0, 0, '2021-08-13 00:55:51', '2021-09-08 09:17:46', NULL),
(586, 'The Impact of Social Media on the Academic Performance of the Diploma Students in PUP - Taguig Branc', NULL, NULL, 'Section 512(c) of the Digital Millennium Copyright Act and Section 230 of the Communications Decency Act are the two most important things to consider when examining the legal liabilities and obligations of the social networking sites. Section 512 removes liability for copyright infringement from websites that allow users to post content, as long as the site has a mechanism in place whereby the copyright owner can request removal of the infringing content. The site must also not receive a financial benefit directly ascribable to the infringing activity.  According to Mr. Ahmed andQazi â€œWe donâ€™t have a choice on whether we do social media; the question is how well we do it.â€  Usage of Social Media is important among all ages. It creates an impact not only on the marketing aspect but also amongst the lives of the people: connecting and building relationships, a platform to showcase their situation, source of daily news or a way to build-up their self-esteem.Correspondingly, Section 230 Communications Decency Act protects websites from definite liability evolving from the publication of information given by another. This usually emerges in the context of defamation, privacy, negligence and other tort claims. It does not nevertheless, cover criminal liabilitym copyright infringement or other intellectual property claims. \r\nSocial Media usersdont enjoy any of the privileges granted to social networking sites under the law, so they must be careful to always act appropriately when posting messages of files to the sites. The main sector where users can get themselves into trouble are through the posting of libelous content of content that violates the intellectual property rights.\r\n	As observed on the youth nowadays most of their time is invested on social media and where they invest our time creates an impact and influence in our daily lives. The study focuses on the relationship of the studentsâ€™ usage of Social Media to their academic performance. \r\nEverybody can use social media as young as 3 years old. Fortunately, social media is convenient to everybody.  People can easily browse on the internet anytime and anywhere, what they wanted to know about. \r\nThe researcher study aims to examine how the studentâ€™s usage of social media impacts effect on their academic performance. The term is defined as the amount of something that is used. The researcher study will not only measure but also determine how usage of social media can affect the studentsâ€™ academic performance and identify what factors which factors contribute to such negative or positive effects. \r\n           The use of social media has been characterized over a large area or number of people. It is mainly used by millions of people especially by youths today. According to the researcher many people find out that the Internet could be used to connect with other people in an easiest way of communication, whether for business or commercial purpose, make new friends, or find their old friends and long-lost relatives. In relation to this study, there is no doubt that the usage of social media has given us a lot of factors in terms of how we communicate to one and another even without face-to-face interaction whether you are in near or far places.\r\nThe researchers synthesize that in today\'s generation, they overused the social media that would lead them to addiction. Some students missed doing their homeworkâ€™s and other school works because after school, they first logged in and browse their Facebook, twitter, and other social networking sites rather than working up their school work nor reviewing their notes right after they got home from school. This networking sites affects their study time that distracts their academic performance. These sites noticed have a lot of positive effects, but they also have their share of negative impact. On the point of academic performance or excellence, Tuckman (1975) posited that, performance is used to label the observable manifestation of knowledge, skills, concepts, and understanding and ideas. \r\nIn educational institutions, success is measured by how you perform in school, or how well a studentâ€™s meets the minimum requirement that has given by organization or institutions itself.  As the process of trying to succeed after you have finished your degree course grows showing a lot of strong emotion in the working world, the quality work of students doing well in school has caught the interest of parents, teacher or professor in the same way.  \r\nArmstrong(2012), Students began to rely on accessibility of information that is available on the social mediaâ€.  This means that the students nowadays focus only on the information in the internet but not everything on the internet is true or reliable.  They can just easily copy and paste the information they searched and there they have it.The more the students copy and paste the information they tend not to', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 12, NULL, 6, 'KUQ289nNuYJe', 0, 0, '2021-08-13 00:55:51', '2021-09-08 09:17:32', NULL),
