(592, 'Adversity Quotient, Emotional Quotient, Professional Attitude: An Intercorrelation Study', NULL, NULL, '    An intercorrelation study aims to determine the common relationship or joint connection between things or variables. This intercorrelation study focus on the Adversity Quotient, Emotional Quotient and Professional Attitudes of the teachers of Polytechnic University of the Philippines- Taguig Branch. This study used descriptive-correlation using the entirety of the faculty population as respondents, who were selected through stratified random sampling technique. The needed data were collected through the questionnaires of Paul Stoltz\'s Adversity Response Profile, Daniel Goleman\'s LAL Emotional Intelligence and a questionnaire on professional attitude. To analyze the data gathered, frequency, percentage distribution, mean and Pearson r were utilized.\n\n    The study found out that the teachers at PUPTaguig Branch perceived themselves to have a high level of emotional quotient in terms of self-awareness, managing emotions, motivation oneself, emphathy and social skills. The study also revealed that the respondents acquired an average level in all CORE dimensions of adversity quotient. This implies that they usually do a decent job of navigating life as long as everything is going relatively smooth. However, they may suffer unnecessarily from larger setbacks or may be this disheartened by the accumulated burden of life\'s challenges. This study also revealed that most of the teachers show expertise in the application of professional ethics which means that they integrate values to their subject matter that is to knowledge and in the last analysis, to truth itself.\n\n    With these findings, this study recommends that teachers should participate in coaching and mentoring programs that will boost their ability to reflect on their own emotions and on other people\'s emotions. It is also recommended that they should apply the formula formulated by Stoltz in improving AQ called LEAD (Listen, Explore, Analyze and Do Something). Further, the study recommends that the University conducts seminar and workshops that will enhance the creativity of the teachers, collaborate with other universities and colleges in planning and creating conferences that may improve the emotional quotient of their  faculty members as well as the students and conduct a program that will help their teachers in elevating their resilience over adveristies.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 10, NULL, 6, 'QvfnrUAexu37', 0, 0, '2021-08-13 00:58:08', '2021-08-13 16:30:10', NULL),
(593, 'Analysis of the English Language Competencies Among Senior High School Students in Signal Village Na', NULL, NULL, 'This study measured the English Languafe Competencies of Senior High School Student of Signal Village National High School in the school year 2017-2018. The language competencies focused on the reading skills particularly, context clues, main idea, and making inference and writing skills, specifically, paragraph unity and coherence, grammar usage and spelling. \n\nThe descriptive method was used and the date were gathered through self-constructed test questionnaire. The data were analyzed through the use of frequency and percentage distriution, T-test, and ANOVA.\n\nThe study found out that the respondents obtained a high level of competency in the reading and writing skills. Furthermore, both male and Female respondents, regardless of their academic strands and differnces in GPA in Reading and Writng, performed well in both of the competencies. Moreover, the study revealed that there is no significant difference on the respondents\' level of reading competency when grouped according to gender and academic strands, however, it discovered that there is a significant difference on the level of reading competency when grouped according to GPA in reading and writing  subject. In addition, there is also a significant difference on the respondents\' level of writing competency when goruped according to strand and GPA. \n\nFrom these finding, the study recommends that teachers should opportunities that will enhance students reading and writing competency such as, but not limited to, peer reading, literary analysis theme reading, journalism, and other activities that incoporates these competencies. Further, the study recommends a program designed to provide enrichment activities for Senior High School Students to improve their competence in using the English Language.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 10, NULL, 6, 'SAFObiaB0MIx', 1, 0, '2021-08-13 00:58:08', '2021-10-14 17:41:59', NULL),
(594, 'Pedagogical Practices in Teaching of English Language in Selected Secondary High School in Taguig Ci', NULL, NULL, 'This study measured the pedagogical practices in teaching the English language of selected high school teachers in Taguig City. It was inspired by Weston-Cranton\'s Learning Taxonomy wherein it incorporates the level of learning to appropriate teaching methodologies. The researchers utilized descriptive method to describe the data and the characteristics of the study, which were selected through cluster sampling technique and data were gathered through questionnaires.\r\n\r\nFinding showed that most of the respondents positively manifest the pedagogical practices (organizatiom, control and discipline, dealing with students, evaluation, lesson presentation, and grammar and speaking) in the classroom setting. \r\nFrom the findings, the study recommends that teachers should undergo seminars and trainings in using non-traditional instructional methods. Likewise, schools should support such trainings and encourage their teachers to incorporate technology and other advancements in the teaching of the English language. It is also recommended that school heads should conduct random observations to check whether teachers are prepared in terms of in-dept knowledge about the subject matter. Furthermore, this study recommends an enrichment program to enhance the pedagogical pratices in teaching the English language. ', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 10, NULL, 6, 'l0xSzs2GunLf', 0, 0, '2021-08-13 00:58:08', '2021-09-08 08:59:48', NULL),
(595, 'Teachers\' Work Engagement and its Relationship to their Teaching Performance', NULL, NULL, '       This study determined the relationship of teachersâ€™ work engagement and teaching performance. This study pointed out the essentiality of educatorsâ€™ level of work engagement and teaching performance to attain higher production of learning over the students.\n\n      The respondents of this study is the High School Teachers of Selected Private Secondary School in Taguig City during the School Year 2017-2018. The descriptive method was used and the data were gathered through survey questionnaire which was divided into two parts. The first part measured the respondentsâ€™ level of work engagement (e.g. vigor, dedication and absorption) and the second part measured the respondentsâ€™ level of teaching performance (e.g. teaching methodology, knowledge of the subject matter, use of instructional materials, classroom management, and work values). The data were analyzed and interpreted through the use of frequency distribution, rank, mean, and pearson correlation.\n\n       The study found out that there is a significant relationship between dedication and teaching methodology, dedication and knowledge of the subject matter, dedication and use of instructional materials, dedication and classroom management, dedication and work values, and absorption and use of instructional materials that shows a moderate positive correlation. Moreover, vigor and teaching methodology, vigor and classroom management, vigor and work values, and absorption and knowledge of the subject matter has a significant relationship with a weak positive correlation.\n\n       From these findings, the study recommends that the school administrators should provide and conduct interventions (In-campus and off-campus) that can establish positive human relation among teachers and other stakeholders. Further, the study recommends to formulate a continuous assessment and evaluation that can identify the weakness and strengths of a teacher. The results should be taken into consideration by the school administrators when it comes to planning activities (e.g. seminars and workshops) that they are going to provide for the teachers.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 10, NULL, 6, 'UCgG8Z0n9uzs', 0, 0, '2021-08-13 00:58:08', '2021-08-13 16:30:10', NULL),
(598, 'The Influence of Office Environment to the Productivity of the Non-teaching Staff of Polytechnic Uni', NULL, NULL, 'Employees are important for the success of the organization. We have to\r\nunderstand that a content and motivated employee has a higher probability of making\r\nsignificant contributions to the organization. According to J.W. Marriott, if you take care\r\nof your employees, they will take care of your customers and the business will take care\r\nof itself. This explains how important the employee is in every organization.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 's7JnX5V1ocPw', 0, 0, '2021-08-13 01:00:09', '2021-09-08 09:27:43', NULL),
(599, 'Intrinsic and Extrinsic Motivational Factors for Learning English Language among Senior High School ', NULL, NULL, 'Not Applicable', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'mfIv60KEclir', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(600, 'Performance of BSOA Students on Their On-the-Job Training in Law Firm', NULL, NULL, 'The study determined and assessed the Level of Competencies of Office Administration Major in Legal Transcription students in their different core subjects.  The respondents of the study were the third year and fourth year BSOALT students.  The researchers used the descriptive method which examine a phenomenon, group of people, idea or theory with a particular focus and conditions of the subjects.', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'IbrdMxvQEY5t', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(601, 'work culture and its effect on employees\' commitment', NULL, NULL, 'This study determined the effects of work culture to employeesâ€™ commitment and the\r\ndifferent factors affecting it.\r\nThe study used descriptive method as it is the most appropriate to evaluate the impact\r\nof work culture on employeesâ€™ commitment. It used three sets of questionnaire to gather the_\r\nneeded data. To analyze the data, the study used weighted mean and Pearson Product\r\ncoefficient correlation.\r\nFindings revealed that the work culture was positively accepted by the majority of\r\nemployees. In terms of their commitment, they were softly attached to the organization. The\r\nstudy also revealed that work culture is a factor of employeesâ€™ commitment which means that\r\nthe level of employeesâ€™ commitment is dependent on their acceptability of the organizationâ€™s\r\nwork culture. The higher the level of their acceptance of their work culture, the higher the\r\nlevel of their commitment', NULL, '2017-2018', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'YS64UTy8Gl0n', 0, 0, '2021-08-13 01:00:09', '2021-09-08 09:28:23', NULL),
(602, 'THE RELATIONSHIP OF WORK-LIFE BALANCE AND JOB SATISFACTION OF LEGAL PRACTITIONEERS IN SELECTED MTC A', NULL, NULL, 'ABSTRACT\n\nTitle:	Relationship of Work-life Balance and Job Satisfaction of Legal Practitioners in Selected MTC and RTC Branches in ParaÃ±aque and Taguig City\n\nResearchers:  Pamela Bianca B. Barrion, Rey Ivan B. Dolz, \n                       Anna Marie C. Garcia, and Carla Nicolai M. Viral\n\nDegree:          Bachelor of Science in Office Administration Major in Legal Transciption   \nInstitution:      Polytechnic University of the Philippines-Taguig Branch\nYear:              S.Y. 2018-2019\nAdviser:         Ms. Merly F. Tataro\n\nThe main purpose of this study is to identify if there is a significant relationship between Work-life balance and Job Satisfaction of legal practitioners in selected MTC and RTC branches in ParaÃ±aque and Taguig City.    The researchers chose to study work-life balance because it was already been a concern of employees in the society.  In terms of job satisfaction, the researchers chose this factor because it is every workersâ€™ sense of achievement and success on the job. \nThe goal of this study was reached by using descriptive design involving 33 males and 81 females.  The findings of this study showed that majority of the respondents are females with a percentage of 71.1 % and 50% of them are ranging in the age of 20-30 years old with a single civil status and are rendering their service from 2-5 years.  Under work-life balance, the respondents strongly agreed that there is a clear boundary between their work and family which got the highest weighted mean of 3.31. Overall, the respondents perceive their work-life balance to be agreeable in a good situation with a  grand mean of 2.7768.  On the other side, job satisfaction of legal practitioners under Maintenance factors got a grand mean of 3.1114 with a â€˜Satisfiedâ€™ level of interpretation.  Another one, legal practitioners are still satisfied under the Motivational factors with a grand mean of 3.1939.  Through the use of Pearson-R, it is being determined that work-life balance and job satisfaction has a significant relationship with each other but they are having a weak or low correlation with an R-value of 0.256. Thus, the researchers rejected the hypothesis.  \nTogether with these findings, the study concluded that most of the respondents are newbies in the court system and that a legal practitioner with a single civil status is having more time in focusing with their work and personal responsibilities.  The study also concluded that the legal practitioners of MTC and RTC in Paranaque and Taguig City perceived that there is a clear boundary between work and family/personal responsibilities. Moreover, the study concluded that  the institution of RTC and MTC branches in Paranaque and Taguig City provide a Satisfactory level in terms of every employeesâ€™ job satisfaction. It is also mentioned before that legal practitionersâ€™ perception to their work-life balance has a significant relationship with the level of their job satisfaction.  It means that a legal practitioner practicing a good work-life balance can increase the level of their job satisfaction.  \nThrough these conclusions, the study recommended that MTC and RTC  branches should provide a work-life balance policies for their employees like No Work, No Call Policy, Job Sharing, flexible working schedules, conduct leisure activities, and provide an evaluation system quarterly for each legal practitioners.  On the part of the legal practitioners, the study also recommended them to build a healthy lifestyle by means of making choices to cultivate healthy habits and limit time wasting activities.  ', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'XKjR1I8xQFU3', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(603, 'DEVELOPING AND UNDERSTANDING PUP-TAGUIG 4TH YEAR STUDENTSâ€™ EXPERIENCES IN USING INTERACTIVE INSTRU', NULL, NULL, 'Academic Institutions like PUP has made a legacy for teaching for more than a hundred of year producing quality graduates with high capabilities of excellence to work effectively and efficiently. This study aimed to provide assessment on developing and understanding PUP-Taguig 4th year students about modern and traditional teaching techniques from Taguig Branch for the inclusive year of 2018-2019.\n	The frequency distribution was used in the study. Research questions were answered by interpreting the survey results gathered from the respondents thru survey forms. Simple random sampling was used in this research, respondents were randomly divided into portions by their course, and respondents were also grouped accordingly with their profile. Mean was used to determine the group norms or respondents and various factors considered in the study. \n	Based on the respondentsâ€™ classification, the results revealed that most of them preferred the usage of Desktop with Windows OS, Smartphone with Android OS, Google Drive as Cloud Storage, and Social Media for personal and academic matters. More hours were spent using Smartphone as medium for communication but especially for academic purposes. Also provided satisfying result of comfort on using technology to provide accessibility for it has played a major role especially on the academic field.\n	This study recommended that the University should provide additional units of Desktops and also Laptops in Computer Laboratories, maximize the usage of Smartphones for academic purposes, encourage students to use applications for their studies, and upgrade the teaching methods of professors to make it more interactive using technology.?\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, '0bxvjomPIAkJ', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(604, 'Corporate Social Responsibility and its Impact to Employees Work Engagement', NULL, NULL, 'This study aimed to determine the impact of corporate social responsibility to employees\' work engagement. Appreciation and recognition of the company to their employees assure work commitment and engagement in their social responsibility. The researchers used the descriptive method to gather data in order to answer specific questions in the study. The respondents of this study are employees of the JP Morgan Chase and Co. Philippines which have 3000 employees but the company only allowed the researchers to administer the questionnaire to those employees assigned in the Human Resource Department. Fifty (50) respondents were subjected to this study. The statistical tools used in this study were frequency and percentage for the profile of the respondents; weighted mean for the level of perception of the respondents to their organizationâ€™s CSR practices and their level of work engagement; and pearson correlation coefficient to know if thereâ€™s a significant relationship between the respondents\' perception of their organization\'s corporate social responsibility practices and their level of work engagement.\n\nAs the finding showed that the level of employees\' work engagement and their perception of their organizationâ€™s corporate social responsibility were statistically not significant, it can be deduced that even though the CSR activities of the organization are active, the employees are still not fully engaged in their work. \nFrom these findings, the study recommends that the organization utilize comprehensive promotion strategies such as giving newsletters, invitations, and providing calendar of activities for the year to encourage employeesâ€™ participation and engagement to CSR activities. \n\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, '8aZkwy5R2Auz', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(605, 'Organizational Communication and Its Effect to Employee Engagement', NULL, NULL, 'This study determined the relationship between organizational communication and employee engagement.\nThe study used descriptive research method to describe the relationship of the two variables in terms of quality of information, communicating with the management, reliability of information, satisfaction with communication channels for the organizational communication variable, while psychological meaningfulness, safety, and availability for the engagement. Three (3) sets of questionnaire were used to collect the data. The statistical tools used were frequency, weighted mean, and Pearson R to identify how strong is the relationship between the variables.\nThe overall findings revealed that organizational communication is significantly related to employee engagement which implies that the more effective the communicating process is within the organization, the higher the level of employeesâ€™ level of engagement.\nThe researchers suggest that the company should hire and develop leaders or managers that also have an emotional commitment to the organizationâ€™s mission, vision, and objectives to build and engage teams that would be influenced to help the organization grow.', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, '9OE0VBUTHLnx', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(606, 'Organizational Commitment, Job Satisfaction, and Motivation of Contractual Court Stenographers: An I', NULL, NULL, 'The study aimed to understand the level of the Organizational Commitment, Job Satisfaction, and Motivation of the Contractual Court Stenographers in selected RTC and MeTC trial courts in Metro Manila. The study also finds out if the said variables are inter-correlated with one another. \n\nThe study used the descriptive method in describing the variables. We have a total of 94 respondents after using the Slovin formula.  All the respondents came from different trial courts in Metro Manila. The researchers collected data through the use of survey-questionnaires that we get from other studies related to our topic. Based on the gathered data most respondents were female which constitute 59.6%, the remaining percent of 40.4% were all males. Majority of the respondents were single constituting 76.6%. Most of their ages vary between 22-24 years of age which constitute 48.9%.\nThe study found out that in Organizational Commitment (Affective Commitment),  the respondents perceived with the highest mean of 3.38% that their organization has a great deal of personal meaning to them and they disagree with a mean of 2.10 that they do not feel a sense of belongingness to their organization. On the other hand, in their level of Continuance Commitment, the respondents perceived that the cost of living the organization would require a high personal sacrifice that other organizations might not match the benefits that they receive in their current one with a highest mean of 3.31 which is contrary to the result of their Affective Commitment. Lastly, on their Normative Commitment, data showed that the respondents perceive that it is much better to stick in one organization for the rest of their career with a weighted mean of 3.41.\nOn Job Satisfaction, respondents perceive that their level of job satisfaction is high when it comes to the nature of their work as well as the prestige of their jobs inside and outside the organization with a weighted mean of 3.70.\nIn Motivation, data showed that the respondents strongly agreed with a mean of 3.65 that their current job gives them a feeling of self-worth.\nOver-all data showed that all the variables are inter-correlated with one another. Each variable having an effect to another depending on the perception of the respondents except the Continuance Commitment under the Organizational Commitment to Job Satisfaction, which gave us an idea that being satisfied with the working environment and the benefits are not enough to make an employee stay inside the organization.\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'gnqbN5MCyEsc', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(607, 'Assessment of the Employability of the Graduates of BOALT and BSOALT of PUP-Taguig S.Y. 2013 - 2017', NULL, NULL, 'All academic institution that includes PUP-Taguig always aims to produce quality graduates for employment.  Thus, the university must assess the employability of their graduates for them to be able to know the necessary changes they should do to produce quality graduates. This study aimed to provide the employment of the BSOA graduates for the past five years.\r\n\r\n	The method used in this study was descriptive.  Research questions are answered by interpreting the answers from the survey gathered from the respondents thru online and meet-ups.  Purposive sampling technique was the method that was used to select samples from the different strata of the population for this research.  The respondents were divided according to the year they graduated.  Frequency and percentage was used to identify the characteristic of a given tabulated data.  Weighted mean was used to determine the group norms of respondents and various factors considered in the study. T-test was used to know the significance of the difference between Two Means for independent samples.  Lastly, One-way ANOVA was used to describe the analysis of variance as a statistical tool employed to test for the significance of the difference between more than two sample means.\r\n\r\n	Based on the respondents, findings revealed that majority of the respondents are: female, age ranges from 21 to 25, single, graduated on academic year 2013-2014, court stenographer was their job preference, legal secretary was their first job, and their current job is court stenographer.  When it comes to employability profile of the graduates, findings revealed that most of the respondents are: permanently employed in private companies, take them one to three months to get their first job as walk-in applicant, noted that the competencies they learned most in college are their communication skills, and stated that their school training is the number one factor on how they get their present job.  In the terms of the respondentsâ€™ perception regarding school related factors, it was agreed by the respondents that: the curriculum is highly relevant, the facilities, tools, and equipment are moderately adequate, they strongly agreed that the teachers are competent, and stated that on-the-job training is relevant.  \r\n	Lastly, the findings revealed that when they are grouped by Job Preference, there is a significant difference in the perception of respondents in Adequacy of the Facilities, Tools, and Equipment, while there is no significant difference on their perception in Relevance of the Curriculum, Competence of the Teacher, and On-the-job Training.  When they are grouped by First Job, the results show that there is no significant difference in their perception on the school related factors considered in this study.  When they are grouped by Current Job, the findings revealed that there is a significant difference in the perception of the respondents on the school related factors considered in this study.  When they grouped by their Present Employment Status and Kind of Employment Status, the findings revealed that there is a significant difference in the perception of the respondents on the school related factors considered in this study except in On-the-job Training factor.  Lastly, when they are grouped by the Type of Employment, the results show that there is no significant difference on the perception of the respondents in terms of the school related factors considered. \r\n\r\n	On this basis, it is recommended that the university should provide the students, specially the BSOA students, appropriate tools and equipment that are needed to boost their stenographic and typing skills that are necessary to their course.  Professors should identify the specific learning needs for the students and develop a growth plan for it.  The university should identify the current offerings and opportunities for the students.  The researchers recommend the university to set identity and standards on the specific jobs together with the required skills of the BSOA graduates in the industry.  Lastly, the university must regularly conduct studies on the employment of the BSOA graduates. \r\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 's0ktUfP7YBe3', 0, 0, '2021-08-13 01:00:09', '2021-09-08 09:29:32', NULL),
(608, 'The Level of Employee Engagement in RTC Makati', NULL, NULL, 'This study determined the level of engagement among the employees of the Regional Trial Court in Makati City.  It used descriptive research method with 113 respondents randomly selected through simple random sampling technique to answer a survey-questionnaire adapted from the study of Sevilla (2017). \nThe study found out that the employees in RTC Makati have a high level of engagement and that there is no significant difference on respondentsâ€™ level of engagement when grouped according to the length of service and gender in terms of working life, employer, job, administration, communication, and future.  There is also no significant difference on the respondentsâ€™ level of engagement across age. However, when grouped according to age in terms of future in the company, the study marked a significant difference, which implies that age is a factor of the level of engagement.  \nOn this basis, the study recommends the RTC Makati to boost employeesâ€™ emotional commitment to their job and the goals of the organization by conducting a monthly appreciation day for their employees that will commend their efforts in doing their best in performing their job.  ', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 't32RXPlaVwG6', 0, 0, '2021-08-13 01:00:09', '2021-08-13 16:30:10', NULL),
(609, 'Relationship of Interpersonal Skills, Work Motivation, and Job Performance of Legal Practitioners in', NULL, NULL, 'The main reason of this study was to identify the Relationship of Interpersonal Skills, Work Motivation, and Job Performance of Legal Practitioners in Del Rosario and Del Rosario Law Office. The researchers utilized the descriptive research method using the survey questionnaire. These were distributed to 100 legal practitioners of Del Rosario and Del Rosario Law Office.\n	This study determined that there is a significant relationship between interpersonal skills, work motivation, and job performance among the legal practitioners of Del Rosario and Del Rosario Law Office. It implies that regardless of their perceived level of interpersonal skills, work motivation, and job performance, they will perform average or above average.\n	Based on the foregoing findings, the researchers recommended that employers must provide feedback to their employees for their job performance so that they will know how they are going to improve their job performance. It also recommended that employees or individuals may ask the people they trust or their colleagues for constructive criticism about their interpersonal skills. And every employee who did an accomplishment must be recognized may be monthly or yearly. The employee being recognized can feel more motivated and of course, in the future, they can be do more to level up their job performance.\n\n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, '6ObeSYwELHG9', 0, 0, '2021-08-13 01:00:10', '2021-08-13 16:30:10', NULL),
(610, 'Correlates of Bachelor of Science in Office Administration and Diploma in Office Management Technolo', NULL, NULL, 'This study determined the relationship of BSOA and DOMT students\' factors of learning with their performance in Stenography Eligibility Examination based on the passing rate. This study is designed for 111 bonafide BSOA and DOMT students of PUP - Taguig Branch who took Stenography Eligibility Examination within the examination period of 2017-2018. The researchers used a descriptive correlational method of research with printed questionnaires distributed to the respondents for data collection. The statistical tools used in this study were Frequency and Percentage Distribution, Weighted Mean, and Linear Regression.\nThe researchers found out that the General Weighted Average has a significant relationship to respondents\' rating in Stenography Eligibility Examination. With this finding, the researchers concluded that the respondents\' average GWA of 1.76-2.00 has a great relationship to the low performance in Stenography Eligibility Examination. However, there is no significant relationship between the competencies acquired by the respondents in related subjects and their rating in SEE. Home environment and school  \nenvironment of the respondents have no significant relationship to their rating in SEE. Moreover, respondents\' study habits do not affect their rating in SEE.\nOn this basis, the researchers recommend that the University should screen students who are competent enough to apply in SEE. Conducting a mock examination with the supervision of the organization may have a positive and visible effect on the passing rates of the succeeding generation of examinees. It is also suggested to have a fairly-well balanced time allocation for each subject since respondents\' GWA measures their overall performance and the things they may learn to other subjects may be applied in SEE. Also, skilled subjects must be taught on a daily basis. \n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'NWYRFKn8aXrt', 0, 0, '2021-08-13 01:00:10', '2021-08-13 16:30:10', NULL),
(611, 'Values and Ethical Behavior as Determinants of Organizational Commitment', NULL, NULL, 'Years passed, employee-organization relationship has evolved.  Organizations started to recognize that people in it were their main source.  Employees were also moving fast-paced as people change their mind very quickly that organizations need to keep up with their needs and wants for them to get satisfied.   The purpose of this study is to know if thereâ€™s a significant relationship between an employeeâ€™s value and ethical behavior to their organizational commitment.  The descriptive method was used in this study.  The major source of data is the questionnaire.  The data were analyzed and interpreted using Frequency and Percentage Distribution, Mean, and Pearson-r correlation.\n	Results of the study revealed that â€œsecurityâ€ was the most important aspect out of the values presented.  Study also revealed that most of the ethical behaviors are possessed by the respondents.  In conclusion, employeesâ€™ values have a significant relationship with their organizational commitment, while their ethical behavior has no significance.  Findings showed that respondents give high emphasis to â€œself-directionâ€, and they are highly committed towards their organization because they felt they have an obligation to it.  With these, the organizational commitment must be maintained and improved.\n	This can be achieved by conducting team-based activities to strengthen the bond between employees and to boost their competitiveness; Office activities and games that can help them be able to communicate comfortably and to boost their morale at work; Trainings to further improve their works.  The researchers also recommend giving employees more benefits for them to be satisfied with their current work. \n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'IbtPMOqY13VU', 0, 0, '2021-08-13 01:00:10', '2021-08-13 16:30:10', NULL);
