(612, 'Assessment of the BSOA On-the-Job Training Program: Input for Curriculum Enhancement', NULL, NULL, 'This analytical study specifically focuses at the assessment of BSOA On-the-Job Training program: Input for curriculum enhancement. This study chose the BSOA students of both Polytechnic University of the Philippines Sta. Mesa and Taguig Branch, as the main respondents of this study because both universities have the same curriculum for BSOA course. In addition, this study is seeking for advancement, other methods for the curriculum to be enhanced, and to avoid the repetition of the problems they have encountered. The second respondent would be their acting supervisor inside their internship station for them to adapt the unending enhancement of the curriculum. This study came up with this study because it is the same with this studyâ€™ course and because of some problems that they had encountered during their On-the-Job Training.\nThis study hoped that the curriculum will be enhanced with the use of this study. This study was developed by using descriptive design with the total of 125 respondents including 27 students from PUP-T and 98 students at PUP-Sta, Mesa who were currently taking On-the-Job Training. This study believed that there is no significant difference between the assessment of On-the-Job Training when grouped according to the demographic profile of the respondents.\nThis study helped the BSOA students to understand and to be aware about the assessment of the On-the-Job Training program. It also helped them to improve their skills in becoming a professional. This is not just beneficial to the BSOA students, but also beneficial to the administration of the University including the practicum adviser and as well as to the curriculum itself because as the time passed by, there are a lot of factors that impacts the On-the-Job Training curriculum if we are going to stick to the old culture and curriculum of the On-the-Job Training Program. \nThe findings of this study showed that most of the students strongly agree on the perception of their On-the-Job Training in terms of work ethics (3.47) and also how they deal with their supervisor with courtesy (3.65). They also agree in terms of their character and appearance that they were report to work neatly and well-groomed (3.61) and that they always possessed emotional maturity (3.35). In terms of the collaborating company, the students strongly agree that their training was conductive to learning (3.47) and they were required to render overtime at the expense of the academic schedule (2.60). But in terms of the problem that they have encountered, they agree that having a high cost of transportation rate (2.54) was one of the problems that they usually encountered. However, it was not a factor that they are unable to cope-up with the requirements of the practicum (1.95). \nIn line with these findings, this study concluded that the students who are currently taking the On-the-Job Training program were properly taught to be well-groomed and neat inside their training stations. They also conclude that the collaborating company of the university are lacking in providing the desired training station to the student and it resulted the respondent to give them satisfactory rating in terms of the condition of the facility, overtime, allowance, giving free meals, gives recognition, rewards, and etc. One of the main problems that this study had concluded was that the respondents are having a conflict in their schedule in terms of On-the-Job Training vs. academic schedule. And that the practicum coordinator should consider the location of the student and its assigned training station. It is beneficial to the both parties because if the student will come on-time, they would become a big help to the company and as well as to the university, they will be recognized because of the punctuality of their students. \n', NULL, '2018-2019', NULL, NULL, NULL, NULL, NULL, NULL, 3, NULL, NULL, 9, NULL, 6, 'GFQwjD4emE7o', 0, 0, '2021-08-13 01:00:10', '2021-08-13 16:30:10', NULL),
