(619, 'Electronic Inventory and Accountability System', 'ELECTRONIC-INVENTORY-AND-ACCOUNTABILITY-SYSTEM-EIAS.pdf', 'EIAS-E-JOURNAL.pdf', 'Most people who work with inventory and create reports from it manually not only waste a lot of time, but they also double their work by double-checking if the information entered is correct. Nowadays, in our community, computer technology escalates as the people move along in modern civilization. system and methods with certain aspects related to a certain invention called the inventory management process, an intelligent system that enables monitoring and gathering various information. \r\nThe project focused on the development and implementation of the Electronic Inventory and Accountability System (EIAS). It is a web application that manages, monitors, updates, tracks, and generates reports more easily of the electronic items. The project aimed to resolve the problems regarding the manual typing of inventory in the Dost Lab and Aboitiz room also the issues of item loss. The tools used for the web application development were the MySQL database server, PHP, CSS, and Bootstrap.\r\n	The rating of the system is 4.48 (“Strongly Agree”). Therefore, based on the data gathered, the system provided a solution for the problems that were mentioned, thus making the transaction effective and efficient.\r\nMost people who work with inventory and create reports from it manually not only waste a lot of time, but they also double their work by double-checking if the information entered is correct. Nowadays, in our community, computer technology escalates as the people move along in modern civilization. system and methods with certain aspects related to a certain invention called the inventory management process, an intelligent system that enables monitoring and gathering various information. \r\nThe project focused on the development and implementation of the Electronic Inventory and Accountability System (EIAS). It is a web application that manages, monitors, updates, tracks, and generates reports more easily of the electronic items. The project aimed to resolve the problems regarding the manual typing of inventory in the Dost Lab and Aboitiz room also the issues of item loss. The tools used for the web application development were the MySQL database server, PHP, CSS, and Bootstrap.\r\n', 'inventory, electronics, system, manage, track', '2020-2021', '2021-09-05', '2021-09-12', '4', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'Technology', 1, 'sSDPfWUbQhBX', 0, 0, '2021-09-28 09:50:49', '2021-10-14 02:24:57', NULL),
(620, 'Computer Laboratories Scheduling and Attendance Monitoring System', 'COMPLETE CLSAMS.pdf', 'Journal - CLSAMS.pdf', 'The Computer Laboratories Scheduling and Attendance Monitoring System (CLSAMS) will be introduced to the administrative employee in-charge of the Computer Laboratories to manage, schedule, monitor, and update records to reduce the time, and complexity of maintaining. The system, CLSAMS, aims to monitor the schedule and attendance more accurately, provide an effective and helpful system, and to simplify the process, lessen the amount of work in the Computer Laboratories in scheduling of classes or events and monitoring the attendance.\r\n		With the administrator, transaction and records will be fast, secured, and reliable for the students and professors. The survey used was based on the ISO 25010, answering the questions in the Statement of the Problem and rating based on the Likert Scale, and the User Acceptance Testing questionnaires as testing tools, some aspects of the system got a low rating based on the data gathered. Having said that, the system will still need to be improved, most especially in terms of functional suitability and reliability.\r\nThe final rating for the ISO is 4. 67, which lies in “Strongly Agree” in the Likert Scale of the ISO, hence, it is still substantial. As a result, the system remains efficient and effective. The researchers recommend that the management use this project, particularly for computer laboratories, where attendance is required. For future enhancements, the researchers foresee the disadvantages of barcode scanning when it comes to security and reliability. Some other innovative technology is highly suggested to explore more of Biometrics Technology. The researchers recommend future proponents to explore different ways of taking attendance and to add a functionality in which the admin knows the seat number used by the user. Additionally, the researchers recommend making an application that was installed in every computer in the laboratory so that before using it, students and visitors could log-in before hand. ', 'Computer Laboratories, Laboratory scheduling, Attendance, Barcode. ', '2020-2021', '2021-07-29', '2021-09-30', '4', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'Technology', 1, 'H4wSCyh3QOTn', 0, 0, '2021-09-30 06:02:08', '2021-10-14 02:26:15', NULL),
(621, 'Clinical Information and Triage System', 'CITS DOCUMENT.pdf', 'CITS JOURNAL_1.pdf', 'The Clinical Information and Triage System\r\n(CITS) will be introduced to the Medical\r\nDepartment of Polytechnic University of the\r\nPhilippines – Taguig Branch (PUPT) to handle the\r\ncollected data from the Health Declaration Form of\r\nthe system, which will identify the involvements and\r\nactivities of the guest before their entry in the\r\npremises. CITS aims to make a hassle-free process\r\nfor both parties: the guest, and the admin who is the\r\nnurse of PUPT. The web application is made under\r\nthe Agile Software Methodology for the fast pacing\r\nof the capstone timeline. The application is built on\r\nthe CodeIgniter Framework as the front-end and\r\nMySQL as the database management system. Each\r\nmodule has their specific functions designed\r\nrespectively. The students, faculty, employees, and\r\nvisitors were the respondents for the user acceptance\r\ntesting. The administrators had acquired a web\r\nhosting service and domain name.\r\nWith an administrator of the system, it assured\r\nthe fast and reliable transactions that need to be\r\nreached to the users. The system was tested using\r\nISO 25010 and used as the guide for the User\r\nAcceptance Testing survey questionnaire. The\r\nsystem has achieved a 4.85 average on the User\r\nAcceptance Testing and from the results; the\r\nresearchers must improve on usability, security, and\r\nportability aspect of the web application. The Corona virus Disease (COVID-19)\r\ncauses an enormous challenge to the global health\r\nsystem and affects the global economy. In China\r\nwhere the virus started, it has actively taken action\r\nto promulgate health information technologies for\r\nmonitoring, detection, preventive and control, and\r\nother tasks. As the COVID-19 has expanded worldwide,\r\nthe task of the prevention and control team has\r\nbecome more challenging. The health information\r\ncommunity in affected countries has actively taken\r\naction to monitor, detect early warning, prevent and\r\ncontrol the spread of the virus. If the community\r\nfails to isolate patients, rapid increase of Covid-19\r\nin the community is likely to happen. ', 'Clinical Information, Health Declaration Form, Agile Software Development.', '2020-2021', '2021-07-29', '2021-10-01', '6', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'Public Health', 6, 'gsikabOBc2D6', 0, 0, '2021-10-01 06:55:45', '2021-10-14 02:27:29', NULL),
(622, 'Faculty and Employee Association Management System', 'FEAMS Chapter 1-5.pdf', 'FEAMS Chapter 1-5.pdf', 'The Faculty and Employee Association Management System (FEAMS) introduces to the association of Polytechnic University of the Philippines – Taguig Branch to manage, monitor, retrieve and update its system. It is developed as a collaborative strategy to ensure the effectiveness and efficiency of multi-objective functions that aims to supports the associations vision and mission. These give the member of association access to information regarding events and activity announcement, the eligibility in casting vote in election, participate in discussion, upload and download certain file/document needed and to constitution amendment.\r\n	Engagement is an active state that is influenced by interaction or lack thereof (Leece, 2011). With the advancement in information technology, the virtual world becomes the storehouse of the information. This exposes organizations to a lot of new resources and opens and keep up with the world’s digitalization momentum. \r\nThe Faculty and Employee Association Management System (FEAMS) introduces to the association of Polytechnic University of the Philippines – Taguig Branch to manage, monitor, retrieve and update its system. It is developed as a collaborative strategy to ensure the effectiveness and efficiency of multi-objective functions that aims to supports the associations vision and mission. These give the member of association access to information regarding events and activity announcement, the eligibility in casting vote in election, participate in discussion, upload and download certain file/document needed and to constitution amendment.\r\n	Engagement is an active state that is influenced by interaction or lack thereof (Leece, 2011). With the advancement in information technology, the virtual world becomes the storehouse of the information. This exposes organizations to a lot of new resources and opens and keep up with the world’s digitalization momentum. These give the member of association access to information regarding events and activity announcement, the eligibility in casting vote in election, participate in discussion, upload and download certain file/document needed and to constitution amendment.', 'connection, collaboration, memberships, benefits, discussion, platform, publication, association, election.', '2020-2021', '2021-07-29', '2021-10-01', '6', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'Public Policy & Administration', 1, 'Zfoz563ibLHR', 0, 0, '2021-10-01 07:24:32', '2021-10-14 02:28:16', NULL),
(623, 'Online Library Management System', 'Online_Library_Management_System.pdf', 'Online_Library_Management_System.pdf', 'A library is a collection of information sources. Readers, students, and others had formed a well-defined community as a result of similar resources. To make it easier to refer to or borrow the book. The Library Management System Software is used to quickly locate books and gain access to periodicals.\r\nThe librarian is having a difficult time performing manual inventory from all of the data within the library, including student time-in and time-out, in the existing library management system. They were also having trouble creating reports from the manual records of books borrowed and returned. Because of the technology employed, the present PUPT library system is malfunctioning, and it can no longer be used regularly. It takes a long time to inventory and show the materials. The librarian&#39;s supervision of the students is also not properly demonstrated. It is an automated system that will help the admin of the library to do an inventory of the materials, to monitor the students, and to generate reports. The Polytechnic University of the Philippines Library is an educational institution located in Taguig City which uses manual inputting of data in library transactions. The project aims to ease the workload of the librarian and make the library transaction more efficient for future use. The following points of the current system should be automated.\r\nMake the time-in and out process  secure \r\n\r\n		Based on the data and processes that the researchers have gathered, the system will be used by the Organization as an Online Library Management System. This system will handle all the client information and transactions made by the organization. The use cases aided the developers in determining the system&#39;s requirements. It illustrates how each subsystem interacts with each other, as well as the essential transaction flow and brief explanations of the system&#39;s main functions.\r\n\r\n', 'Theses for searching and study purposes', '2020-2021', '0000-00-00', '2021-10-01', '6', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'Technology', 6, 'xPhtlsXa02WY', 0, 0, '2021-10-01 23:48:37', '2021-10-14 02:29:18', NULL),
(624, 'Registrar&#39;s Online Document Request and Approval System', 'inbound3118723315010062392.pdf', 'inbound2246925385877894846.pdf', 'The Registrar’s Online Document Request and Approval System (RODRAS) introduces to the registrar of the Polytechnic University of the Philippines – Taguig Branch to manage, monitor, approve and deny request and update its website and information system. To digitize the manual transactions of the school registrar, the RODRAS were developed. RODRAS aims to have a fast transaction and accurate reports when the students and alumni are requesting.\r\nWith the functions of the system, it assured the fast and reliable transactions that need to be reached to the users. The researchers must improve on user-interface design, user-friendliness, and operational performance for parishioners/guests; adaptability, modifiability, maintainability, effectiveness, and efficiency of the web application.\r\n\r\nThe Registrar’s Online Document Request and Approval System (RODRAS) introduces to the registrar of the Polytechnic University of the Philippines – Taguig Branch to manage, monitor, approve and deny request and update its website and information system. To digitize the manual transactions of the school registrar, the RODRAS were developed. RODRAS aims to have a fast transaction and accurate reports when the students and alumni are requesting.\r\nWith the functions of the system, it assured the fast and reliable transactions that need to be reached to the users. The researchers must improve on user-interface design, user-friendliness, and operational performance for parishioners/guests; adaptability, modifiability, maintainability, effectiveness, and efficiency of the web application.\r\n\r\nThe Registrar’s Online Document Request and Approval System (RODRAS) introduces to the registrar of the Polytechnic University of the Philippines – Taguig Branch to manage, monitor, approve and deny request and update its website and information system. To digitize the manual transactions of the school registrar, the RODRAS were developed. RODRAS aims to have a fast transaction and accurate reports when the students and alumni are requesting.\r\nWith the functions of the system, it assured the fast and reliable transactions that need to be reached to the users. The researchers must improve on user-interface design, user-friendliness, and operational performance for parishioners/guests; adaptability, modifiability, maintainability, effectiveness, and efficiency of the web application.', 'agile software development, online document requests, students, alumni', '2020-2021', '2021-08-30', '2021-10-02', '6', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'Computer Science', 1, '4f56IR2AzGWH', 0, 0, '2021-10-02 06:10:25', '2021-10-14 02:30:00', NULL),
(625, 'Reservation of Facility and Equipment Inventory System', 'RFEIS - Background of the Development Team.pdf', NULL, 'The Reservation of Facility and Equipment Inventory System (RFEIS) introduced to the Administrative Office in Polytechnic University of the Philippines – Taguig Branch (PUPT) will digitally manage the requests of reservations of the facility and equipment to be used for the academic or non-academic activities.\r\n\r\nThe web application was created using the Agile Software Methodology for the capstone period to work effectively. The front-end of the program is constructed with the CodeIgniter Framework, while the database management system is MySQL. Each module is developed with its own set of functionalities. The users who took part in the user acceptance testing were the students, faculty members, employees, administrative officer, and staff. The administrator had acquired a domain name and a web hosting service.\r\n\r\nIn the User Acceptance Testing, the system received a 4.402 average, which corresponds to “Agree”. As a result of the data obtained, the system offered a solution for making transactions more efficient and effective. The researchers must improve usability, portability, and security for the users based on the findings.\r\n\r\nThe Reservation of Facility and Equipment Inventory System (RFEIS) introduced to the Administrative Office in Polytechnic University of the Philippines – Taguig Branch (PUPT) will digitally manage the requests of reservations of the facility and equipment to be used for the academic or non-academic activities.\r\n\r\nThe web application was created using the Agile Software Methodology for the capstone period to work effectively. The front-end of the program is constructed with the CodeIgniter Framework, while the database management system is MySQL. Each module is developed with its own set of functionalities. The users who took part in the user acceptance testing were the students, faculty members, employees, administrative officer, and staff. The administrator had acquired a domain name and a web hosting service.\r\n\r\nIn the User Acceptance Testing, the system received a 4.402 average, which corresponds to “Agree”. As a result of the data obtained, the system offered a solution for making transactions more efficient and effective. The researchers must improve usability, portability, and security for the users based on the findings.\r\n\r\n', 'facility, reservation, equipment, inventory, system, reserve, student, faculty, guest, admin, administrative, agile software development', '2020-2021', '2021-07-21', '2021-10-02', '6', 'Dr. Marissa Ferrer', NULL, NULL, 1, 2, NULL, 1, 'Computer Science', 1, '0Gwk84Iezijn', 0, 0, '2021-10-02 10:57:46', '2021-10-02 10:57:46', NULL),
