(631, 'Reservation of Facility and Equipment Inventory System 6', 'RFIES - Grammarian\'s Certificate.pdf', NULL, 'The Reservation of Facility and Equipment Inventory System (RFEIS) introduced to the Administrative Office in Polytechnic University of the Philippines – Taguig Branch (PUPT) will digitally manage the requests of reservations of the facility and equipment to be used for the academic or non-academic activities.\r\n\r\nThe web application was created using the Agile Software Methodology for the capstone period to work effectively. The front-end of the program is constructed with the CodeIgniter Framework, while the database management system is MySQL. Each module is developed with its own set of functionalities. The users who took part in the user acceptance testing were the students, faculty members, employees, administrative officer, and staff. The administrator had acquired a domain name and a web hosting service.\r\n\r\nIn the User Acceptance Testing, the system received a 4.402 average, which corresponds to “Agree”. As a result of the data obtained, the system offered a solution for making transactions more efficient and effective. The researchers must improve usability, portability, and security for the users based on the findings.\r\n\r\nThe Reservation of Facility and Equipment Inventory System (RFEIS) introduced to the Administrative Office in Polytechnic University of the Philippines – Taguig Branch (PUPT) will digitally manage the requests of reservations of the facility and equipment to be used for the academic or non-academic activities.\r\n\r\nThe web application was created using the Agile Software Methodology for the capstone period to work effectively. The front-end of the program is constructed with the CodeIgniter Framework, while the database management system is MySQL. Each module is developed with its own set of functionalities. The users who took part in the user acceptance testing were the students, faculty members, employees, administrative officer, and staff. The administrator had acquired a domain name and a web hosting service.\r\n\r\nIn the User Acceptance Testing, the system received a 4.402 average, which corresponds to “Agree”. As a result of the data obtained, the system offered a solution for making transactions more efficient and effective. The researchers must improve usability, portability, and security for the users based on the findings.\r\n\r\n', 'facility, reservation, equipment, inventory, system, reserve, student, faculty, guest, admin', '2020-2021', '2021-07-28', '2021-10-02', '6', 'Dr. Marissa Ferrer', NULL, NULL, 1, 2, NULL, 1, 'Computer Science', 1, 'KGClVISUfq7s', 0, 0, '2021-10-02 11:07:30', '2021-10-02 11:07:30', NULL),
(632, 'Reservation of the Faculty and Equipment Inventory System', 'RFEIS - Certifications.pdf', NULL, 'The Reservation of Facility and Equipment Inventory System (RFEIS) introduced to the Administrative Office in Polytechnic University of the Philippines – Taguig Branch (PUPT) will digitally manage the requests of reservations of the facility and equipment to be used for the academic or non-academic activities.\r\n\r\nThe web application was created using the Agile Software Methodology for the capstone period to work effectively. The front-end of the program is constructed with the CodeIgniter Framework, while the database management system is MySQL. Each module is developed with its own set of functionalities. The users who took part in the user acceptance testing were the students, faculty members, employees, administrative officer, and staff. The administrator had acquired a domain name and a web hosting service.\r\n\r\nIn the User Acceptance Testing, the system received a 4.402 average, which corresponds to “Agree”. As a result of the data obtained, the system offered a solution for making transactions more efficient and effective. The researchers must improve usability, portability, and security for the users based on the findings.\r\n\r\nThe Reservation of Facility and Equipment Inventory System (RFEIS) introduced to the Administrative Office in Polytechnic University of the Philippines – Taguig Branch (PUPT) will digitally manage the requests of reservations of the facility and equipment to be used for the academic or non-academic activities.\r\n\r\nThe web application was created using the Agile Software Methodology for the capstone period to work effectively. The front-end of the program is constructed with the CodeIgniter Framework, while the database management system is MySQL. Each module is developed with its own set of functionalities. The users who took part in the user acceptance testing were the students, faculty members, employees, administrative officer, and staff. The administrator had acquired a domain name and a web hosting service.\r\n\r\nIn the User Acceptance Testing, the system received a 4.402 average, which corresponds to “Agree”. As a result of the data obtained, the system offered a solution for making transactions more efficient and effective. The researchers must improve usability, portability, and security for the users based on the findings.\r\n\r\n', 'facility, reservation, equipment, inventory, system, reserve, student, faculty, guest, admin', '2020-2021', '2021-07-29', '2021-10-02', '6', 'Dr. Marissa Ferrer', NULL, NULL, 1, 2, NULL, 1, 'Computer Science', 1, 'Pp4B5AhlTu1q', 0, 0, '2021-10-02 11:15:04', '2021-10-02 11:15:04', NULL),
(633, 'Patient and Dental Monitoring System', 'Patient and Dental Supply Monitoring System- Theses.pdf', 'Patient and Dental Supply Monitoring System- Theses.pdf', 'The Patient and Supply Monitoring System is an automated system that processes appointments, check-ups, inventory of medicine and supplies and other manual processes of the dental department of Polytechnic University of the Philippines – Taguig branch.  In addition, the system gives accurate reports regarding the inventories of dental supplies and speeds up the current operation of the dental and medical department. The primary objective in creating the PUPT Dental Management System is to help the school dentist to organize the patient’s records. This helps to easily record, delete or alter a patient’s personal information and dental records, as well as appointments of the dentist. This project aims to serve as one of the innovative systems and research in PUP with greater reliance on technology which is one of the goals and objectives of the College of Computer and Information Sciences. The following points of the current system should be automated. Patient dental records/service history, scheduling of appointments, Medicine Inventory, Supply Inventory, Managing website pages. Based on the data and processes that the researchers have gathered, the system will be used by the Dental clinic as a Patient and Dental Supply Monitoring System. This system will handle all the patient’s dental records, service history, appointments, inventory of medicine and supply, and all the transactions made by the organization. The   researchers   used    the    Agile Software Development Life Cycle or Agile SDLC Model to develop and create a new foundation and development for the newly developed system. However, use cases helped the developers figure out what the system needed. It depicts how each subsystem interacts with one another, as well as the critical transaction flow and concise descriptions of the system&#39;s major functions. This study definitely answers the question why system should be implemented and use by the client, Future IT students who handle the system needed further studies and development of the system and the research to make it more reliable.', 'Patient and Dental Supply Monitoring System, Patient Monitoring, agile software development, inventory system', '2020-2021', '2021-07-29', '2021-10-02', '6', 'Dr. Marissa Ferrer', NULL, NULL, 3, 2, NULL, 1, 'History of Science & Technology', 1, 'KQ3WrJMD7tXT', 0, 0, '2021-10-03 04:02:12', '2021-10-14 02:39:32', NULL),
(635, 'Impact of Celebrity Endorsements Towards Selected Fast Food Chains on the Purchase Attitude of Custo', 'IMPACT-OF-CELEBRITY-ENDORSEMENTS-TOWARDS-SELECTED-FAST-FOOD-CHAINS-ON-THE-PURCHASE-ATTITUDE-OF-CONSU', NULL, 'The study titled “Impact of Celebrity Endorsements towards Selected Fast Food\r\nChains on the Purchase Attitude of Consumers in Barangay Tuktukan, Taguig City”\r\nsought to determine the impact of celebrity endorsements in consumer buying\r\nbehavior towards selected fast food chains in Barangay Tuktukan, Taguig City.\r\nOverall, its objective is to know the opinion and understanding of the respondents\r\nabout the impact of celebrity endorsements and how does it affect their purchasing and\r\nconsumption behavior to products being offered by fast food chains. The researchers\r\nidentified four celebrity endorsement determinants or factors to consider in determining\r\nthe best celebrity to endorse the brand which are (1) Attractiveness, (2) Credibility, (3)\r\nExpertise and (4) Celebrity Match or Good Product-Celebrity Fit. This endeavor also\r\nfocused on the significant impact of celebrity endorsements to purchasing behavior of\r\nthe respondents. The survey was executed at the target locations which include fast\r\nfood chains such as Jollibee, Mang Inasal and McDonalds in Puregold and Vista Mall which are all located within the vicinity of Barangay\r\nTuktukan, Taguig City on times which the survey team is available.\r\nThe research design utilized in the study was Descriptive- Survey Design\r\nwherein participants were to answer questions administered through questionnaires.\r\nIn identifying the sample size, the researchers utilized Cochran’s formula to determine\r\nthe total number of respondents needed for respondents and applied accidental\r\nsampling to survey respondents based on their availability on the time being.\r\nFor the statistical treatment of the data gathered, the researchers made use of\r\nfrequency to tally the responses provided by the respondents, mean to classify the\r\nresponse of the respondents, Likert scale is used to identify on what rating falls the\r\nassessment of the respondents on each variable and lastly, the Spearman rank order\r\ncorrelation to determine whether celebrity endorsements significantly impacts the\r\npurchasing behavior of the respondents.\r\n', 'Keywords: Polytechnic University of the Philippines, impact, celebrity endorsements, purchase attitude, fast food chains', '2020-2021', '0000-00-00', '2020-03-14', '', 'Dr. Marissa Ferrer', NULL, NULL, 1, 2, NULL, 6, 'Business', 6, 'UKivDYcO6dxS', 0, 0, '2021-10-10 05:15:23', '2021-10-10 05:15:23', NULL);
