INSERT INTO `faculty_publication` (`id`, `faculty_id`, `research_title`, `publication`, `volume`, `institute`, `proof_publication`, `date_published`, `abstract`, `school_year`, `created_at`, `updated_at`, `deleted_at`) VALUES
(4, 139, 'Belief Statements of Teaching Philosophy Among Public School Teachers in Division of Taguig and Pate', NULL, NULL, NULL, '', NULL, 'This‌ ‌study‌ ‌focused‌ ‌on‌ ‌the‌ ‌belief‌ ‌statements‌ ‌of‌ ‌teaching‌ ‌philosophy‌ ‌among‌ ‌public‌ ‌high‌ ‌school‌ ‌\r\nteachers.‌ ‌The‌ ‌researchers‌ ‌made‌ ‌use‌ ‌of‌ ‌descriptive‌ ‌method‌ ‌of‌ ‌research.‌ ‌The‌ ‌respondents‌ ‌of‌ ‌this‌ ‌study‌ ‌\r\nwere‌ ‌60‌ ‌teachers‌ ‌of‌ ‌public‌ ‌high‌ ‌schools‌ ‌in‌ ‌the‌ ‌division‌ ‌of‌ ‌Taguig‌ ‌and‌ ‌Pateros.‌ ‌Based‌ ‌on‌ ‌the‌ ‌gathered‌ ‌\r\ndata,‌ ‌after‌ ‌analyzation‌ ‌and‌ ‌interpretation,‌ ‌the‌ ‌following‌ ‌findings‌ ‌were‌ ‌discovered:‌ ‌In‌ ‌terms‌ ‌of‌ ‌their‌ ‌\r\nprofile,‌ ‌majority‌ ‌of‌ ‌the‌ ‌respondents‌ ‌are‌ ‌aged‌ ‌29‌ ‌years‌ ‌old‌ ‌and‌ ‌below,‌ ‌female‌ ‌and‌ ‌with‌ ‌five‌ ‌or‌ ‌less‌ ‌\r\nyears‌ ‌of‌ ‌service.‌ ‌In‌ ‌Perennialism,‌ ‌among‌ ‌the‌ ‌five‌ ‌belief‌ ‌statements,‌ ‌statement‌ ‌number‌ ‌two;‌ ‌Education‌ ‌\r\nis‌ ‌a‌ ‌preparation‌ ‌for‌ ‌life,‌ ‌ranked‌ ‌first.‌ ‌The‌ ‌statement‌ ‌that‌ ‌ranked‌ ‌last‌ ‌was‌ ‌statement‌ ‌number‌ ‌five;‌ ‌the‌ ‌\r\nstudents‌ ‌are‌ ‌passive‌ ‌recipients‌ ‌of‌ ‌learning.‌ ‌Among‌ ‌the‌ ‌five‌ ‌belief‌ ‌statements‌ ‌for‌ ‌Idealism,‌ ‌statement‌ ‌\r\nnumber‌ ‌seven;‌ ‌the‌ ‌teacher‌ ‌is‌ ‌a‌ ‌model‌ ‌of‌ ‌behavior‌ ‌garnered‌ ‌the‌ ‌highest‌ ‌rating,‌ ‌while‌ ‌statement‌ ‌\r\nnumber‌ ‌nine;‌ ‌the‌ ‌methods‌ ‌of‌ ‌teaching‌ ‌are‌ ‌receiving,‌ ‌memorizing‌ ‌and‌ ‌reporting,‌ ‌ranked‌ ‌last.‌ ‌When‌ ‌it‌ ‌\r\ncomes‌ ‌to‌ ‌Realism,‌ ‌the‌ ‌respondents‌ ‌strongly‌ ‌agreed‌ ‌with‌ ‌statement‌ ‌number‌ ‌12;‌ ‌the‌ ‌teachers‌ ‌must‌ ‌\r\nimpart‌ ‌knowledge‌ ‌of‌ ‌reality,‌ ‌while‌ ‌the‌ ‌respondents‌ ‌slightly‌ ‌agreed‌ ‌with‌ ‌statement‌ ‌number‌ ‌14;‌ ‌the‌ ‌\r\nstudents‌ ‌are‌ ‌passive‌ ‌participants‌ ‌in‌ ‌the‌ ‌study‌ ‌of‌ ‌things.‌ ‌On‌ ‌the‌ ‌other‌ ‌hand,‌ ‌in‌ ‌Experimentalism,‌ ‌the‌ ‌\r\nrespondents‌ ‌strongly‌ ‌agreed‌ ‌with‌ ‌statement‌ ‌number‌ ‌16;‌ ‌the‌ ‌school‌ ‌continually‌ ‌seeks‌ ‌to‌ ‌discover‌ ‌\r\nways‌ ‌to‌ ‌improve‌ ‌society,‌ ‌while‌ ‌the‌ ‌respondents‌ ‌moderately‌ ‌agreed‌ ‌with‌ ‌statement‌ ‌number‌ ‌20;‌ ‌the‌ ‌\r\nmethods‌ ‌of‌ ‌learning‌ ‌are‌ ‌problem‌ ‌solving‌ ‌and‌ ‌inquiry,‌ ‌ranking‌ ‌it‌ ‌last‌ ‌among‌ ‌the‌ ‌five‌ ‌belief‌ ‌statements.‌ ‌\r\nLastly,‌ ‌in‌ ‌Existentialism,‌ ‌the‌ ‌respondents‌ ‌strongly‌ ‌agreed‌ ‌with‌ ‌statement‌ ‌number‌ ‌21;‌ ‌the‌ ‌school‌ ‌exists‌ ‌\r\nto‌ ‌aid‌ ‌students‌ ‌in‌ ‌knowing‌ ‌themselves‌ ‌and‌ ‌their‌ ‌place‌ ‌in‌ ‌society;‌ ‌while‌ ‌ranking‌ ‌last‌ ‌is‌ ‌statement‌ ‌\r\nnumber‌ ‌23;‌ ‌the‌ ‌students‌ ‌determine‌ ‌what‌ ‌should‌ ‌be‌ ‌taught.‌ ‌Overall,‌ ‌the‌ ‌teaching‌ ‌philosophy‌ ‌that‌ ‌got‌ ‌\r\nthe‌ ‌highest‌ ‌rating‌ ‌was‌ ‌Experimentalism,‌ ‌with‌ ‌a‌ ‌weighted‌ ‌mean‌ ‌of‌ ‌4.253,‌ ‌verbally‌ ‌interpreted‌ ‌as‌ ‌\r\nmoderately‌ ‌agree,‌ ‌while‌ ‌the‌ ‌lowest‌ ‌was‌ ‌Realism,‌ ‌with‌ ‌3.853‌ ‌as‌ ‌a‌ ‌weighted‌ ‌mean,‌ ‌verbally‌ ‌interpreted‌ ‌\r\nas‌ ‌moderately‌ ‌agree.‌ ‌All‌ ‌in‌ ‌all,‌ ‌the‌ ‌teaching‌ ‌philosophies‌ ‌garnered‌ ‌a‌ ‌weighted‌ ‌mean‌ ‌of‌ ‌4.047,‌ ‌verbally‌ ‌\r\ninterpreted‌ ‌as‌ ‌moderately‌ ‌agree.‌ ‌There‌ ‌is‌ ‌no‌ ‌significant‌ ‌difference‌ ‌on‌ ‌respondents’‌ ‌perception‌ ‌on‌ ‌their‌ ‌\r\nbelief‌ ‌statements‌ ‌of‌ ‌teaching‌ ‌philosophy‌ ‌if‌ ‌they‌ ‌are‌ ‌grouped‌ ‌according‌ ‌to‌ ‌their‌ ‌age,‌ ‌gender‌ ‌and‌ ‌length‌ ‌\r\nof‌ ‌service.‌ ', '2019-2020\r\n', '2021-08-17 20:11:36', '2021-09-02 08:12:39', NULL),
(5, 222, 'Motorized Sand Sieve \r\n', '', NULL, NULL, '', NULL, 'This project study aims to design and fabricate a motor-operated sand sieve machine that is efficient than the conventional one (manual sieving). The researchers made the machine motor operated to promote less effort for workers that will be using it. The geared motor which has a speed of 340 rpm is connected to a chain drive and bar linkages which transmit rotational motion into reciprocating motion. This machine also features a non-fixed mesh frame that allows the replacement of sieves and an opening at the end of the frame to discard unwanted particles without stopping the machine. To effectively sieve better, the base frame of the sieve is inclined to 8.05° which is between the acceptable inclination angle for sieving for dry sand that is 1° to 12 °. (Atienza, Candor, Inoncillo, Pelayo, & Fortaleza, 2017)\r\n', '2019-2020', '2021-08-17 20:11:36', '2021-09-02 08:13:51', NULL),
(6, 176, ' Motorized Hydraulic Jack \r\n', NULL, NULL, '', '', NULL, 'This study focuses on the development of a Motorized Hydraulic Jack that operates using a 12V DC wiper motor. Specifically, to provide a greater efficiency compared to the manually operated hydraulic jacks. It is intended for the use as another equipment for small and medium automotive industries and vehicle owners to provide an easier way of lifting a vehicle and have a portable lifter. This project is also intended to help Mechanical Engineering students on their Machine Shop Theory and Practices subjects. The study utilizes the research based on the experimental method covering the fundamental concept of efficiency over the quality of time. Tests were conducted to evaluate and attain the expected performance of a Motorized Hydraulic Jack in terms of lifting 4-wheel vehicles. All materials used in the fabrication of the project conformed to the desired performance of the equipment.\r\n', '2019-2020', '2021-08-17 20:31:02', '2021-09-02 08:14:57', NULL),
(7, 147, 'ANALYSIS OF THE SOCIAL MEDIA INFLUENCER’S EFFECT IN BUILDING BRAND IMAGE AND CONSUMER’S PURCHASE INTENTION OF WORKING CLASS IN LOWER BICUTAN, TAGUIG\r\n', NULL, NULL, NULL, '', NULL, 'The purpose of the research was to analyze how social media influencers effect in building brand image and consumer’s purchase intention with the selected working individual in Lower Bicutan, Taguig, Philippines. The social media influencers, as part of a marketing tool to help provide information about products and services to the social media audience. Through the social media influencer‟s profile such as attractiveness, visibility, credibility, and power companies were able to build strong brand image: service, product, and company. The research would implement the cross sectional design, with the data gathered through online questionnaires shared in social media accounts. The samples would be gathered using the convenience sampling technique, with respondents up to 398 people. The research implemented the purchase intention as the endogenous variable and social media influencers as the exogenous variable, as well as brand image as the intervening variable. Spearman rank order correlation (Spearman‟s rho) was conducted to determine the significant relationship between the social media influencers‟ profile and the purchase decision of working class in Taguig City. The research resulted in a moderate correlation of significance in the influence of both social media influencer and brand image towards the purchase intention.\r\n', '2019-2020', '2021-08-17 20:31:02', '2021-09-02 08:15:21', NULL),
(8, 181, 'A STUDY ON THE IMPACT OF E-SERVICE TOWARDS CUSTOMER’S SATISFACTION AND LOYALTY ON GENERATION Z’s ONLINE SHOPPERS IN SELECTED PUP CAMPUSES\r\n', NULL, NULL, NULL, '', NULL, '     E-service is known as a critical factor for successful implementation and decent performance of any business in electronic environment. The growing usage of internet and online shopping in Philippines presents a huge prospect in e-commerce market. As a result, E-service quality, E-service satisfaction and E-service loyalty become vital for online retailers to attract and retain online shoppers in this virtual environment. The purpose of this study is to propose and assess the level of E-service in terms of E-service satisfaction and E-service loyalty. In order to fully determine the impact of E-services, a total of 400 respondents in P.U.P campuses of Taguig and Parañaque were surveyed. The results indicate that all the dimensions of E-service quality were found to have positive and significant effect on E-service satisfaction and E-service loyalty of online shoppers. The assessment revealed that females are more willing to tell their satisfaction and loyalty level concerning to E-service. In addition, age groups of 18-20 use E-services more frequently rather that the other age groups mostly in Generation Z. With these findings, researchers made recommendations. The online shoppers Esatisfaction was positively and significantly affected their E-loyalty towards continuous usage of online retailer’s website. And we recommend for future researchers to conduct a multivariate analysis on what makes consumers dissatisfied in using E-service in order to balance with E-service satisfaction\r\n', '2019-2020', '2021-08-17 20:31:02', '2021-09-02 08:15:49', NULL),
(9, 220, 'A Comparative Evaluation Study of the Exit Survey Results of the Polytechnic University of the Philippines-Taguig Branch for the SY 2016-2019\r\n', NULL, NULL, NULL, '', NULL, '\"This study is all about a comparative evaluation study of the different results of the Exit Interviews conducted to the graduating students of Polytechnic University of the Philippines Taguig Branch for the year 2016 to 2019. The different survey results based on the data gathered by the researcher for the three consecutive years were tallied, analyzed and compared for the purpose of evaluation and program enhancement proposal.\r\nSince this study is an evaluation of the previous Exit Survey interviews for the last three years including 2019, the population of the respondents for the different Exit Survey Interviews are as follows; for the year 2016, the total respondents are 502, for the Year 2017 the total respondents are 444 and for the year 2019 the total respondents are 350. All respondents are graduating students when the time the study was conducted was considered since the study is all about evaluation of the different school programs and facilities. \r\nBased on the results of the different Exit Survey interviews conducted for the year 2019 and below, the following variables were compared and analyzed; Academic Standards, School Activities, Faculty, Classmates, Facilities, Course Enrolled, and Student Organizations. With the use of T-Test as a statistical treatment of the study, the different results gathered from the different studies were statistically compared for a scientific analysis of data. \r\nAs based from the different survey results of the study, all three different survey results from different years revealed similar findings. Out of seven items that were assessed based from the different survey interviews conducted in different years, the item Facilities got the similar survey results which is \"\"satisfactory\"\" only. While the rest of the items that were assessed got a rating of \"\"very satisfactory\"\" to \"\"outstanding\"\". Based from the three different studies, it only revealed that the Polytechnic University of the Philippines Taguig Branch main problem is the facilities. Thus, it is the recommendation of this study to come up with an enhance program that can help the administration as well as school officials to continuously \'improve its facilities by finding other means of resources and not just to rely on the budget being given by the National Government. \r\nAs a conclusion and recommendation of this study, based from the different findings of this study, the researcher proposed an action plan that focuses on the different solutions that can be done in as specified time frame. With the proposed action plan, further studies is highly recommended for improvement of the said action plan.\"\r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 08:16:20', NULL),
(10, 153, 'Levels of Engagement, Job Satisfaction, and Teaching Performance: An Intercorrelational Study\r\n', NULL, NULL, NULL, '', NULL, '\"This descriptive correlational study determined the interrelationship of the level of engagement, level of job satisfaction and teaching performance of the selected faculty members of PUP Taguig. The respondents consisted of thirty-four (34) faculty members, both part-time and regular, with assigned teaching assignments during the 1st semester of SY 2017-2018. The study used two sets of survey questionnaires as its principal instrument in gathering the needed data. Document analysis was also employed to gather the respondent’s performance evaluation results during the 2nd semester of SY 2016-2017 which was used as the basis of the variable, teaching performance. To analyze and interpret the data, the study used percentage, men and Pearson r.\r\nThe study revealed that the respondents have very high-level engagement on the following dimensions: meaningfulness of the job, attitude towards PUP Taguig, extent of loyalty to PUP Taguig, perception of leadership and management, and intention to stay or leave the organization. It, likewise, found out that with an average mean of 3.41, the respondents are satisfied with their job in terms of the hygiene factors; and very satisfied with their job in terms of motivators with an average of 3.54. Further, the study revealed that 70.6% of the respondents gained a very satisfactory rating in their teaching performance during the 2nd semester of SY 2016-2017 indicative that they performed well during this rating period.\r\nThe respondents’ level of job satisfaction in terms of hygiene factors is affected by the following dimensions of engagement: extent of loyalty, work-life balance, perception of organization’s leadership and management, perception of the director and head of academic programs, communication flow and attitude towards PUP Taguig.\r\nThe respondent’s level of job satisfaction in terms of motivators is affected by the following dimensions of engagement: attitude towards PUP Taguig, communication flow and perception on leadership and management. This means that as the extent of engagement in these dimension increases, the level of job satisfaction increases as well.\r\nThe respondent’s teaching performance is affected by their attitude toward PUP Taguig. This implies that positive attitude towards the organization leads to improved teaching performance. \r\nThe respondents\' level of job satisfaction in terms of motivators is significantly related to their teaching performance. This implies that as the level of job satisfaction increases, the level of performance increases as well. This study, therefore, conforms to literature that job satisfaction leads to increased job performance.\"\r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 08:16:56', NULL),
(11, 160, 'PUP Taguig Online Repository of Thesis and Capstone Projects (ORTAC)\r\n', NULL, NULL, NULL, '', NULL, 'The project focused on the development and implementation of the PUPT Online Repository of Theses and Capstone Projects. It is a web and mobile application that stores the softcopies of the research papers such as the e-journal, monograph, and posters. The project aimed to resolve the problem regarding the submission of the researches and the generation of reports needed for accreditation. The tools used for the web application development were the MySQL database server, PHP, Ajax, and CodeIgniter framework, meanwhile the mobile application was developed using Ionic framework with AngularJS. The system was tested using ISO 25010 and the User Acceptance Testing questionnaires as testing tools. The rating of the system is 4.16 (“Slightly Agree”) and 4.73 (“Very Good”) respectively. Therefore, based on the data gathered, the system provided a solution for the mentioned problems, thus making transactions efficient and effective\r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 13:21:59', NULL),
(12, 139, 'PUPT – Massive Open Online Course\r\n', NULL, NULL, NULL, '', NULL, '\"PUPT — Massive Open Online Course is a system that aims to provide an easy way for instructors to create and control a web classroom network as well as enable college students to connect and work with their classmates and instructors anywhere and anytime. The objective of this study is to determine the preferences of college students towards the usage of communication and information technology. The research aims to know whether PUPT — MOOC will be a good teaching strategy that should be used by instructors to form a technology-based learning environment. \r\nThe Software Methodology used is Agile Software Development because it can ensure good software throughout the development process. The researchers primarily used XAMPP, Laravel, Bootstrap, Json, Jquery and Ajax to develop the system. With the help of the respondents, the BSED and BSIT students, the researchers were able to conduct their 150 25010 and User Acceptance Testing. The results were 3.9 and 3.8 respectively thus gaining a \'Very Satisfactory\"\" grade. For the Mobile Application, a total score of 4.6 was tallied thus earning a grade of \"\"Excellent\"\" in the User Acceptance Testing. The researchers concluded that the system is great for learning through an online process because of the availability and efficiency of the system. \"\r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 08:17:44', NULL),
(13, 160, 'Online Research Management Information System\r\n', NULL, NULL, NULL, '', NULL, 'Online Research Management Information System (ORMIS) is a system that aims to provide an easy way for the researchers, reviewers, and the research management office of PUP – Sta. Mesa to process the submissions and application of research proposals. The objective of this study is to have an efficient and accessible system that will enable users to facilitate the processing of research grants, paper presentation, merit promotion, invention disclosure incentives and theses and dissertations applications. It will also serve as a repository for all the grants approved by the research management. Online Research Management Information System (ORMIS) will be online 24/7. The software methodology used was Agile Software Development to ensure the quality of the system during the development. The researchers used XAMPP as the database server and Codeigniter as the PHP framework. The respondents composed of the researchers, research coordinators and the chief of research department. The questionnaire was adapted from ISO25010 standard. The system received an overall rating of 5.37 in product quality, an average of 5.06 for quality-in-use with a descriptive rating of “Agree”. The respondents agree that Online Research Management Information System (ORMIS) satisfies the requirements needed and highly recommended for implementation. \r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 13:22:03', NULL),
(14, 160, 'Barriers and Supports to DOST-assisted MSME\'s in adopting oneStore.ph in the Philippines\r\n', NULL, NULL, NULL, '', NULL, 'The study assessed the internal and external barriers and supports to DOST-assisted Micro, Small and Medium Enterprises (MSME’s) in adopting oneSTore.ph in the Philippines. oneSTore.ph is an ecommerce platform which aimed to promote and market Philippine products. This study applied descriptive research using a questionnaire to gather data. The respondents were 220 DOST-assisted micro, small and medium enterprises which were randomly selected. The statistical tools used were Frequency and Percentage Distribution, Median, Kruzkal Wallis and Mann-Whitney Test. The results showed that majority of the DOST-assisted micro, small, medium enterprises (MSME’s) were micro enterprises, sole proprietors and female owners/managers. The highest internal barriers in adopting oneSTore.ph were lack of skills and online payment security. Infrastructure barriers were the highest external barriers in adopting oneSTore.ph. The respondents rated the internal supports moderately and they rated the external supports highly. The findings implied that internal supports in adopting oneSTore.ph must be provided. The study’s recommendation includes the upgrading of the infrastructures and intensifying external supports to motivate the DOST-assisted MSME’s to adopt and maintain the utilization of oneSTore.ph to be globally competitive.\r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 13:22:09', NULL),
(15, 222, 'Electrically powered Grass cutter for rough terrain with rocker bogie mechanism\r\n', NULL, NULL, NULL, '', NULL, 'This project study aims to know if the effect of combining grass cutter into a rocker boogie mechanism will help the machine adapt on uneven terrain or rough surfaces. The researchers made the machine with battery powered motor to lessen the noise and labor cost and to attain continuous work time. Through this study, they found out that the selection of blade is a big factor in the efficiency of the machine. The razor type of cutter is more efficient than the rotary and string strimmer type of blade. And in terms of cost effectiveness, this machine can save thousands of pesos annually than the typical grass lawn mower. As a summary, the machine created in this study is effective to use but there are still ways to make it efficient. It can be enhanced through further studies and help other researchers to think and create their own by using this as their reference. We recommend using the first proposed design cutter of the lawn mower to have a more efficient result and more even cut. Keywords: Lawn Mower, Rocker-Boogie, Electrically Powered, Rough Terrain, Cutte\r\n', '2018-2019', '2021-08-17 20:31:02', '2021-09-02 08:18:57', NULL),
(16, 176, 'Solar Powered Flood Lights\r\n', NULL, NULL, NULL, '', NULL, 'The researchers’ aim is to be able to utilize solar energy as a source of power in lighting up the flood lights installed in the gymnasium of the university. The group decided to install two flood lights with 100 Watts each that could be used for 5 to 6 hours during the night time. The panels were installed on the roof of the gymnasium while the battery and inverter are inside the gymnasium. The researchers based their needs on the numerical data that they have computed. After series of testing and consultations from different sources, the researchers were successful on the project. The methods were properly documented. This project may be a reference for others who will conduct the similar project and recommendations are encouraged by the researchers\r\n', '2018-2019', '2021-08-17 20:36:19', '2021-09-02 08:19:24', NULL),
(17, 201, 'Effects of Traditional Advertisements to Consumer Domain to Selected Millennials of Barangay Lower Bicutan Taguig City\r\n', NULL, NULL, NULL, '', NULL, '\"Millennials\", who have never known a world without Facebook and selfies, is comprised of young adults born from the 1980s to 2000s and is dominating the new millennium. As the largest living generation, millennials influence each other\'s purchasing habits. Unlike any other generations, millennials are unique as they are the most diverse generation among all. Another is the millennials live in accordance with the technology revolution which means they have at least an average to a high level of technological literacy. They are used to being connected to each other. Marketers today face a huge obstacle when trying to reach young consumers. Consumers today want a different relationship from what they are getting right now from many brands, explained Foster, because social media has changed and continues to change everything. Millennials, who came of age with the Internet, have the highest levels of trust in online and mobile formats, followed closely by Generation X. While that may not come as a surprise, it\'s not just online and mobile advertising formats where Millennials exceed the average. The survey- questionnaire were distributed among the millennials of barangay Lower Bicutan, Taguig City. The researchers grouped the respondents according to age bracket for the reason of getting various views from different age divisions. This study will show how traditional advertisements affect the millennials base on the AIDA Concept. The study will emphasize what part of the Aida concept, millennials tend to stop while using/viewing Print Advertisements, Television Advertisements, and Radio advertisements. The researchers chose the AIDA concept because it is widely used in marketing and advertising to describe the steps or stages that occur from the time when a consumer first becomes aware of a product or brand through when the consumer tries a product or make a purchase decision. As defined by Hackley (2005), the concept AIDA, created by Strong in 1925 is a behavioral model that has a purpose to make sure that an advertisement raises awareness, stimulate interest, and leads the customer desire and eventually action.\r\n', '2018-2019', '2021-08-17 20:36:19', '2021-09-02 08:20:04', NULL),
(18, 181, 'GENERATION Y’S LEVEL OF ASSESSSMENT ON JOLLIBEE’S LOVE ADVERTISEMENT AND ITS IMPACT TO THEIR BRAND EQUITY AND DECISIONS IN UPPER BICUTAN, TAGUIG CITY\r\n', NULL, NULL, NULL, '', NULL, 'The study aimed to determine Generation Y\'s level of assessment on Jollibee\'s love advertisement and its impact on their brand equity and decisions. The descriptive method was used in the study and a survey questionnaire was used as the primary means of finding the results. The Results as interpreted in the study shows that respondents agreed on the love advertisements Jollibee has, most of them who participated are male and there is no significance on their level of assessment towards the said advertisements if grouped by profile. Lastly, there is no significant relationship between their level of assessment on Jollibee\'s love advertisements and perceived brand equity. Based on the conclusion presented in the study the researchers recommend that Generation X and Z should be part of the respondents to have a more comparative study, Jollibee, on the other hand, must provide an extensive marketing strategy that involves an advertisement that builds assessment of consumer. Lastly, Jollibee has to focus its advertisements on the product itself and do extensive research and study that centers on consumer\'s tastes and preferences.\r\n', '2018-2019', '2021-08-17 20:36:19', '2021-09-02 08:20:26', NULL),
(19, 221, 'Bingsulit: A Feasibility Study on Establishing a Food Stall Business\r\n', NULL, NULL, NULL, '', NULL, 'This study intends to determine the feasibility of establishing a Korean-inspired dessert shop using Filipino delicacies. BingSulit aims to serve the youth of Upper Bicutan and to offer a cool and refreshing treat in a chill and relaxing store. Each cup of Bingsu is delectable treat that can satisfy one\'s sweet tooth. This study aims to create a new fusion of Korean and Filipino desserts.\r\n', '2018-2019', '2021-08-17 20:36:19', '2021-09-02 08:20:51', NULL),
(20, 137, 'DIC & DIP: A Feasibility Study On Doughnut Ice Cream And Dip\r\n', NULL, NULL, NULL, '', NULL, 'DIC & Dip - soft-served ice cream with doughnut on top aims to provide a unique way of enjoying snacks by combining ice cream and doughnut, thus doubling the fun. This research is made so as to provide another variety of snacks that the customers may enjoy here in Sintang Paaralan. The researchers made sure that the prices were strategically set to consider the customers without affecting the desired revenue. Thus, letting the customers enjoy a snack that surely fits their budget. Also, there is no need to choose between a doughnut and an ice cream because DIC & Dip offers both as one.\r\n', '2018-2019', '2021-08-17 20:36:19', '2021-09-02 08:21:09', NULL),
(21, 168, 'Performance of Bachelor of Secondary Education Major in English LET Takers of  PUP-T, AY 2011-2015”\r\n', NULL, NULL, NULL, '', NULL, '\"This study determined the performance of Bachelor of Secondary Education Major in English LET takers of PUP Taguig A.Y. 2011-2015.\r\nThe respondents of the study were the graduates of PUP Taguig, Bachelor of Secondary Education Major in English, LET takers of the years 2011-2015. Statistical tools used were the following: Frequency and Percentage Distribution, Two-tailed test and Paired T-test.\r\nAs to significant differences between each subject for every LET result in five (5) years, it was concluded that there was no significant relationship between Gen. Ed and Prof. Ed. Subjects for April 2011, September 2011, March 2012, September 2012, September 2013 and January 2014. There is no significant difference between Prof. Ed and Major subjects for September 2011, March 2012, March 2013, September 2013, January 2014, August 2014 and March 2015. For April 2011, September 2011, and January 2014, there was no significant difference between Gen. Ed. and Major subjects.\r\nOn the other hand, it was discovered that there was a significant difference between Gen. Ed. and Prof. Ed. subjects for March 2013, August 2014, March 2015 and September 2015. There was a significant difference between Prof. Ed. and Major subjects for April 2011, September 2012 and September 2015. For September 2012, March 2013, August 2014, March 2015 and September 2015, there was a significant difference between Gen. Ed. and Major subjects.\r\n\r\nMeanwhile, for the averages in terms of remarks, it was evident that only for the results of September 2015, there was no significant difference found. However, for April 2011, September 2011, March 2012, September 2012, March 2013, September 2013, January 2014, August 2014 and March 2014, there was a significant difference between the averages in terms of its remarks, whether passed or failed.\r\nIt was also found out that for the significant difference between the examinees in every batch using their average, there was no significant difference for April 2011, September 2011, September 2012, March 2013, August 2014, March 2015 and September 2015. Nevertheless, there was a significant difference found between the averages of examines per batch for March 2012, September 2013 and January 2014.\r\nLastly, there was a significant difference between the averages of all batch for Pair 9, April 2011 and September 2015, Pair 20, March 2012 and September 2013, Pair 23, March 2012, and March 2015, Pair 24, March 2012 and September 2015, and Pair 42, January 2014 and September 2015. However, for the rest of the pairs, there was no significant difference found.\"\r\n', '2017-2018', '2021-08-17 20:36:19', '2021-09-02 08:21:27', NULL),
(22, 159, 'Practices on the Implementation of the Indicators of ‘A Child and Community-Centered Education System’ (ACCESs) among the Secondary Public Schools in the National Capital Region: Basis for Designing the Proposed School Strategic Plan\r\n', NULL, NULL, NULL, '', NULL, 'This study dealt with the input-process-output framework which determined the extent of practices on the implementation of the indicators of A Child and Community Education System (ACCESs) namely, Leadership and Governance, Curriculum and Learning, Accountability and Continuous Improvement, and Management of Resources. The bulk of this study focused on the regression analyses advised that the principal perception of the leadership responsibilities and accountabilities, both from the principal\'s and teacher\'s perspectives can be the basis to predict the chance of whether the school meets the quality standards. From the principal\'s perspective, Leadership and Governance, Curriculum and Learning, Accountability and Continuous Improvement, and Management of Resources are statistically significant predictors for school success; from the teacher\'s perspective, the four indicators are statistically significant predictors for school success. Implications of the findings were discussed.\r\n', '2017-2018', '2021-08-17 20:36:19', '2021-09-02 08:22:00', NULL),
(23, 160, 'Strategic Positioning Among Association of Private Schools in Taguig City and Pateros (AOSA-TAPAT)\r\n', NULL, NULL, NULL, '', NULL, '\"This study aimed to determine the strategic positioning among private schools in Association of Private Schools in Taguig City and Pateros (APSA TAPAT) towards the development of a comprehensive marketing plan. \r\nSpecifically, this study sought to answer the following questions: 1. What is the profile of the school? How often are the levels of strategic positioning among private APSA TAPAT applied by selected private schools in APSA TAPAT classified as: attributes: students, governance, finances, marketing strategies, Is there is significant difference between the levels of strategic positioning among private schools of APSA TAPAT as perceived by the respondents when they are grouped according to their profile and based on the findings of the study, what comprehensive marketing plan may be proposed? \r\nResults revealed the following: Majority of the teacher respondents are young, and dominated by females. Single and married teachers dominated the study. Almost all of the participants of the study are in the primary position or rank and new to the teaching profession, The strategic positioning of schools in APSA TAPAT in terms of attributes and students. Of were both practiced regularly. Similarly, in terms of governance, finance and marketing strategies, these are all practiced by the teacher respondents regularly. Finally, there is a significant difference in the extent of strategic positioning among private schools in APSA TAPAT and the civil status of the respondents; other profile variables do not have significant difference. In addition, the gender of the respondents significantly matters in the perception on the strategic positioning of private schools.\"\r\n', '2017-2018', '2021-08-17 20:36:19', '2021-09-02 13:22:14', NULL),
(24, 222, 'FABRICATING OF BRIQUETTE CHARCOAL MAKING MACHINE \r\n', NULL, NULL, NULL, '', NULL, 'Employing prototyping technique to prove the workability of the desired output of the study, this developmental research study includes testing the system ensuring proper intake water flow regulation, trash collection capacity and other measurable concerning factors set in the design. \r\n', '2017-2018', '2021-08-17 20:36:19', '2021-09-02 08:22:50', NULL),
(25, 176, 'SOLAR POWERED LCD Television\r\n', NULL, NULL, NULL, '', NULL, '    The system developed make used of alternating current one horsepower designed well water pump with suction maximum lift of twenty six feet and pressure maximum of fifty pounds per inch square. Given the specifications, approximately sixteen gallons of water per minute is handled by the capacity of the system. \r\n', '2017-2018', '2021-08-17 20:36:19', '2021-09-02 08:23:08', NULL),
(26, 201, 'Bar Afeti Lounge\r\n', NULL, NULL, NULL, '', NULL, '\"The main purpose of the said establishment is to provide convenience to the customers\r\nwho wanted to have fun, bond with friends and family, have drinks, and party wherein afterwards,\r\nthey can rest, sober up and spend the rest of their time in the said lounge. It will cater the needs of\r\nthe alcohol intoxicated customers who are not able to go home. It assures safety and security\r\nespecially to those drinkers who wanted to drink more and are not sober enough to get themselves\r\nhome because of intoxication.\"\r\n', '2017-2018', '2021-08-17 20:39:12', '2021-09-02 08:23:23', NULL),
(27, 181, 'CONSUMERS PREFERENCE AS THE BASIS OF PACKAGING FOR TIPAS HOPIA AT IBAYO TIPAS TAGUIG CITY\r\n', NULL, NULL, NULL, '', NULL, '\"Name of Institution Polytechnic University of the Philippines Taguig Address General\r\nSantos Avenue, Lower Bicutan,Taguig Title Consumer’s Preference as the Basis of Packaging for\r\nTipas Hopia at Ibayo Tipas, Taguig City Authors Angeles, Honeylyn M Astrero, Armida A Botor,\r\nDenice Anjielyn T Constantino, Adrian M Raña, Shiela May S Degree Bachelor of Science in\r\nBusiness Administration Major Marketing Management Date Started June 2016 Date Completed\r\nMarch 2017\"\r\n', '2017-2018', '2021-08-17 20:39:12', '2021-09-02 08:23:49', NULL),
(28, 137, 'Cafeme Feliz: A Feasibility On A Anime-Themed Cafe\r\n', NULL, NULL, NULL, '', NULL, 'Wanna eat your favorite viands but you’re on a diet? Don’t worry because the proponents’ business got it all solved for you! Café me Feliz offers pastries filled with your favorite Filipino dishes such as Adobo, Menudo, Humba, Chicken Curry, Mechado and Caldereta. And not only that, the café will also provide a cool and instagrammable place for both otakus and non- otakus in the urban. The business advocates named this business Café Me Feliz because of quite simple reasons. With the Spanish word Feliz which means “happy”, the business isn’t going to be a typical Café but a place where people can enjoy their “inner kid’ by being able to experience an anime themed cafe with quality services. The business will be providing pastry with a twist, that is, a pastry bread filled with Filipino cuisines inside. This inventive way of serving pastries was influenced by the Chinese Siopao, further developed by adding a Filipino flavor and style on it.\r\n', '2017-2018', '2021-08-17 20:39:12', '2021-09-02 08:24:04', NULL),
(29, 221, 'Rainbow Treats\r\n', NULL, NULL, NULL, '', NULL, 'Filipinos are well-known to be a big fan of food. They are undeniably fond of eating various kinds of cuisines, breads, desserts, snacks etc. Foods don’t just satisfy your cravings but they also bring happiness. They also strengthen ties between the family and circle of friends. Aside from the three basic meals a day, Filipinos usually have two light meals or also known as “merienda”. The first is a morning snack that may correspond to either brunch or second breakfast and the other one is the equivalent of afternoon snack. Nowadays, establishing and franchising food stalls are very rampant. Many entrepreneurs succeed in this type of venture because they aren’t that difficult and costly. Through these stalls, they can easily reach out their products to the customers of different ages. But today, the common problem is that the emerging businesses offer the same products and the customers are dissatisfied with it. In the field of economics, the Law of Diminishing Marginal Utility states that as a person increases consumption of a product while keeping consumption of other products constant, there is a decline in the marginal utility that person derives from consuming each additional unit of that product. As a solution to the existing problem, the proponents wanted to create and launch a new stall with new products that will surely attract customers. The stall offers new products namely colored mojos, cheese bites, tornadogs, octohotdogs and colored lemonades. 2 | P a g e Mojos literally means a marinade used throughout the Caribbean and South America that uses citrus juices as a base. It is commonly applied to chicken, beef, pork or seafood as a tropical flavoring. It is a marinade that became popular in Cuba and then spread throughout the South American countries.\r\n', '2017-2018', '2021-08-17 20:39:12', '2021-09-02 08:24:21', NULL),
(30, 206, 'A Tracer Study of the Bachelor in Secondary Education Graduates of PUP-Taguig Batch 2011-2015\r\n', NULL, NULL, NULL, '', NULL, '\"A tracer study is a comprehensive, objective and evaluative study that traces the current employment status of an institution\'s graduates and assesses their qualitative competencies with the job at hand. This tracer study focused on the current status of the graduates of Bachelor in Secondary Education from 2011-2015 with the intent to evaluate the performance of the BSED program and the kind of graduates it creates. The study used a descriptive research method. Through a questionnaire from the Commission on Higher Education (CHED) as the data gathering tool and percentage and distribution frequency as the statistical tools used, the researchers were able to gather the respondent\'s general profile, employment data, and their perception on the relevance of competencies learned in the program.\r\nResults showed that the majority of the respondents are Licensure Examination for Teachers (LET) passers, got their job within less than a month after graduating and currently employed with salary ranging from P10,000.00 to less than P15,000.00 per month. Facts present that the majority of the respondents are competent, well-equipped and at part with the standards and demands of the world employment market.\r\nFrom these findings, the study recommends that the University should increase the practice teaching hours of the students to enhance their exposures and experiences in the field while still in their formative years in school. It is also recommended that the Mentors Society should design intervention programs that would help in developing the student\'s competencies and skills such as financial literacy, self-branding, interpersonal skills, and career development. Furthermore, this study recommends that tracer studies should be conducted on a regular basis.\"\r\n', '2016-2017', '2021-08-17 20:39:12', '2021-09-02 08:24:50', NULL),
(31, 172, 'Employability as Correlates of the On-The-Job Training Program Feedback of the Employers among the Polytechnic University of the Philippines Taguig Practicumers\r\n', NULL, NULL, NULL, '', NULL, '\"This study aimed to determine the employability as correlates of the on-the-job training program feedback of employers among the Polytechnic University of the Philippines Taguig practicums.\r\nThe researcher utilized the descriptive method of research and documentary analysis. The descriptive method of research could go into the determination of factors that affect the employability status and qualifications of graduates. The respondents in this study were the employers from the different sectors who accommodated the PUPT practicums from the different courses.\r\nThis study utilized survey-checklist as prescribed by the Department of Labor and Employment (DOLE) manual in ensuring the effective on-the-job training and the feedback of the employers. The instrument includes the work habits, work skills, and social skills of the practicums.\r\nBased on the findings driven, it revealed that there are nine (9) courses in PUP Taguig Branch that have students would who undergo On-The-Job Training as prescribed in CHED Memo#30, series of 2004. There are 133 males and 271 females with a total of 404 trainees assigned to different companies based on their field. They were sent with Memorandum of Agreement (MOA) starting their functions relative to their field of study.\r\nIt also showed the rating or responses as assessed by the employers catered the PUPT practicums during the Appreciation Program where they were given chances to state and share their observations.\r\nIn terms of the feedback of employers in terms of work habits revealed that item 5 on work habits obtained the highest rating of 4.75, this indicates that the practicums demonstrate dedication and commitment to the tasks assigned to him/her.\r\nIn terms of the feedback of the employers according to practicums\' work skills, shows flexibility (whenever the need arises) in the process of going through his/her task ranks first or Fully Met while lowest rank is usually come up with sound suggestions to problems or Fully Met.\r\nIn terms of the assessment and feedback of the employers according to the practicums social skills where it reveals that the highest rank is Shows respect and courtesy in dealing with peers and superiors verbally interpreted as Exceeding Job Requirements and the lowest is Shows poise, self-confidence and is always well-groomed verbally interpreted as Fully Met.\r\nTo sum it up, the On-The-Job Training Program for PUPT has Fully Met the job requirements. The performance was what was expected of a person in his/her position. Hence, it is recommended that the OJT of PUPT must be intensified and calibrated in maintaining effective and competent graduates.\"\r\n', '2016-2017', '2021-08-17 20:39:12', '2021-09-02 08:25:06', NULL),
(32, 187, 'Impact Assessment of Exit Survey: Basis for Operational Plan”\r\n', NULL, NULL, NULL, '', NULL, '\"This study focused on the results of the exit survey conducted to graduating students in the Polytechnic University of the Philippines – Taguig Branch, on the school year 2016-2017 and this is aimed at improving the program and services of the school.\r\nThe study sought to answer the following specific questions: What is the profile of the respondents in the following demographic variables: Gender, Age and Sex; How do the respondents assess PUP-T in terms of the following areas: Academic Standards; School Activities; Faculty; Classmates; Facilities; Course Enrolled; and Student Organizations; How do the respondents assess the different offices/service departments of PUP-T in terms of Quality, Timeliness of Service and Courtesy of Staff; What is the respondent\'s overall evaluation of PUP-T Services; Is there a significant difference in the rating of the respondents of PUP-T when grouped according to course in terms of Academic Standards, School Activities, Faculty, difference in the assessment of respondents of the different offices/service departments of PUP-T in terms of Quality, Timeliness of Services and Courtesy of Staff when grouped according to course; and, what recommendations are suggested to improve the programs, services and system of PUP-T?\"\r\n', '2016-2017', '2021-08-17 20:39:12', '2021-09-02 08:25:20', NULL),
(33, 159, 'The Visual Merchandising Strategies of the Franchiser-Retailers in the National Capital Region\r\n', NULL, NULL, NULL, '', NULL, '\"The customer traffic noticed in uniquely presented retail stores is manifestation of the customer\'s freedom of choice from the variety of product brands that promise them relief or remedy to any of their problems or usage satisfaction. Many MSME retail outlets however, seem to have problems in effecting good store design since they still maintain their worn-out signage. Ineffective product presentations happen due to poor product display and poor customer service.\r\nIf retail establishments aim to cater to varied customers, how should the exterior and interior design visual presentation be like? This study focused to determine the effectiveness of visual communication of the retail environment design to enable brand concept support in order to attract, inform, and persuade prospective retail customers. \"\r\n', '2016-2017', '2021-08-17 20:39:12', '2021-09-02 08:25:50', NULL),
